INSERT INTO `broadcast_text_locale` VALUES (137342, 'enUS', 'Our world is wounded, champion. Its life essence seeps out into the sands... just as Magni foresaw.', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (137343, 'enUS', 'This mere drop of Argus\'s blood surges with incredible power. The might of a titan.', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (137344, 'enUS', 'If the blood of Azeroth also proves to be a source of such strength... those who seek to rule this world will stop at nothing to possess it.', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (137345, 'enUS', 'The days ahead may be dark indeed. For now... go to Silithus. Gaze upon the wound in the world with your own eyes.', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (137346, 'enUS', 'We will find a way to save Azeroth, $n. I know it.', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (137347, 'enUS', 'I am not certain what will come of this, but I feel in my bones that this day is one to remember.', 'I am not certain what will come of this, but I feel in my bones that this day is one to remember.', 26124);
INSERT INTO `broadcast_text_locale` VALUES (137348, 'enUS', 'It is good to see so many familiar faces. Many have come to hear Kil\'jaeden speak.', 'It is good to see so many familiar faces. Many have come to hear Kil\'jaeden speak.', 26124);
INSERT INTO `broadcast_text_locale` VALUES (137349, 'enUS', 'Quite a gathering, isn\'t it?', 'Quite a gathering, isn\'t it?', 26124);
INSERT INTO `broadcast_text_locale` VALUES (137350, 'enUS', 'The Triumvirate\'s wisdom has brought us to this point. I hope they know what they are doing, or this could end poorly...', 'The Triumvirate\'s wisdom has brought us to this point. I hope they know what they are doing, or this could end poorly...', 26124);
INSERT INTO `broadcast_text_locale` VALUES (137351, 'enUS', 'What do you think Archimonde and Velen are arguing about?', 'What do you think Archimonde and Velen are arguing about?', 26124);
INSERT INTO `broadcast_text_locale` VALUES (137352, 'enUS', 'I am not at all sure about this pronouncement.', 'I am not at all sure about this pronouncement.', 26124);
INSERT INTO `broadcast_text_locale` VALUES (137353, 'enUS', 'What a joyous day for the Eredar! We will soon ascend to our rightful place!', 'What a joyous day for the Eredar! We will soon ascend to our rightful place!', 26124);
INSERT INTO `broadcast_text_locale` VALUES (137354, 'enUS', 'Praise Kil\'jaeden! Praise Sargeras!', 'Praise Kil\'jaeden! Praise Sargeras!', 26124);
INSERT INTO `broadcast_text_locale` VALUES (137355, 'enUS', 'Finally we will know our true destiny! Glory to the Eredar!', 'Finally we will know our true destiny! Glory to the Eredar!', 26124);
INSERT INTO `broadcast_text_locale` VALUES (137356, 'enUS', 'Change is coming. This is a very important moment for our people.', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (137357, 'enUS', '<Hatuun impassively watches Kil\'jaeden speak.>', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (137358, 'enUS', 'It has been some time since Kil\'jaeden last addressed his people. This must be an important occasion.', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (137359, 'enUS', 'Kil\'jaeden will usher in a new era of prosperity for all Eredar. He will be remembered as our greatest leader!', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (137360, 'enUS', 'What does Kil\'jaeden have planned for us, I wonder?', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (137361, 'enUS', '<Talgath watches Archimonde and Velen, only occasionally glancing to Kil\'jaeden.>$b$bHmm.', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (137362, 'enUS', 'The Triumvirate have guided us for so very long. What does this stranger bring that we did not already have?', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (137363, 'enUS', 'Have you noticed anything strange about this gathering?', 'Have you noticed anything strange about this gathering?', 26124);
INSERT INTO `broadcast_text_locale` VALUES (137364, 'enUS', 'Reveal yourself, demon.', 'Reveal yourself, demon.', 26124);
INSERT INTO `broadcast_text_locale` VALUES (137365, 'enUS', 'I am trying to listen. Go away!', 'I am trying to listen. Go away!', 26124);
INSERT INTO `broadcast_text_locale` VALUES (137366, 'enUS', 'Preposterous! Begone!', 'Preposterous! Begone!', 26124);
INSERT INTO `broadcast_text_locale` VALUES (137367, 'enUS', 'How dare you suggest such a thing!', 'How dare you suggest such a thing!', 26124);
INSERT INTO `broadcast_text_locale` VALUES (137368, 'enUS', 'Ah, you caught me. Now die!', 'Ah, you caught me. Now die!', 26124);
INSERT INTO `broadcast_text_locale` VALUES (137369, 'enUS', 'No, YOU\'RE a demon!', 'No, YOU\'RE a demon!', 26124);
INSERT INTO `broadcast_text_locale` VALUES (137370, 'enUS', 'Very clever. Who would ever suspect a child?', 'Very clever. Who would ever suspect a child?', 26124);
INSERT INTO `broadcast_text_locale` VALUES (137371, 'enUS', 'Look how many people there are! Are we going to have a party?', 'Look how many people there are! Are we going to have a party?', 26124);
INSERT INTO `broadcast_text_locale` VALUES (137372, 'enUS', '<The child seems to be crying inconsolably.>', '<The child seems to be crying inconsolably.>', 26124);
INSERT INTO `broadcast_text_locale` VALUES (137415, 'enUS', 'It\'s rough out there for my riders.', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (137433, 'enUS', 'The weaklings press their assault! Immortal Squadron, attack!', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (137439, 'enUS', 'N..No! Ahh! Get back! Mine!', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (137440, 'enUS', 'ow! OW! OW OW OW!!!', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (137441, 'enUS', 'Err.. no! Back! Back! Away with you!', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (137442, 'enUS', 'Must get... freeeeeeeeeee!', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (137443, 'enUS', 'Ah he he he! All mine! Allllllll mine!', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (137445, 'enUS', 'My things! Must... warn... the others...', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (137467, 'enUS', 'My people lost their world to the void years ago and were scattered to the winds. I have a feeling some old friends are soon to show their faces on Argus.$b$bNot literally, of course.', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (137468, 'enUS', 'Why is an ethereal traveling on a ship full of draenei?', 'Why is an ethereal traveling on a ship full of draenei?', 26124);
INSERT INTO `broadcast_text_locale` VALUES (137469, 'enUS', 'You should know something, friend $r. T\'paartos did not choose $n because of your puniness.', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (137470, 'enUS', 'T\'paartos saw $n\'s heart on the field of battle. You are the bravest $c T\'paartos has ever seen.', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (137471, 'enUS', 'Other children were... not always kind to T\'paartos.', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (137473, 'enUS', 'Without enough power, I had to make a few... improvisations. They did not make me the grand artificer for no reason! Overloading the matrix core, refactoring the...$b$bIt matters not. What does matter is that the cannon will do its job. We will destroy the gates of Antorus and defeat the Legion.$b$bAre you ready, $n?', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (137474, 'enUS', 'Fire!', 'Fire!', 26124);
INSERT INTO `broadcast_text_locale` VALUES (137481, 'enUS', 'Ah he he he! What a lovely day for meeeeeee!', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (137503, 'enUS', '', '<It would seem her watch has finally ended.>', 26124);
INSERT INTO `broadcast_text_locale` VALUES (137507, 'enUS', 'Curse your soul!', 'Curse your soul!', 26124);
INSERT INTO `broadcast_text_locale` VALUES (137510, 'enUS', 'Kill you! Take your things!', 'Kill you! Take your things!', 26124);
INSERT INTO `broadcast_text_locale` VALUES (137511, 'enUS', 'Yes, yes more trinkets, give them to me!', 'Yes, yes more trinkets, give them to me!', 26124);
INSERT INTO `broadcast_text_locale` VALUES (137512, 'enUS', 'T\'paartos remembers a place like this...', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (137513, 'enUS', 'T\'paartos was lost for days.', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (137514, 'enUS', 'Come. T\'paartos thinks he knows what little T\'paartos might do.', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (137518, 'enUS', '', 'How\'d a runt like you get so FAT, T\'paartos?', 26124);
INSERT INTO `broadcast_text_locale` VALUES (137519, 'enUS', 'Fatty probably doesn\'t understand the question \'cause he\'s so STUPID!', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (137520, 'enUS', '', 'Aww, the fat runt is crying!', 26124);
INSERT INTO `broadcast_text_locale` VALUES (137521, 'enUS', 'Hahahaha! What a BABY!', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (137522, 'enUS', 'Should we go after him?', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (137524, 'enUS', '', 'Nah. Let tubby go play with his frogs.', 26124);
INSERT INTO `broadcast_text_locale` VALUES (137539, 'enUS', '', 'How delightful... a snack before my main course!', 26124);
INSERT INTO `broadcast_text_locale` VALUES (137564, 'enUS', 'The Orders are sharing their resources, and you are no longer required to research Artifact Knowledge. Together, we have researched all possible Artifact Knowledge.', 'The Orders are sharing their resources, and you are no longer required to research Artifact Knowledge. Together, we have researched all possible Artifact Knowledge.', 26124);
INSERT INTO `broadcast_text_locale` VALUES (137565, 'enUS', '<View Aggramar\'s Rise.>', '<View Aggramar\'s Rise.>', 26124);
INSERT INTO `broadcast_text_locale` VALUES (137566, 'enUS', '<View the Breaking of the Pantheon.>', '<View the Breaking of the Pantheon.>', 26124);
INSERT INTO `broadcast_text_locale` VALUES (137567, 'enUS', '<View the Life-Binder\'s Plea.>', '<View the Life-Binder\'s Plea.>', 26124);
INSERT INTO `broadcast_text_locale` VALUES (137598, 'enUS', 'The Orders are sharing their resources, and you are no longer required to research Artifact Knowledge. Together, we have researched all possible Artifact Knowledge.', 'The Orders are sharing their resources, and you are no longer required to research Artifact Knowledge. Together, we have researched all possible Artifact Knowledge.', 26124);
INSERT INTO `broadcast_text_locale` VALUES (137599, 'enUS', '', 'This land has gone through many hardships in the past but the final story of this grand temple has yet to be revealed. $B$BIf you wish to relive days gone by, I can allow you to visit the past for a short time.', 26124);
INSERT INTO `broadcast_text_locale` VALUES (137600, 'enUS', 'Show me the Peak of Serenity before the Legion attacked.', 'Show me the Peak of Serenity before the Legion attacked.', 26124);
INSERT INTO `broadcast_text_locale` VALUES (137611, 'enUS', 'I will transform you, granting you knowledge beyond imagining and might beyond measure.', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (137612, 'enUS', 'But they were blinded by their vanity... their hunger for power.', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (137613, 'enUS', 'We would be transformed not into wise leaders, but into hateful monsters.', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (137617, 'enUS', '|TInterface\\Icons\\warrior_talent_icon_mastercleaver.blp:20|tSotanathor\'s axe sends out |cFFFF0000|Hspell:181498|h[Wakes of Destruction]|h|r!', '|TInterface\\Icons\\warrior_talent_icon_mastercleaver.blp:20|tSotanathor\'s axe sends out |cFFFF0000|Hspell:181498|h[Wakes of Destruction]|h|r!', 26124);
INSERT INTO `broadcast_text_locale` VALUES (137644, 'enUS', 'Do you know anyone by the name \"Locus-Walker\"?', 'Do you know anyone by the name \"Locus-Walker\"?', 26124);
INSERT INTO `broadcast_text_locale` VALUES (137645, 'enUS', '<Vashreen makes a noise that is certainly not complimentary.>$b$bI know that a disreputable individual by that name sought me out as a financier of a project that sounded profitable, and has never repaid my investment.', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (137648, 'enUS', '', '<The essence of Eonar hovers before you. You sense both relief and gratitude; but a sense of urgency and purpose cuts short the joy of victory.>', 26124);
INSERT INTO `broadcast_text_locale` VALUES (137650, 'enUS', 'Send me back to Antorus.', 'Send me back to Antorus.', 26124);
INSERT INTO `broadcast_text_locale` VALUES (137679, 'enUS', 'T\'paartos loved to talk to animals. They listened and liked him.', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (137680, 'enUS', 'When T\'paartos was scared, he found a place to hide.', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (137681, 'enUS', 'T\'paartos loved to dig and find things.', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (137682, 'enUS', 'T\'paartos remembers a place like this one. A time he dug too deep.', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (137683, 'enUS', 'T\'paartos ran and ran. Got lost for days.', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (137684, 'enUS', 'Even shadows looked like monsters to T\'paartos.', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (137685, 'enUS', 'Finally, T\'paartos decided to stop being so afraid of dark and left cave.', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (137686, 'enUS', 'This place reminds T\'paartos of another time he went where he wasn\'t supposed to.', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (137687, 'enUS', 'Not all flowers were just flowers.', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (137688, 'enUS', 'But moving flowers not always bad! They just want to eat bugs.', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (137698, 'enUS', 'Yes, I want to test myself against the toughest that Argus has to offer.', 'Yes, I want to test myself against the toughest that Argus has to offer.', 26124);
INSERT INTO `broadcast_text_locale` VALUES (137717, 'enUS', '|TInterface\\Icons\\SPELL_NATURE_SLEEP:20|t%s targets you with a |cFFFF0000|Hspell:254244|h[Sleep Canister]|h|r!', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (137723, 'enUS', 'Bring me the eyes of every demon you can, off-worlder. I shall reward you handsomely.', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (137724, 'enUS', 'Another agent pledges to serve? More eyes, more visions for the All-Seer.', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (137725, 'enUS', 'Scoop the eyes from demon skulls, off-worlder. I would see what they see.', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (137726, 'enUS', 'Are ye ready, $p?', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (137727, 'enUS', 'Every demon\'s eyes have seen a thousand worlds. Fetch them for me, that I too may see.', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (137729, 'enUS', 'I\'m ready.', 'I\'m ready.', 26124);
INSERT INTO `broadcast_text_locale` VALUES (137735, 'enUS', 'You may not enter while disguised!', 'You may not enter while disguised!', 26124);
INSERT INTO `broadcast_text_locale` VALUES (137738, 'enUS', 'Intruder!', 'Intruder!', 26124);
INSERT INTO `broadcast_text_locale` VALUES (137739, 'enUS', 'Heretic!', 'Heretic!', 26124);
INSERT INTO `broadcast_text_locale` VALUES (137740, 'enUS', 'Interloper!', 'Interloper!', 26124);
INSERT INTO `broadcast_text_locale` VALUES (137741, 'enUS', 'Traitor!', 'Traitor!', 26124);
INSERT INTO `broadcast_text_locale` VALUES (137786, 'enUS', '<Stay awhile and listen.>', '<Stay awhile and listen.>', 26124);
INSERT INTO `broadcast_text_locale` VALUES (137791, 'enUS', 'This is what the Legion does to its \"allies\"...$b$bWe were right to reject their offer.', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (137792, 'enUS', 'If only Oculeth were here. He would have had a field day studying this ship.$b$b...$b$bAnd probably have figured out a way to destroy it by now. You are right, probably for the best that he did not come with us.', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (137793, 'enUS', 'I do hope that Arluelle is keeping up her lessons. I gave her a small list of exercises to do every day.$b$bInterested? It\'s quite simple. One hundred push ups. One hundred sit ups. One hundred squats. A ten thousand, nine hundred thirty-six yard run.', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (137794, 'enUS', 'The treasure is guarded by powerful magic. Only one shrouded in the right sort of power can access it.', 'The treasure is guarded by powerful magic. Only one shrouded in the right sort of power can access it.', 26124);
INSERT INTO `broadcast_text_locale` VALUES (137795, 'enUS', 'The spell guarding the treasure falls away as the Shroud of Arcane Echoes covers you.', 'The spell guarding the treasure falls away as the Shroud of Arcane Echoes covers you.', 26124);
INSERT INTO `broadcast_text_locale` VALUES (137796, 'enUS', 'Only the chosen of the Shroud may have this treasure.', 'Only the chosen of the Shroud may have this treasure.', 26124);
INSERT INTO `broadcast_text_locale` VALUES (137797, 'enUS', 'I wonder how everyone is doing back in Suramar. I am sure they have everything under control.$b$bI do miss sparring with Victoire, though. She is a worthy opponent.', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (137798, 'enUS', 'These lightforged draenei have spent lifetimes fighting the Legion. Perhaps even I could learn a thing or two from them.$b$bPerhaps.', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (137799, 'enUS', '<Silgryn seems to be deep in thought, as he is even more stoic and silent than usual.>', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (137800, 'enUS', '', 'The Legion will meet its end here. The Light is with us.', 26124);
INSERT INTO `broadcast_text_locale` VALUES (137801, 'enUS', '', 'Look at this, $c. A ship, powered by the Light. An army of soldiers, empowered and as long-lived as the elves. Truly a worthy force for this crusade.', 26124);
INSERT INTO `broadcast_text_locale` VALUES (137802, 'enUS', '', 'Would that I could have brought more of our blood knights. We could learn much from these warriors.', 26124);
INSERT INTO `broadcast_text_locale` VALUES (137803, 'enUS', '', 'We have sworn to defeat the Legion. One battlefield is much like any other, even if it is on a completely different world.', 26124);
INSERT INTO `broadcast_text_locale` VALUES (137804, 'enUS', '', 'I cannot believe I set foot on a different world yet again. From the worlds of Draenor and Outland to the one overtaken by the Legion where we chased down Gul\'dan and Teron\'gor, it still takes my breath away. Argus is a grim lesson that we cannot lose to the Legion.', 26124);
INSERT INTO `broadcast_text_locale` VALUES (137809, 'enUS', 'They are growing well, considering how close we are to the Conservatory. Give it a month and they will be powerful enough to light a home for a lifetime. Another year and they can act as a sentry.$b$b<He rests a hand on a nearby crystal\'s surface. The crystal glows gently as a result.>$b$bI grow the finest crystals anywhere.', 'They are growing well, considering how close we are to the Conservatory. Give it a month and they will be powerful enough to light a home for a lifetime. Another year and they can act as a sentry.$b$b<She rests a hand on a nearby crystal\'s surface. The crystal glows gently as a result.>$b$bI grow the finest crystals anywhere.', 26124);
INSERT INTO `broadcast_text_locale` VALUES (137811, 'enUS', 'I named it Flapper!', 'I named it Flapper!', 26124);
INSERT INTO `broadcast_text_locale` VALUES (137812, 'enUS', 'Take him down!', 'Take him down!', 26124);
INSERT INTO `broadcast_text_locale` VALUES (137813, 'enUS', 'What a move!', 'What a move!', 26124);
INSERT INTO `broadcast_text_locale` VALUES (137814, 'enUS', 'Did you see that?', 'Did you see that?', 26124);
INSERT INTO `broadcast_text_locale` VALUES (137815, 'enUS', 'That had to hurt.', 'That had to hurt.', 26124);
INSERT INTO `broadcast_text_locale` VALUES (137816, 'enUS', 'Who do you think will win?', 'Who do you think will win?', 26124);
INSERT INTO `broadcast_text_locale` VALUES (137817, 'enUS', 'Excellent!', 'Excellent!', 26124);
INSERT INTO `broadcast_text_locale` VALUES (137818, 'enUS', 'What a clash!', 'What a clash!', 26124);
INSERT INTO `broadcast_text_locale` VALUES (137819, 'enUS', 'The competition is fierce this year. The victor will have much to be proud of.', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (137820, 'enUS', 'I would not worry too much about their heads. Only males with the thickest crests choose to compete, and these are the best Mac\'Aree has to offer.', 'I would not worry too much about their heads. Only males with the thickest crests choose to compete, and these are the best Mac\'Aree has to offer.', 26124);
INSERT INTO `broadcast_text_locale` VALUES (137821, 'enUS', 'I had a hand in picking the trophy for this tournament. I think our winner will be very pleased with their prize.', 'I had a hand in picking the trophy for this tournament. I think our winner will be very pleased with their prize.', 26124);
INSERT INTO `broadcast_text_locale` VALUES (137822, 'enUS', 'I have participated in a round or two of Jed\'hin in my life, but these competitors are far better than I could ever hope to be. I must admit, I am envious! Haha!', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (137823, 'enUS', 'One of my men is competing. A fine fighter! He is no Champion Vorusk, but a worthy combatant in this tournament nonetheless.', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (137824, 'enUS', 'They\'re so big! Boom! Crash! Pow!\n\n<Naielle animatedly mimics their motions.>', 'They\'re so big! Boom! Crash! Pow!\n\n<Naielle animatedly mimics their motions.>', 26124);
INSERT INTO `broadcast_text_locale` VALUES (137825, 'enUS', 'Charming little game, is it not? I like to think we must practice such a basic ritual to remind ourselves how far we have come. Argus has much to be proud of.', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (137831, 'enUS', '<He appears to be talking to himself.>\n\nPerhaps if I invert the pulse rate and direct it into a vertical pylon, I can... What am I saying? That makes no sense.', '<She appears to be talking to herself.>\n\nPerhaps if I invert the pulse rate and direct it into a vertical pylon, I can... What am I saying? That makes no sense.', 26124);
INSERT INTO `broadcast_text_locale` VALUES (137832, 'enUS', '<He frantically turns pages in a massive tome.>\n\nHow am I ever going to memorize all of this?', '<She frantically turns pages in a massive tome.>\n\nHow am I ever going to memorize all of this?', 26124);
INSERT INTO `broadcast_text_locale` VALUES (137833, 'enUS', 'I should have become an Artificer like my mother wanted.', 'I should have become an Artificer like my mother wanted.', 26124);
INSERT INTO `broadcast_text_locale` VALUES (137834, 'enUS', 'I hope I am selected to be a Wakener. Soulbinding is fascinating magic, and I get to work with Vigilants. Perhaps I can even inhabit one myself some day, like Quoram.\n\nThen again, I do like eating food... Maybe not...', 'I hope I am selected to be a Wakener. Soulbinding is fascinating magic, and I get to work with Vigilants. Perhaps I can even inhabit one myself some day, like Quoram.\n\nThen again, I do like eating food... Maybe not...', 26124);
INSERT INTO `broadcast_text_locale` VALUES (137835, 'enUS', 'Do you think Aargon will let me switch to Consular? I don\'t think I\'m very good at this at all. Surely I can manage a familiar or two at least!', 'Do you think Aargon will let me switch to Consular? I don\'t think I\'m very good at this at all. Surely I can manage a familiar or two at least!', 26124);
INSERT INTO `broadcast_text_locale` VALUES (137836, 'enUS', 'I am home. I have been lost for so long, stranded on a strange world with strange people... There are no words for this moment.', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (137837, 'enUS', 'Long ago, the withering slaves of the Annihilan Pits held their ground in a rebellious effort to free the people of Krokuun from their bonds.$B$BThese shackles remind the inhabitants of Krokuun of the struggles endured to retain what semblance of freedom remains.', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (137838, 'enUS', 'Crafted by an ancient Krokul smith, the scythe\'s markings reveal a strenuous history of battle between the Burning Legion and the Krokul.$B$BIts foggy, shale-colored blade is chipped, speckled with a darkened, dried liquid around the blade\'s edge.$B$BThe taut handle crafted from talbuk hide is well-worn, with a slight imprint of where its owner\'s grip once wielded this magnificent tool-turned-weapon into battle.', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (137839, 'enUS', 'Most of the flora on Argus has long succumbed to its inevitable demise, though a once-journeyed cavern, whose location was never truly revealed, yielded this magnificent specimen.$B$BSince its arrival, the aura surrounding this mysterious plant has yet to dim below the level of a radiantly glowing crystal, once a prominent fixture among the Argussian landscape, but now only a memory of stories past.', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (137840, 'enUS', 'The ink is marred from endless eons of weathering, rendering the text illegible.', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (137841, 'enUS', 'Tales often echo throughout the hovel\'s porous, rocky surroundings. Whispers of brave krokul scouts - those responsible for locating survivors after the Burning Legion made their mark upon this world.$B$BOne such tale speaks of an encounter with one of the Dark One\'s fel-emblazoned demon lords whose size was only surpassed by its power to wield destruction.$B$BThis monstrous, horned skull cap is all that remains. A reminder to the Krokul people that tales often begin with eager exploration in search of hope, and often end in grievous distress and suffering, but sometimes... victory.', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (137842, 'enUS', 'I cannot believe what has befallen our world.$b$bLooking out there, I see nothing but hatred. Nothing but desolation.$b$bPart of me is glad that I must stay here aboard the Vindicaar. I would not want to set hoof on that accursed ground.$b$bI have locked in coordinates below our position, close enough for you to establish the teleporter. Let me know when you have finished your preparations.', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (137843, 'enUS', 'Mac\'Aree... it looks just like how I remember it. The forests, the hills, the herds of talbuk...$b$bI wonder if my old workshop is still down there. Do you think if you had a moment, you could ...?$b$bForgive me. You have much more important things to do. Let me know when you are ready to go to the surface.', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (137844, 'enUS', 'I am ready, Romuul.', 'I am ready, Romuul.', 26124);
INSERT INTO `broadcast_text_locale` VALUES (137845, 'enUS', 'Long after the emerald flame took our home, the Legion took to open a gate to a new world. Never had they lusted for any conquest as much as this lush, primitive land.\n\nJust as their armies set forth, a green-skinned warrior stepped through the gate. He wielded a single blade -- and roared a single cry for battle.\n\nMountains of flesh and bone grew as he carved through the demons\' ranks. His defiance drew the attention of the Dark One -- who came to see his end.\n\nThe warrior struck but one blow before he fell, but it was never forgotten.', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (137846, 'enUS', 'A new world, if it can be called that.$b$bSo this is what the Legion wishes to do to Azeroth...', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (137847, 'enUS', 'We are here to provide what support we can. Good luck out there, champion.', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (137848, 'enUS', 'What a remarkable vessel. It seems to use the crystals the draenei are so fond of to stay afloat. Perhaps we can use these crystals to store arcane powers as well?', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (137849, 'enUS', 'Fel magic has permeated this entire world. It is difficult to say if there is any part of it that isn\'t corrupted.', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (137850, 'enUS', '<Aethas seems to be bothered by something.>', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (137852, 'enUS', 'After Illidan opened the way to Argus, I was sure that we had made a grave mistake. Now, I believe there is hope.$b$bI must believe there is hope.', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (137854, 'enUS', 'The lightforged appear to be infused with the very essence of the Light. It is no wonder they have been such a powerful force against the Legion.', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (137855, 'enUS', 'One by one, we have defeated the mightiest agents of the Legion. But now we must face their true power...', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (137856, 'enUS', 'I do hope the other members of the Council of Six are all right. I mean, of course they\'re going to be fine. They are all powerful archmagi! Yes. This is fine.', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (137858, 'enUS', 'I have faced the Legion on Azeroth and Draenor, even witnessed their corruption seeping through the timeways.\n\nBut until the rift to Argus opened, I could never have conceived the true depths of their evil. To see how they have twisted this world...\n\nThey will do the same to Azeroth unless we stop them.', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (137863, 'enUS', '', 'So many demons, so many targets...', 26124);
INSERT INTO `broadcast_text_locale` VALUES (137864, 'enUS', '', 'It is truly remarkable how much time has passed, even for an elf. Surely much has changed on Azeroth in our absence.', 26124);
INSERT INTO `broadcast_text_locale` VALUES (137870, 'enUS', '', 'The Vindicaar is truly a marvel of the Light, a symbol of what the eredar were. What the draenei still are. Although, do take note that not all of the rooms are as magnificent as this. Some of them are quite confining.', 26124);
INSERT INTO `broadcast_text_locale` VALUES (137871, 'enUS', '', '<Alleria gives you a wry smile.>$b$bAnother beautiful day on Argus.$b$bAlthough, now that I can see our home in the sky, I am filled with hope. Returning home is no longer a dream. It is a certainty.', 26124);
INSERT INTO `broadcast_text_locale` VALUES (137872, 'enUS', 'It is nice to see new, friendly faces. It has been so long since I have seen another $Gman:woman; from Azeroth!', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (137873, 'enUS', 'The Army of the Light will not rest until we have destroyed the Burning Legion.', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (137874, 'enUS', 'It is a joy beyond words to look up in the sky and see Azeroth once more. Home, so close that I feel like I can reach up and touch it.$b$bBut within the grasp of the Legion. We must stop them before we can plan on returning.', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (137875, 'enUS', 'I have seen you taking an interest in our warframes, champion. They are truly fearsome instruments of war, capable of dealing and withstanding much damage. They are even capable of flight, although we need to keep a low profile to avoid attracting the attention of the Legion.', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (137876, 'enUS', 'I am glad that Khadgar chose to accompany you. His is the only face among your cohort that I recognize. Has it truly been so long?$b$b<Turalyon\'s gaze shifts away from you.>$b$bHah! I can see he still hasn\'t changed. Speak his name and...', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (137877, 'enUS', '', '<You catch Alleria out of the corner of your eye. She\'s looking at your bow.>', 26124);
INSERT INTO `broadcast_text_locale` VALUES (137904, 'enUS', 'Watch your step, mortal.', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (137914, 'enUS', 'I wouldn\'t go that way if I were you...', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (137915, 'enUS', 'Some demons enjoy standing in the fire... you should try it sometime.', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (137916, 'enUS', 'Don\'t mind me, just watching your every move.', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (137917, 'enUS', 'Don\'t stop what you\'re doing on my account. I\'ll be right here.', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (137918, 'enUS', 'So this is what passes for skill among mortals? Interesting...', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (137919, 'enUS', 'Ah, I\'ve seen this before. It didn\'t work out for the last guy.', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (137920, 'enUS', 'Why wait for your friends? You are a strong, powerful mortal!', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (137921, 'enUS', 'Oh finally, something worth watching! Go on then, entertain me.', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (137922, 'enUS', 'A fresh set of eyes... just what I needed.', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (137934, 'enUS', 'It has been so very long since I have laid eyes on this place. The memories... overwhelm me.', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (137935, 'enUS', 'What happened here, Prophet?', 'What happened here, Prophet?', 26124);
INSERT INTO `broadcast_text_locale` VALUES (137936, 'enUS', 'Did you mean to do that?', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (137937, 'enUS', 'Where did Thaumaturge Vashreen go with the Relinquished items?', 'Where did Thaumaturge Vashreen go with the Relinquished items?', 26124);
INSERT INTO `broadcast_text_locale` VALUES (137938, 'enUS', '', 'Vashreen? He mentioned something about procuring new items and relocating to the Vindicaar on Argus.', 26124);
INSERT INTO `broadcast_text_locale` VALUES (137939, 'enUS', '', 'What just happened? Did he... kill her?', 26124);
INSERT INTO `broadcast_text_locale` VALUES (137940, 'enUS', 'I cannot believe my eyes...', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (137941, 'enUS', '', 'That was... unexpected. To think he had enough power to destroy her...', 26124);
INSERT INTO `broadcast_text_locale` VALUES (137942, 'enUS', 'What will we do now?', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (137943, 'enUS', 'By the Light...', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (137944, 'enUS', '<Turalyon is staring grimly at Illidan.>', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (137945, 'enUS', '', 'Thank you for coming. I have my suspicions about these spirits here, but I will need some of their essence to learn the truth.$b$bTake this attuning crystal and use it near any spirits that seem more solid than others.$b$bBe careful, though-- they may become angered by the attuning.', 26124);
INSERT INTO `broadcast_text_locale` VALUES (137946, 'enUS', '<Take the Attuning Crystal.>', '<Take the Attuning Crystal.>', 26124);
INSERT INTO `broadcast_text_locale` VALUES (137947, 'enUS', 'Everyone to the Vindicaar at once!', 'Everyone to the Vindicaar at once!', 26124);
INSERT INTO `broadcast_text_locale` VALUES (137948, 'enUS', 'Fall back! We are no longer safe here.', 'Fall back! We are no longer safe here.', 26124);
INSERT INTO `broadcast_text_locale` VALUES (137949, 'enUS', 'By the Light... The demons come again! We must evacuate.', 'By the Light... The demons come again! We must evacuate.', 26124);
INSERT INTO `broadcast_text_locale` VALUES (137950, 'enUS', 'The camp is about to be overrun. We must get to safety!', 'The camp is about to be overrun. We must get to safety!', 26124);
INSERT INTO `broadcast_text_locale` VALUES (137951, 'enUS', 'The demons approach! Everyone to the Vindicaar. Quickly!', 'The demons approach! Everyone to the Vindicaar. Quickly!', 26124);
INSERT INTO `broadcast_text_locale` VALUES (137952, 'enUS', 'Demons! Inbound! Get to safety at once!', 'Demons! Inbound! Get to safety at once!', 26124);
INSERT INTO `broadcast_text_locale` VALUES (137953, 'enUS', 'The Legion approaches! Seek cover!', 'The Legion approaches! Seek cover!', 26124);
INSERT INTO `broadcast_text_locale` VALUES (137954, 'enUS', 'The demons come! Make haste for the Vindicaar!', 'The demons come! Make haste for the Vindicaar!', 26124);
INSERT INTO `broadcast_text_locale` VALUES (137955, 'enUS', 'Weapons at the ready!', 'Weapons at the ready!', 26124);
INSERT INTO `broadcast_text_locale` VALUES (137956, 'enUS', 'The demons fast approach! Prepare for battle!', 'The demons fast approach! Prepare for battle!', 26124);
INSERT INTO `broadcast_text_locale` VALUES (137957, 'enUS', 'Light guide us... The demons come!', 'Light guide us... The demons come!', 26124);
INSERT INTO `broadcast_text_locale` VALUES (137958, 'enUS', 'Pheta thones gamera. Here they come!', 'Pheta thones gamera. Here they come!', 26124);
INSERT INTO `broadcast_text_locale` VALUES (137959, 'enUS', 'The skies will be swarming soon enough. Ready your blades!', 'The skies will be swarming soon enough. Ready your blades!', 26124);
INSERT INTO `broadcast_text_locale` VALUES (137960, 'enUS', 'Defensive positions! The Legion approaches!', 'Defensive positions! The Legion approaches!', 26124);
INSERT INTO `broadcast_text_locale` VALUES (137961, 'enUS', 'Demons incoming! Prepare yourselves!', 'Demons incoming! Prepare yourselves!', 26124);
INSERT INTO `broadcast_text_locale` VALUES (137962, 'enUS', 'The demons approach. Hold them off as long as we can!', 'The demons approach. Hold them off as long as we can!', 26124);
INSERT INTO `broadcast_text_locale` VALUES (137963, 'enUS', 'The northern skies swell with chaotic energy.', 'The northern skies swell with chaotic energy.', 26124);
INSERT INTO `broadcast_text_locale` VALUES (137964, 'enUS', 'The demons approach. Ready your glaives!', 'The demons approach. Ready your glaives!', 26124);
INSERT INTO `broadcast_text_locale` VALUES (137965, 'enUS', 'The Burning Legion approaches. Prepare yourselves.', 'The Burning Legion approaches. Prepare yourselves.', 26124);
INSERT INTO `broadcast_text_locale` VALUES (137966, 'enUS', 'Stand your ground, Illidari! The demons come.', 'Stand your ground, Illidari! The demons come.', 26124);
INSERT INTO `broadcast_text_locale` VALUES (137967, 'enUS', 'The demons come. Ready your blades.', 'The demons come. Ready your blades.', 26124);
INSERT INTO `broadcast_text_locale` VALUES (137968, 'enUS', 'Illidari! The Burning Legion\'s presence grows near!', 'Illidari! The Burning Legion\'s presence grows near!', 26124);
INSERT INTO `broadcast_text_locale` VALUES (137969, 'enUS', 'The demons swarm the skies, poised to attack. Ready yourselves for battle.', 'The demons swarm the skies, poised to attack. Ready yourselves for battle.', 26124);
INSERT INTO `broadcast_text_locale` VALUES (137970, 'enUS', '%s shimmers as it fades into its surroundings.', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (137971, 'enUS', 'The Burning Legion encroaches upon our camp. Be ready.', 'The Burning Legion encroaches upon our camp. Be ready.', 26124);
INSERT INTO `broadcast_text_locale` VALUES (137972, 'enUS', 'The Burning Legion comes. Ready your glaives.', 'The Burning Legion comes. Ready your glaives.', 26124);
INSERT INTO `broadcast_text_locale` VALUES (137973, 'enUS', 'Illidari! Show these demons a quick death.', 'Illidari! Show these demons a quick death.', 26124);
INSERT INTO `broadcast_text_locale` VALUES (137974, 'enUS', 'Help these demons meet their end.', 'Help these demons meet their end.', 26124);
INSERT INTO `broadcast_text_locale` VALUES (137975, 'enUS', 'Illidari! Stand your ground! The demons will meet their end.', 'Illidari! Stand your ground! The demons will meet their end.', 26124);
INSERT INTO `broadcast_text_locale` VALUES (137976, 'enUS', 'Show these demons no mercy!', 'Show these demons no mercy!', 26124);
INSERT INTO `broadcast_text_locale` VALUES (137977, 'enUS', 'Give these demons a swift death.', 'Give these demons a swift death.', 26124);
INSERT INTO `broadcast_text_locale` VALUES (137978, 'enUS', 'Bring these demons down!', 'Bring these demons down!', 26124);
INSERT INTO `broadcast_text_locale` VALUES (137979, 'enUS', 'Strike true! Show these demons no mercy!', 'Strike true! Show these demons no mercy!', 26124);
INSERT INTO `broadcast_text_locale` VALUES (137980, 'enUS', 'Relieve these demons of their existence!', 'Relieve these demons of their existence!', 26124);
INSERT INTO `broadcast_text_locale` VALUES (137989, 'enUS', '<Recall the events before the arrival of the Legion>', '<Recall the events before the arrival of the Legion>', 26124);
INSERT INTO `broadcast_text_locale` VALUES (137990, 'enUS', '<Recall the events on the Broken Isles>', '<Recall the events on the Broken Isles>', 26124);
INSERT INTO `broadcast_text_locale` VALUES (137991, 'enUS', '<Recall the events of the Tomb of Sargeras>', '<Recall the events of the Tomb of Sargeras>', 26124);
INSERT INTO `broadcast_text_locale` VALUES (137992, 'enUS', '<Recall the events of Argus>', '<Recall the events of Argus>', 26124);
INSERT INTO `broadcast_text_locale` VALUES (137994, 'enUS', '<Recall the journey to Argus>', '<Recall the journey to Argus>', 26124);
INSERT INTO `broadcast_text_locale` VALUES (137995, 'enUS', '<Recall the resurrection of Xe\'ra>', '<Recall the resurrection of Xe\'ra>', 26124);
INSERT INTO `broadcast_text_locale` VALUES (137996, 'enUS', '<Recall Alleria\'s encounter with the Dark Naruu>', '<Recall Alleria\'s encounter with the Dark Naruu>', 26124);
INSERT INTO `broadcast_text_locale` VALUES (137998, 'enUS', '<Think back to another time>', '<Think back to another time>', 26124);
INSERT INTO `broadcast_text_locale` VALUES (138000, 'enUS', 'You take Hakmud home and abandon him. Hakmud sees how it is!', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (138001, 'enUS', 'It is not like Hakmud wanted to see his namesake or anything. Goodbye!', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (138002, 'enUS', 'Now everybody of Argus. Hakmud did not want to be special anyways!', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (138003, 'enUS', 'Hakmud never get time to relax. Not even on his own world!', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (138004, 'enUS', 'Are you going to just leave Hakmud here?', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (138005, 'enUS', 'The so-called All-Seer sends his pawns to kill me? Hah!', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (138006, 'enUS', 'My brethren hate me much as they hate you. How... convenient. Bring me their eyes that I may feast on their visions.', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (138007, 'enUS', '|TINTERFACE\\ICONS\\INV_GIZMO_FELIRONBOMB.BLP:20|t A |cFFFF0000|Hspell:244722|h[Shock Grenade]|h|r is attached to you!', '|TINTERFACE\\ICONS\\INV_GIZMO_FELIRONBOMB.BLP:20|t A |cFFFF0000|Hspell:244722|h[Shock Grenade]|h|r is attached to you!', 26124);
INSERT INTO `broadcast_text_locale` VALUES (138010, 'enUS', 'All right, everybody... Hold on!', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (138076, 'enUS', '', 'Well done.', 26124);
INSERT INTO `broadcast_text_locale` VALUES (138077, 'enUS', '', 'Most impressive.', 26124);
INSERT INTO `broadcast_text_locale` VALUES (138078, 'enUS', '', 'Congratulations are in order.', 26124);
INSERT INTO `broadcast_text_locale` VALUES (138079, 'enUS', '', 'Attack my enemy!', 26124);
INSERT INTO `broadcast_text_locale` VALUES (138080, 'enUS', '', 'Assist me!', 26124);
INSERT INTO `broadcast_text_locale` VALUES (138081, 'enUS', '', 'Strike my target!', 26124);
INSERT INTO `broadcast_text_locale` VALUES (138082, 'enUS', '', 'This way.', 26124);
INSERT INTO `broadcast_text_locale` VALUES (138083, 'enUS', '', 'I will lead you.', 26124);
INSERT INTO `broadcast_text_locale` VALUES (138084, 'enUS', '', 'Follow me.', 26124);
INSERT INTO `broadcast_text_locale` VALUES (138085, 'enUS', '', 'Heal me!', 26124);
INSERT INTO `broadcast_text_locale` VALUES (138086, 'enUS', '', 'I am in need of healing!', 26124);
INSERT INTO `broadcast_text_locale` VALUES (138087, 'enUS', '', 'Greetings.', 26124);
INSERT INTO `broadcast_text_locale` VALUES (138088, 'enUS', '', 'The Void calls to us.', 26124);
INSERT INTO `broadcast_text_locale` VALUES (138089, 'enUS', '', 'The path to power is clear.', 26124);
INSERT INTO `broadcast_text_locale` VALUES (138090, 'enUS', '', 'We do not fear the unknown.', 26124);
INSERT INTO `broadcast_text_locale` VALUES (138091, 'enUS', '', 'Retreat!', 26124);
INSERT INTO `broadcast_text_locale` VALUES (138092, 'enUS', '', 'Get back!', 26124);
INSERT INTO `broadcast_text_locale` VALUES (138093, 'enUS', '', 'Recede into shadow!', 26124);
INSERT INTO `broadcast_text_locale` VALUES (138094, 'enUS', '', 'Aid me!', 26124);
INSERT INTO `broadcast_text_locale` VALUES (138095, 'enUS', '', 'Your assistance, please!', 26124);
INSERT INTO `broadcast_text_locale` VALUES (138096, 'enUS', '', 'Danger approaches!', 26124);
INSERT INTO `broadcast_text_locale` VALUES (138097, 'enUS', '', 'My mana is low.', 26124);
INSERT INTO `broadcast_text_locale` VALUES (138098, 'enUS', '', 'I need more mana.', 26124);
INSERT INTO `broadcast_text_locale` VALUES (138099, 'enUS', '', 'Hold nothing back!', 26124);
INSERT INTO `broadcast_text_locale` VALUES (138100, 'enUS', '', 'Fire upon them!', 26124);
INSERT INTO `broadcast_text_locale` VALUES (138101, 'enUS', '', 'They say the Void hungers. Let\'s start off with a bit of nibbling.', 26124);
INSERT INTO `broadcast_text_locale` VALUES (138102, 'enUS', '', 'Get nice and close. Whispers are kinda my thing.', 26124);
INSERT INTO `broadcast_text_locale` VALUES (138103, 'enUS', '', 'Are you checking out my void form?', 26124);
INSERT INTO `broadcast_text_locale` VALUES (138104, 'enUS', '', 'There is a void in my heart. Have you come to fill it?', 26124);
INSERT INTO `broadcast_text_locale` VALUES (138105, 'enUS', '', 'Who needs the Light? It\'s so much more fun in the dark.', 26124);
INSERT INTO `broadcast_text_locale` VALUES (138106, 'enUS', '', 'You cannot a-void my charms.', 26124);
INSERT INTO `broadcast_text_locale` VALUES (138107, 'enUS', '', 'The Void isn\'t the only thing that\'s insatiable.', 26124);
INSERT INTO `broadcast_text_locale` VALUES (138108, 'enUS', '', 'Always remain focused.', 26124);
INSERT INTO `broadcast_text_locale` VALUES (138109, 'enUS', '', 'Resist the whispers.', 26124);
INSERT INTO `broadcast_text_locale` VALUES (138110, 'enUS', '', 'Walk in shadow.', 26124);
INSERT INTO `broadcast_text_locale` VALUES (138111, 'enUS', '', 'Remember Alleria\'s teachings.', 26124);
INSERT INTO `broadcast_text_locale` VALUES (138112, 'enUS', '', 'I do not agree.', 26124);
INSERT INTO `broadcast_text_locale` VALUES (138113, 'enUS', '', 'Never!', 26124);
INSERT INTO `broadcast_text_locale` VALUES (138114, 'enUS', '', 'No.', 26124);
INSERT INTO `broadcast_text_locale` VALUES (138115, 'enUS', '', 'No, we do not drink blood--that\'s the San\'layn. Totally different emo elf.', 26124);
INSERT INTO `broadcast_text_locale` VALUES (138116, 'enUS', '', 'First was high, then blood, and now void. Get the order right.', 26124);
INSERT INTO `broadcast_text_locale` VALUES (138117, 'enUS', '', 'Who does my hair? You might have heard of my stylist. It\'s called THE VOID.', 26124);
INSERT INTO `broadcast_text_locale` VALUES (138124, 'enUS', '', 'Gloomy? I\'m not gloomy. I just dress that way... and talk that way... and act that way.', 26124);
INSERT INTO `broadcast_text_locale` VALUES (138125, 'enUS', '', 'You think YOU have a dark side? Elf, please.', 26124);
INSERT INTO `broadcast_text_locale` VALUES (138126, 'enUS', '', 'Well, yes, technically the Void does want to consume the entire cosmos. But I\'ll settle for a smaller bite... for now.', 26124);
INSERT INTO `broadcast_text_locale` VALUES (138127, 'enUS', '', 'No matter how much you plead, I will not sprout tentacles or turn into a giant eyeball. Well, I might. But not because you asked.', 26124);
INSERT INTO `broadcast_text_locale` VALUES (138128, 'enUS', '', 'I am most grateful.', 26124);
INSERT INTO `broadcast_text_locale` VALUES (138129, 'enUS', '', 'Many thanks.', 26124);
INSERT INTO `broadcast_text_locale` VALUES (138130, 'enUS', '', 'I am in your debt.', 26124);
INSERT INTO `broadcast_text_locale` VALUES (138131, 'enUS', '', 'Remain here.', 26124);
INSERT INTO `broadcast_text_locale` VALUES (138132, 'enUS', '', 'Do not move.', 26124);
INSERT INTO `broadcast_text_locale` VALUES (138133, 'enUS', '', 'Yes.', 26124);
INSERT INTO `broadcast_text_locale` VALUES (138134, 'enUS', '', 'Correct.', 26124);
INSERT INTO `broadcast_text_locale` VALUES (138135, 'enUS', '', 'Acknowledged.', 26124);
INSERT INTO `broadcast_text_locale` VALUES (138136, 'enUS', '', 'My pleasure.', 26124);
INSERT INTO `broadcast_text_locale` VALUES (138137, 'enUS', '', 'Glad to help.', 26124);
INSERT INTO `broadcast_text_locale` VALUES (138138, 'enUS', '', 'Of course.', 26124);
INSERT INTO `broadcast_text_locale` VALUES (138139, 'enUS', '', 'My weapon requires both hands.', 26124);
INSERT INTO `broadcast_text_locale` VALUES (138140, 'enUS', '', 'I do not have that ability yet.', 26124);
INSERT INTO `broadcast_text_locale` VALUES (138141, 'enUS', '', 'I cannot wield that yet.', 26124);
INSERT INTO `broadcast_text_locale` VALUES (138142, 'enUS', '', 'That ability is not ready.', 26124);
INSERT INTO `broadcast_text_locale` VALUES (138143, 'enUS', '', 'I cannot do that yet.', 26124);
INSERT INTO `broadcast_text_locale` VALUES (138144, 'enUS', '', 'Not ready yet.', 26124);
INSERT INTO `broadcast_text_locale` VALUES (138145, 'enUS', '', 'That one cannot join this group.', 26124);
INSERT INTO `broadcast_text_locale` VALUES (138146, 'enUS', '', 'I cannot put that there.', 26124);
INSERT INTO `broadcast_text_locale` VALUES (138147, 'enUS', '', 'That bag is full.', 26124);
INSERT INTO `broadcast_text_locale` VALUES (138148, 'enUS', '', 'I cannot do that here.', 26124);
INSERT INTO `broadcast_text_locale` VALUES (138149, 'enUS', '', 'I cannot drop that.', 26124);
INSERT INTO `broadcast_text_locale` VALUES (138150, 'enUS', '', 'That is bound to me.', 26124);
INSERT INTO `broadcast_text_locale` VALUES (138151, 'enUS', '', 'I will never be able to equip that.', 26124);
INSERT INTO `broadcast_text_locale` VALUES (138152, 'enUS', '', 'I am not high enough level to use that.', 26124);
INSERT INTO `broadcast_text_locale` VALUES (138153, 'enUS', '', 'I cannot use that yet.', 26124);
INSERT INTO `broadcast_text_locale` VALUES (138154, 'enUS', '', 'My skill level is not high enough to equip that.', 26124);
INSERT INTO `broadcast_text_locale` VALUES (138155, 'enUS', '', 'I cannot learn that spell.', 26124);
INSERT INTO `broadcast_text_locale` VALUES (138156, 'enUS', '', 'I cannot trade that.', 26124);
INSERT INTO `broadcast_text_locale` VALUES (138157, 'enUS', '', 'I cannot use that.', 26124);
INSERT INTO `broadcast_text_locale` VALUES (138158, 'enUS', '', 'I cannot loot that right now.', 26124);
INSERT INTO `broadcast_text_locale` VALUES (138159, 'enUS', '', 'I do not have a target.', 26124);
INSERT INTO `broadcast_text_locale` VALUES (138160, 'enUS', '', 'I need to target something first.', 26124);
INSERT INTO `broadcast_text_locale` VALUES (138161, 'enUS', '', 'I require a target.', 26124);
