INSERT INTO `broadcast_text_locale` VALUES (138441, 'enUS', 'I know what you\'re thinking... \"Oh goody, another elf.\" Well... I bet you weren\'t expecting a VOID elf, now were you?', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (138442, 'enUS', 'If you\'re looking for tall dark, and brooding, that\'s me. Well, dark and brooding, at least.', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (138443, 'enUS', 'Say what you will about the tenets of the Void. At least it\'s an ethos!', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (138444, 'enUS', 'Would you believe purple has always been my favorite color? Even before I went void, I mean.', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (138445, 'enUS', 'Alleria is my favorite Windrunner sister. Edgier than Vereesa, but slightly less homicidal than the dead one.', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (138446, 'enUS', 'The fact that I wield void energies doesn\'t mean I plan to consume everything I see. After all, I have a figure to maintain.', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (138447, 'enUS', 'Old Gods... I mean, really? Some have mouths for eyes, others have eyes for mouths. Talk about a hot mess...', '', 26124);
