INSERT INTO `broadcast_text_locale` VALUES (138487, 'enUS', 'What am I into? Let\'s just say some of my proclivities can run a bit... dark.', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (138488, 'enUS', 'I do my best work in the shadows. Allow me to demonstrate.', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (138489, 'enUS', 'The Void has taught me many secrets. Some of them can be most... satisfying.', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (138491, 'enUS', 'As a rule, I don\'t sprout tentacles. But in your case, I\'ll make an exception.', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (138492, 'enUS', 'When studying shadow magic, one learns to be flexible. Very... flexible.', '', 26124);
