INSERT INTO `broadcast_text_locale` VALUES (138522, 'enUS', '', 'Silithus has ever been a magnet for ancient, malevolent powers.\n\nI could open a timeway to reveal how the Black Empire once sprawled across these sands. Or show you wars waged between mighty armies.\n\nSo much history. So much pain.\n\nBut that can wait. I believe you are here for another purpose.', 26124);
