INSERT INTO `broadcast_text_locale` VALUES (139256, 'enUS', 'Tyrande... Long ago, you trusted me enough to defy Malfurion\'s wishes and free me from my prison.', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (139257, 'enUS', 'But over time, that faith was lost. And like my brother, you came to believe that the choices I made had driven me to darkness.', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (139258, 'enUS', 'Know that every path I took led toward a single purpose: saving our world. I could abide no half measures. No compromise.', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (139259, 'enUS', 'At those times when I faced doubt, I held true to one constant. One anchor. You.', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (139260, 'enUS', 'You have always embodied the best of Azeroth, Tyrande. Your faith. Your devotion. Through the darkest times, my belief in you never wavered.', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (139261, 'enUS', 'My fate, my duty, are now clear to me. I leave Azeroth\'s defense to you... and to my brother.', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (139262, 'enUS', 'Take care of him, Tyrande. Though at times I wished your heart had made a different choice, in the end... I know it made the right one.', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (139263, 'enUS', 'Malfurion... Even in the womb, we grappled with one another. Struggle has followed us all our lives.', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (139264, 'enUS', 'The teachings of Cenarius were always your path. I felt... another calling.', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (139265, 'enUS', 'It was power I sought... but not to conquer or rule. It was a means to an end... to save Azeroth from an unstoppable foe.', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (139266, 'enUS', 'You never trusted my intentions... though I suppose I did not make it easy for you.', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (139267, 'enUS', 'But now, as my fate becomes clear, I wish to quiet the strife that has long divided us.', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (139268, 'enUS', 'Even when the Legion is gone, new threats will arise. There is no one I trust to face them more than you, brother.', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (139269, 'enUS', 'You have spent a lifetime fighting for the dream of what Azeroth could be. Now you must fight for what it is.', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (139270, 'enUS', 'Take care of Tyrande. Listen to her counsel. She was always the best of us.', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (139271, 'enUS', 'The road ahead will be long. Whatever comes, bring honor to the name... Stormrage.', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (139273, 'enUS', '', 'In my lifetime, I have twice witnessed a sundering of the world. Mother Moon, I pray I do not see a third.', 26124);
INSERT INTO `broadcast_text_locale` VALUES (139274, 'enUS', '', 'I sense a sorcerer\'s touch upon this crystal.', 26124);
INSERT INTO `broadcast_text_locale` VALUES (139275, 'enUS', '', 'When I learned that he was alive, leading the fight against the Legion on the Broken Shore... I could not bring myself to speak to him.', 26124);
INSERT INTO `broadcast_text_locale` VALUES (139276, 'enUS', '', 'The time for talk has passed. It seems he has a duty to fulfill... as do we. Let us be about it, champion.', 26124);
INSERT INTO `broadcast_text_locale` VALUES (139277, 'enUS', 'My brother made selfish choices. Caused pain to so many. His transgressions are... difficult to forgive.', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (139278, 'enUS', 'And yet... there were times when we fought for a common cause. A shared purpose. Those were good days.', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (139279, 'enUS', 'But now is not the time to ponder personal regrets. We must see to healing the world, champion.', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (139280, 'enUS', 'The soul of our world is in agony...', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (139296, 'enUS', 'You have witnessed echoes of my past, hero. I ask your help to put these final matters to rest.', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (139297, 'enUS', 'Champion... I would have a word.', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (139299, 'enUS', 'But enough dwelling on the past. The crystal I left for you to find holds not two messages, but three. The last is for you, champion.', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (139300, 'enUS', 'The Well of Eternity. I am not one for sentiment... but if anything embodies my commitment to Azeroth, it is the font of power I created so long ago.', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (139301, 'enUS', 'You have proven your commitment to Azeroth. Your dedication, your sacrifice, rivals my own. But more will be asked of you. So much more.', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (139302, 'enUS', 'Even now, enemies gather... and the shadows grow darker. From this day forward, the defense of our world... of all we hold dear... rests with you.', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (139349, 'enUS', 'The crystal... it rings out with a familiar voice.', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (139352, 'enUS', '', 'After Illidan faced defeat atop the Black Temple, I tried to let go of my feelings... my distrust and bitterness.', 26124);
INSERT INTO `broadcast_text_locale` VALUES (139359, 'enUS', '', 'Contrite words. Yet I must wonder whether he truly meant them.', 26124);
