INSERT INTO `broadcast_text_locale` VALUES (140272, 'enUS', 'Think nothing of it.', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (140273, 'enUS', '', 'Think nothing of it.', 26124);
INSERT INTO `broadcast_text_locale` VALUES (140274, 'enUS', '', 'I am honored to serve.', 26124);
INSERT INTO `broadcast_text_locale` VALUES (140275, 'enUS', 'I am honored to serve.', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (140276, 'enUS', '', 'You are welcome.', 26124);
INSERT INTO `broadcast_text_locale` VALUES (140277, 'enUS', 'You are welcome.', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (140278, 'enUS', 'Thanks are not required.', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (140279, 'enUS', '', 'Thanks are not required.', 26124);
INSERT INTO `broadcast_text_locale` VALUES (140472, 'enUS', 'The moment that the way to Argus opened... the instant my gaze fell upon the Legion\'s home world... I knew I would not be returning from it.', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (140473, 'enUS', 'I will face my destiny, whatever it may hold. Yet... I have left certain matters unsettled... old wounds that I would see mended.', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (140474, 'enUS', 'This crystal bears two messages. One is for my brother Malfurion, the other for Tyrande. I am trusting you to deliver them on my behalf, champion.', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (140475, 'enUS', 'When they have heard my words, leave the crystal atop Mount Hyjal, upon the shores of the Well of Eternity.', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (140483, 'enUS', 'Thank you for coming, Mayla. It is my honor to welcome you to Mulgore.', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (140484, 'enUS', '', 'Your invitation was most kind, Baine. It is time for our two peoples to renew our bonds of kinship.', 26124);
INSERT INTO `broadcast_text_locale` VALUES (140485, 'enUS', 'It is of kinship that I wish to speak. I hope that--', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (140486, 'enUS', 'I should never... have left... the mountain...', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (140487, 'enUS', '', 'Ebonhorn! What dark force grips you?', 26124);
INSERT INTO `broadcast_text_locale` VALUES (140488, 'enUS', 'I know this power all too well. Champion! We need your help!', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (140489, 'enUS', '', 'I must get Ebonhorn back to Highmountain at once!', 26124);
INSERT INTO `broadcast_text_locale` VALUES (140490, 'enUS', 'Until we discover what\'s behind this attack, Mulgore will never be safe. I will come with you, Mayla. Let us face this darkness together.', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (140491, 'enUS', '', 'Ebonhorn is not well. We must find a way to bring him back from the brink. Speak with Spiritwalker Graysky. I believe he can help.', 26124);
INSERT INTO `broadcast_text_locale` VALUES (140492, 'enUS', 'The whispers... they have stopped. Thank you, champion, Graysky.', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (140494, 'enUS', '', 'Today was very nearly a dark day for Azeroth.', 26124);
INSERT INTO `broadcast_text_locale` VALUES (140495, 'enUS', '', 'Had Uul\'gyneth\'s plan succeeded, we all would have been made into servants of the Old Gods... including Ebonhorn.', 26124);
INSERT INTO `broadcast_text_locale` VALUES (140496, 'enUS', 'I shudder at the thought, Mayla. Without the swift action of Baine and this champion, all would have been lost.', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (140497, 'enUS', '', 'Baine Bloodhoof, you have demonstrated courage, honor, and loyalty. I believe it is time for your people and mine to renew our bonds of kinship.', 26124);
INSERT INTO `broadcast_text_locale` VALUES (140498, 'enUS', '', 'If you will have us, the tauren of Highmountain would be proud to join your Horde.', 26124);
INSERT INTO `broadcast_text_locale` VALUES (140499, 'enUS', 'The Horde will be honored to welcome you! Let us travel to Orgrimmar and share the good news with our Warchief.', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (140500, 'enUS', '', 'What have you to say, chieftain?', 26124);
INSERT INTO `broadcast_text_locale` VALUES (140501, 'enUS', '', 'Warchief, the strength and courage of the Horde has been demonstrated by Baine Bloodhoof, as well as your champion.', 26124);
INSERT INTO `broadcast_text_locale` VALUES (140502, 'enUS', '', 'I accept your oath of loyalty. The Horde offers its protection... and expects your obedience.', 26124);
INSERT INTO `broadcast_text_locale` VALUES (140503, 'enUS', '', 'From this day forth, Highmountain vows to stand with you against all foes.', 26124);
INSERT INTO `broadcast_text_locale` VALUES (140504, 'enUS', '', 'For the Horde!', 26124);
INSERT INTO `broadcast_text_locale` VALUES (140505, 'enUS', 'For the Horde!', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (140506, 'enUS', '', 'For the Horde!', 26124);
INSERT INTO `broadcast_text_locale` VALUES (140644, 'enUS', '|TInterface\\Icons\\Shaman_PVP_RipplingWaters:20|t%s begins to cast |cFFFF0000|Hspell:255594|h[Sky and Sea]|h|r!', '|TInterface\\Icons\\Shaman_PVP_RipplingWaters:20|t%s begins to cast |cFFFF0000|Hspell:255594|h[Sky and Sea]|h|r!', 26124);
INSERT INTO `broadcast_text_locale` VALUES (140708, 'enUS', 'The might of sea and sky must aid our champions, Golganneth!', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (140709, 'enUS', 'Let the fury of the sea wash away this corruption!', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (140710, 'enUS', 'Aggramar! Lend these mortals your strength, brother.', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (140711, 'enUS', 'One among them shall serve as the vessel for my power, Highfather.', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (140712, 'enUS', 'Norgannon! Your keen mind may expose our enemy\'s weakness!', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (140730, 'enUS', 'The rage of the Unmaker surges! Quickly, heroes! Strike down these constructs!', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (140731, 'enUS', 'The mortals have fallen. The final titan... cannot be saved.', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (140732, 'enUS', 'Time answers to me, Unmaker! The one force that can bind your relentless fury!', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (140733, 'enUS', 'No! After all we have endured... It must not end this way!', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (140734, 'enUS', '', 'Hope is not lost, Highfather. The spark of life still flickers within these mortals.', 26124);
INSERT INTO `broadcast_text_locale` VALUES (140735, 'enUS', '', 'Arise, champions! Fight to save your world!', 26124);
INSERT INTO `broadcast_text_locale` VALUES (140736, 'enUS', 'Khaz\'goroth! Forge these heroes in our image!', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (140760, 'enUS', 'Using their power, I shall bend the strands of time to aid our cause.', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (140795, 'enUS', 'Our champions have fallen. Nothing can stop the end of all things.', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (140797, 'enUS', 'Our cause is lost. The Burning Crusade will consume us all.', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (140917, 'enUS', '', '|TInterface\\Icons\\SPELL_MAGE_FLAMEORB:20|tA fiery portal to Xoroth opens up!', 26124);
INSERT INTO `broadcast_text_locale` VALUES (140918, 'enUS', '', '|TInterface\\Icons\\SPELL_HOLY_CONSUMEMAGIC:20|tA shadowy portal to Nathreza opens up!', 26124);
INSERT INTO `broadcast_text_locale` VALUES (140919, 'enUS', '', '|TInterface\\Icons\\ABILITY_CREATURE_POISON_02:20|tA fel portal to Rancora opens up!', 26124);
INSERT INTO `broadcast_text_locale` VALUES (140942, 'enUS', 'Admiral Svirax exits her command pod!', 'Admiral Svirax exits her command pod!', 26124);
INSERT INTO `broadcast_text_locale` VALUES (140944, 'enUS', 'Chief Engineer Ishkar exits his command pod!', 'Chief Engineer Ishkar exits his command pod!', 26124);
INSERT INTO `broadcast_text_locale` VALUES (140945, 'enUS', 'General Erodus exits his command pod!', 'General Erodus exits his command pod!', 26124);
INSERT INTO `broadcast_text_locale` VALUES (140952, 'enUS', '', 'You must be descended from the naaru... \'cause you\'ve got a heavenly body.', 26124);
INSERT INTO `broadcast_text_locale` VALUES (140953, 'enUS', '', 'Let\'s go back to my ship and twist our nethers.', 26124);
INSERT INTO `broadcast_text_locale` VALUES (140954, 'enUS', 'I like it with the lights on. Not that I really have a choice...', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (140968, 'enUS', '|TINTERFACE\\ICONS\\SPELL_ARCANE_MINDMASTERY.BLP:20|t Your mind is about to succumb to |cFFFF0000|Hspell:244172|h[Psychic Assault]|h|r!', '|TINTERFACE\\ICONS\\SPELL_ARCANE_MINDMASTERY.BLP:20|t Your mind is about to succumb to |cFFFF0000|Hspell:244172|h[Psychic Assault]|h|r!', 26124);
INSERT INTO `broadcast_text_locale` VALUES (140970, 'enUS', 'Has it gotten brighter in here? Because you just turned me on.', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (140971, 'enUS', '', 'When in doubt... touch anything that glows.', 26124);
INSERT INTO `broadcast_text_locale` VALUES (140972, 'enUS', 'I thought my tattoo said \"Light\'s Defender\" in naaru. I found out it actually says \"glowing goat\".', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (140973, 'enUS', 'This world of yours is very strange. Talking bears who practice kung fu? On Argus, we call that a circus.', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (140974, 'enUS', 'After being aboard a ship for so long, it is nice to walk on solid ground again. All those hard surfaces were murder on my hooves!', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (140975, 'enUS', 'My life for Aiur... <cough> Argus. My life for ARGUS!', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (140976, 'enUS', '', 'No, I do not have a glowing stamp above my tail.', 26124);
INSERT INTO `broadcast_text_locale` VALUES (140977, 'enUS', '', 'Have you met my dog? His name is Barkenon Puppos.', 26124);
INSERT INTO `broadcast_text_locale` VALUES (140978, 'enUS', '', 'Toes are overrated. Hooves make pedicures go sooooo much faster.', 26124);
INSERT INTO `broadcast_text_locale` VALUES (140979, 'enUS', '', 'I don\'t recommend walking barehoof on the Vindicaar. We keep finding tiny shards of crystal that didn\'t get swept up.', 26124);
INSERT INTO `broadcast_text_locale` VALUES (140980, 'enUS', '', 'We haven\'t crashed the Vindicaar yet... but given our track record, it\'s only a matter of time.', 26124);
INSERT INTO `broadcast_text_locale` VALUES (140981, 'enUS', '', 'One downside of being Lightforged is that my S.E.L.F.I.E.S. are always overexposed.', 26124);
INSERT INTO `broadcast_text_locale` VALUES (140982, 'enUS', '', 'Turalyon was the only human I saw for a thousand years. I assumed all of them were grizzled and scarred.', 26124);
INSERT INTO `broadcast_text_locale` VALUES (140983, 'enUS', 'Your body must be a font of magic, because I\'m irresistibly drawn to it.', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (140984, 'enUS', 'You must know magic too, because you just made everyone else in the room disappear.', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (140985, 'enUS', 'You\'ve found the Arcway to my heart.', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (140986, 'enUS', 'Mmmm, I wanna tap that ley line.', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (140987, 'enUS', 'I think I\'ve night-fallen for you.', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (140988, 'enUS', 'I\'ve got a feeling we were night-born for each other.', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (140989, 'enUS', 'The stars have judged you, and found you... smokin\' hot.', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (140990, 'enUS', 'Were you picked from the Arcan\'dor? Because you\'re the apple of my eye.', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (140991, 'enUS', '', 'Is that an illusion in your pocket, or are you just happy to see me?', 26124);
INSERT INTO `broadcast_text_locale` VALUES (140992, 'enUS', '', 'No illusions here. Everything you see is real... very real.', 26124);
INSERT INTO `broadcast_text_locale` VALUES (140994, 'enUS', '', 'My Nightwell brings all the boys to the yard.', 26124);
INSERT INTO `broadcast_text_locale` VALUES (140995, 'enUS', '', 'Animate? Detonate? I suggest we skip straight to replicate.', 26124);
INSERT INTO `broadcast_text_locale` VALUES (140996, 'enUS', '', 'I\'ll show you my ley lines if you show me yours.', 26124);
INSERT INTO `broadcast_text_locale` VALUES (140997, 'enUS', '', 'I\'ve been trapped in a bubble with the same guys for 10,000 years. You could say I\'m ready for a little... variety.', 26124);
INSERT INTO `broadcast_text_locale` VALUES (140998, 'enUS', '', 'There\'s no area denial in this raid.', 26124);
INSERT INTO `broadcast_text_locale` VALUES (140999, 'enUS', 'To be honest, most of the time something was quite right.', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (141000, 'enUS', 'Why does everyone keep asking me to say that? Ughhhhh. Fine. An Illusion. What are you hiding.', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (141001, 'enUS', 'My name is Roy, and I\'m a mana addict.', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (141002, 'enUS', 'It\'s what I do. I drink arcwine... and I know things.', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (141003, 'enUS', 'Back in my day, there was only one kind of elf. ONE.', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (141004, 'enUS', 'I don\'t know why they call it the Court of Stars. I hang out there all the time and I never see anyone famous.', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (141005, 'enUS', 'Let\'s be honest. Keeping a giant, angry dinosaur caged up in a zoo was bound to end badly.', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (141006, 'enUS', '', 'An allusion! What are you implying?', 26124);
INSERT INTO `broadcast_text_locale` VALUES (141007, 'enUS', '', 'Roses are red, our city is fair. Is that a disguise? WHO GOES THERE?', 26124);
INSERT INTO `broadcast_text_locale` VALUES (141008, 'enUS', '', 'Care for a glass of arcwine? I jumped on the berries myself.', 26124);
INSERT INTO `broadcast_text_locale` VALUES (141009, 'enUS', '', 'Tyrande still looks good after all these years. Know if she\'s seeing anyone?', 26124);
INSERT INTO `broadcast_text_locale` VALUES (141010, 'enUS', '', 'I met this kal\'dorei who told me my dress was the pinnacle of fashion... 10,000 years ago. Ouch! Those night elves really know how to throw shade!', 26124);
INSERT INTO `broadcast_text_locale` VALUES (141011, 'enUS', '', 'Night elves? More like country elves! They live in trees, sleep in dens... sometimes even grow antlers. They\'re not cut out for life in a REAL city.', 26124);
INSERT INTO `broadcast_text_locale` VALUES (141012, 'enUS', '', 'You really must attend one of our parties in the Court of Stars. I\'ve never met anyone more in need of a mask.', 26124);
INSERT INTO `broadcast_text_locale` VALUES (141013, 'enUS', 'Have you ever seen the bunks on the Vindicaar? I can arrange a private tour.', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (141014, 'enUS', 'Trust me... I have experience at exploring deep places.', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (141015, 'enUS', 'My totem thunders. All. Night. Long.', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (141016, 'enUS', 'Beware the deep places... of my heart.', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (141017, 'enUS', 'Get as rough as you like. I\'ve got a thick hide.', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (141018, 'enUS', 'You must be an alchemist, because we\'ve got great chemistry.', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (141020, 'enUS', '', 'So... wanna knock antlers?', 26124);
INSERT INTO `broadcast_text_locale` VALUES (141022, 'enUS', '', 'Are you staring at my rack?', 26124);
INSERT INTO `broadcast_text_locale` VALUES (141023, 'enUS', '', 'It\'s not the size of the antlers. It\'s the motion of the totem.', 26124);
INSERT INTO `broadcast_text_locale` VALUES (141024, 'enUS', 'Why does that draenei couple keep asking me where Rocky is?', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (141025, 'enUS', 'Let\'s play a game. We take a drink every time a harpy screeches about earth and stone.', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (141026, 'enUS', 'I may be a simple tauren from the mountains, but at least I don\'t dig through worm dung for loot.', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (141027, 'enUS', 'Ha! A buddy of mine convinced this epic-geared adventurer to kick fish into the river! Oh wait... that wasn\'t you, was it?', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (141028, 'enUS', 'A tauren, a yaungol, and a taunka walk into a bar. This isn\'t a joke--it\'s my family reunion.', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (141029, 'enUS', 'What smells worse than a drogbar? Two drogbar. What smells worse than two drogbar? Nobody knows, because the stench will kill you.', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (141030, 'enUS', 'Did you just try to hang your hat on my antlers? What do I look like, a coat rack?', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (141031, 'enUS', '', 'What do you get when you feed cocoa to a Highmountain tauren? Chocolate moose!', 26124);
INSERT INTO `broadcast_text_locale` VALUES (141032, 'enUS', '', 'Why are the Rivermane always so calm? Because they\'ve learned to go with the flow.', 26124);
INSERT INTO `broadcast_text_locale` VALUES (141033, 'enUS', '', 'Brrrrr, it\'s cold in here. In the mood for some ice cream?', 26124);
INSERT INTO `broadcast_text_locale` VALUES (141034, 'enUS', '', 'Tauren make the best poets. Their verse is so moooooving.', 26124);
INSERT INTO `broadcast_text_locale` VALUES (141035, 'enUS', '', 'You know the way to a woman\'s heart? Hoof rubs. Trust me on this one, darling.', 26124);
INSERT INTO `broadcast_text_locale` VALUES (141050, 'enUS', 'Why settle for horns when you could have a rack like this?', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (141051, 'enUS', '', 'He said my eyes were \"milky\". Talk about a mood killer...', 26124);
INSERT INTO `broadcast_text_locale` VALUES (141052, 'enUS', 'At last... the future I foresaw has come to pass. Thank you for opening the way.', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (141053, 'enUS', '', 'Show yourself! Who are you?', 26124);
INSERT INTO `broadcast_text_locale` VALUES (141054, 'enUS', '', 'Resist the whispers, Umbric! This \"gift\" you are offered is little more than enslavement.', 26124);
INSERT INTO `broadcast_text_locale` VALUES (141055, 'enUS', 'Rrrrurgaaghh! I feel the power... calling to me... changing me...', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (141056, 'enUS', '', 'Come, $p. We must stop this transformation before my people are lost!', 26124);
INSERT INTO `broadcast_text_locale` VALUES (141057, 'enUS', 'Names are of little consequence. A more interesting question is... What shall you become?', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (141058, 'enUS', '', 'Now, now... no antler stroking on the first date.', 26124);
INSERT INTO `broadcast_text_locale` VALUES (141059, 'enUS', 'We are on the same side, Windrunner... no matter what that traitor has taught you.', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (141060, 'enUS', '', 'Your masters will not enslave me, ethereal... nor will they claim my brothers and sisters!', 26124);
INSERT INTO `broadcast_text_locale` VALUES (141061, 'enUS', '', 'This void storm is a conduit... a doorway that must be closed.', 26124);
INSERT INTO `broadcast_text_locale` VALUES (141062, 'enUS', 'Why do you resist? You stand on the threshold of a grand destiny.', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (141063, 'enUS', '', 'I see through your lies, Durzaan. So will the others.', 26124);
INSERT INTO `broadcast_text_locale` VALUES (141064, 'enUS', 'Nooooooooooo...', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (141065, 'enUS', '', 'No. These people are not yours. They are not lost.', 26124);
INSERT INTO `broadcast_text_locale` VALUES (141066, 'enUS', 'Alleria... $p... My people are free, but we have been... changed. And the voices...', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (141067, 'enUS', '', 'Durzaan tried to tear away your mortality. To make you like him--a slave to his hunger.', 26124);
INSERT INTO `broadcast_text_locale` VALUES (141068, 'enUS', '', 'But your fate is still your own, Umbric. I can teach you to quiet the whispers. To make the shadows serve you, instead of you serving them.', 26124);
INSERT INTO `broadcast_text_locale` VALUES (141069, 'enUS', '|TInterface\\Icons\\INV_ELEMENTAL_MOTE_SHADOW01:20|tYou are afflicted with |cFFFF0000|Hspell:250669|h[Soulburst]|h|r!', '|TInterface\\Icons\\INV_ELEMENTAL_MOTE_SHADOW01:20|tYou are afflicted with |cFFFF0000|Hspell:250669|h[Soulburst]|h|r!', 26124);
INSERT INTO `broadcast_text_locale` VALUES (141070, 'enUS', '|TInterface\\Icons\\INV_ELEMENTAL_PRIMAL_SHADOW:20|tYou are afflicted with |cFFFF0000|Hspell:251570|h[Soulbomb]|h|r!', '|TInterface\\Icons\\INV_ELEMENTAL_PRIMAL_SHADOW:20|tYou are afflicted with |cFFFF0000|Hspell:251570|h[Soulbomb]|h|r!', 26124);
INSERT INTO `broadcast_text_locale` VALUES (141091, 'enUS', '', 'I\'m not usually into drogbar, but when I see them working out in that brul gym... well, let\'s just say the deep places of the earth get a little steamy.', 26124);
INSERT INTO `broadcast_text_locale` VALUES (141092, 'enUS', 'If one more of you natives calls me a walking chandelier, I swear I\'ll...', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (141097, 'enUS', 'At long last, the war is over.\n\nPart of me never expected to survive to see this day. So many battles. So much loss.\n\n<Turalyon sighs, his eyes brimming with a flood of emotions.>\n\nNow we return home to a world I haven\'t walked in a thousand years.\n\nMy old life is long past. It is time to build a new one, and get to know the son who embodies everything I fought for.', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (141098, 'enUS', '', 'My heart soars to return to Azeroth alongside Arator and Turalyon. To see the forests of my homeland once again.\n\nAnd yet...\n\nVereesa told me what has befallen Sylvanas. Though I dread the meeting, I must see with my own eyes what she has become.\n\nIs she even my sister anymore? Or some Light-forsaken monster?\n\nBut of course, I have changed as well. The powers at my command may cause some to question my loyalties.\n\n<Alleria draws in a long breath.>\n\nI must remain calm, focused. There is much to ponder...', 26124);
INSERT INTO `broadcast_text_locale` VALUES (141099, 'enUS', 'Countless nights I dreamt of returning to Argus. Of seeing what became of my home. Of saving it.\n\n<Velen is quiet for a long moment.>\n\nThere was no salvation to be had. But we did find victory.\n\nWhat comes next, I cannot say. But I will not wait for visions to guide me. I will do all I can to support King Anduin, and to ensure he is prepared to face the threat that looms in the darkness.', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (141101, 'enUS', 'The campaign against the Legion has been long and wearying. We have traversed entire worlds, spanned the Twisting Nether itself to finally achieve victory.\n\nI am tired, $n. Yet we cannot rest.\n\nMagni\'s visions of doom shake me to my very core. Only one titan remains, champion, and we must defend it.', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (141102, 'enUS', '', 'You\'re still here?\n\n<Ishanah looks at you quizzically.>\n\nIt\'s over. Go home.\n\n<Ishanah waves you away.>\n\nGo!', 26124);
INSERT INTO `broadcast_text_locale` VALUES (141103, 'enUS', '', 'Alleria has changed. She wields powers I do not fully comprehend. But in her heart, she remains my beloved sister. I know it.\n\nThe news of Sylvanas weighs heavily upon her. There are matters to be settled... face to face.\n\nThe Windrunner sisters must meet. And there is only one place it can be done.', 26124);
INSERT INTO `broadcast_text_locale` VALUES (141104, 'enUS', 'I found them! At long last, I found them.\n\n<Arator\'s smile gives way to a look of uncertainty.>\n\nThe two people who gave me life... have been absent for all of it. I know they fought to keep me safe, that they sacrificed so much. And yet...\n\nWe cannot suddenly become a happy family. They know next to nothing about me, and I know only legends of them. We have much to learn about one another, and many wounds to heal.\n\nBut at least we will do it together.', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (141105, 'enUS', 'The Vindicaar may have been untested when we set out on this campaign, but she saw us safely home.\n\nAll those ship upgrades were worth it, yes?\n\nDo not answer. It would only break my heart.\n\nA ship\'s engineer\'s work is always underappreciated.', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (141110, 'enUS', '', 'My fellow soldiers, the trials you have endured are proof that the Light shines bright within your hearts.', 26124);
INSERT INTO `broadcast_text_locale` VALUES (141111, 'enUS', '', 'One final test remains--and it is the most daunting of all.', 26124);
INSERT INTO `broadcast_text_locale` VALUES (141112, 'enUS', '', 'It will force you to peer into the very core of what you are. Of what you believe yourself to be.', 26124);
INSERT INTO `broadcast_text_locale` VALUES (141113, 'enUS', '', 'Many worthy draenei have undergone this trial, only to return broken... or worse.', 26124);
INSERT INTO `broadcast_text_locale` VALUES (141114, 'enUS', '', 'Should you feel the slightest doubt, turn back now. It will be counted as wisdom, not cowardice.', 26124);
INSERT INTO `broadcast_text_locale` VALUES (141115, 'enUS', '', 'But if you are truly ready, step forward and embrace your fate.', 26124);
INSERT INTO `broadcast_text_locale` VALUES (141116, 'enUS', '', 'T\'paartos... we have discussed this. Each initiate must be accompanied by a second. Where is yours?', 26124);
INSERT INTO `broadcast_text_locale` VALUES (141117, 'enUS', 'T\'paartos needs no one to aid him!', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (141118, 'enUS', '', 'The last initiate who attempted the trial alone came back in pieces. Choose a second, or head back to the barracks.', 26124);
INSERT INTO `broadcast_text_locale` VALUES (141119, 'enUS', 'So be it! T\'paartos shall bring... this puny one!', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (141120, 'enUS', '', 'An unorthodox choice, but... technically within the rules. I have never known $p to back down from a challenge.', 26124);
INSERT INTO `broadcast_text_locale` VALUES (141121, 'enUS', '', 'Let the trial begin. Light be with you both.', 26124);
INSERT INTO `broadcast_text_locale` VALUES (141122, 'enUS', 'T\'paartos!', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (141126, 'enUS', 'When the High Exarch ordered me to Azeroth, I was reluctant to leave his side. I felt someone else would be better suited to the task.\n\nNow, though, I understand why he did it. He wanted to give me a glimpse of what he and Lady Alleria have been fighting for.\n\nOur war may be over, but many battles lie ahead. Just because the Legion is defeated doesn\'t mean every demon in existence has surrendered.\n\n<Lothraxion clenches his fist and smiles.>\n\nNot yet, at least.', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (141128, 'enUS', 'Dalaran above the Broken Isles', 'Dalaran above the Broken Isles', 26124);
INSERT INTO `broadcast_text_locale` VALUES (141131, 'enUS', '', 'I know Ethel. She\'s actually a very fast walker. She just thinks it\'s funny to mess with tourists.', 26124);
INSERT INTO `broadcast_text_locale` VALUES (141132, 'enUS', '', 'You know, high-altitude living does wonders for one\'s stamina. Allow me to demonstrate...', 26124);
INSERT INTO `broadcast_text_locale` VALUES (141133, 'enUS', '', 'You don\'t need to be from the Skyhorn tribe to join the mile high club.', 26124);
INSERT INTO `broadcast_text_locale` VALUES (141134, 'enUS', '', 'My turn-ons include my eyes, my tattoos, my armor... I mean, what doesn\'t turn on?', 26124);
INSERT INTO `broadcast_text_locale` VALUES (141135, 'enUS', '', 'I may be forged in the Light, but I know how to have fun in the dark.', 26124);
INSERT INTO `broadcast_text_locale` VALUES (141141, 'enUS', '<View Aggramar\'s Arrival.>', '<View Aggramar\'s Arrival.>', 26124);
INSERT INTO `broadcast_text_locale` VALUES (141145, 'enUS', '<View the Escape from Argus.>', '<View the Escape from Argus.>', 26124);
INSERT INTO `broadcast_text_locale` VALUES (141146, 'enUS', '<View the Triumvirate\'s Decision.>', '<View the Triumvirate\'s Decision.>', 26124);
INSERT INTO `broadcast_text_locale` VALUES (141148, 'enUS', '<View Light\'s Judgment.>', '<View Light\'s Judgment.>', 26124);
INSERT INTO `broadcast_text_locale` VALUES (141150, 'enUS', '<View Windrunner\'s Sight.>', '<View Windrunner\'s Sight.>', 26124);
INSERT INTO `broadcast_text_locale` VALUES (141151, 'enUS', '<View the Crown\'s Blessing.>', '<View the Crown\'s Blessing.>', 26124);
INSERT INTO `broadcast_text_locale` VALUES (141156, 'enUS', 'Sorry if my tattoos look a little dim. I forgot to charge my battery last night.', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (141157, 'enUS', 'Face tentacles?! We do NOT have face tentacles! If we did, that would mean draenei are secretly emissaries of the Void, gaining your trust as we infiltrate your society so that we can bring about its end. And I\'m certain you\'re not implying THAT... are you?', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (141158, 'enUS', 'Spiritwalker?!', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (141159, 'enUS', 'I bring the Light... and also the heat.', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (141160, 'enUS', '<Recall your arrival at the Seat of the Pantheon>', '<Recall your arrival at the Seat of the Pantheon>', 26124);
INSERT INTO `broadcast_text_locale` VALUES (141161, 'enUS', '<Recall the imprisoning of Sargeras>', '<Recall the imprisoning of Sargeras>', 26124);
INSERT INTO `broadcast_text_locale` VALUES (141163, 'enUS', 'I\'m a draenei on the streets... but an eredar in the sheets.', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (141173, 'enUS', '', 'Have you seen Prophet Velen\'s new dance? He calls it the Mac\'Areena.', 26124);
INSERT INTO `broadcast_text_locale` VALUES (141174, 'enUS', '', 'We are Highmountain. Unless you\'re leaving. Then we\'re Goodbye Mountain.', 26124);
INSERT INTO `broadcast_text_locale` VALUES (141175, 'enUS', 'The Vindicaar is a fast ship. You could say it travels at Light speed.', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (141176, 'enUS', 'I\'m forming a group of tauren demon hunters. We\'re called the Illi-dairy.', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (141305, 'enUS', '|TInterface\\Icons\\SPELL_NATURE_ABOLISHMAGIC.BLP:20|tEonar unleashes her |cFFFF0000|Hspell:250048|h[Life Force]|h|r!', '|TInterface\\Icons\\SPELL_NATURE_ABOLISHMAGIC.BLP:20|tEonar unleashes her |cFFFF0000|Hspell:250048|h[Life Force]|h|r !', 26124);
INSERT INTO `broadcast_text_locale` VALUES (141355, 'enUS', '', 'The Void. A force of infinite hunger.', 26124);
INSERT INTO `broadcast_text_locale` VALUES (141356, 'enUS', '', 'Sages and scholars fear the Void.', 26124);
INSERT INTO `broadcast_text_locale` VALUES (141357, 'enUS', '', 'But we understand a truth that they do not.', 26124);
INSERT INTO `broadcast_text_locale` VALUES (141358, 'enUS', '', 'The Void has shaped us... changed us. But you will become its master.', 26124);
INSERT INTO `broadcast_text_locale` VALUES (141359, 'enUS', '', 'We are soldiers.', 26124);
INSERT INTO `broadcast_text_locale` VALUES (141360, 'enUS', '', 'Through millennia of struggle, the Light has shown us the true path.', 26124);
INSERT INTO `broadcast_text_locale` VALUES (141361, 'enUS', '', 'At long last, our enemy has fallen. The Legion is no more. Yet our war is far from over. New threats gather in the shadows, awaiting their moment to strike.', 26124);
INSERT INTO `broadcast_text_locale` VALUES (141362, 'enUS', '', 'You are Lightforged. You must stand as a beacon of hope against the darkness.', 26124);
INSERT INTO `broadcast_text_locale` VALUES (141363, 'enUS', '', 'For ten-thousand years, Suramar was the only world we knew.', 26124);
INSERT INTO `broadcast_text_locale` VALUES (141364, 'enUS', '', 'As the ages passed, Azeroth changed around us... and fell into the Legion\'s grasp.', 26124);
INSERT INTO `broadcast_text_locale` VALUES (141365, 'enUS', '', 'Our leaders betrayed us, striking a bargain with the demons. But we rose up against tyranny... and drove the devils out. Suramar is ours once more, and we will never again let it fall into darkness.', 26124);
INSERT INTO `broadcast_text_locale` VALUES (141366, 'enUS', '', 'To secure our people\'s future, you must help reclaim our place in Azeroth.', 26124);
INSERT INTO `broadcast_text_locale` VALUES (141369, 'enUS', '', 'The regent lord invited the nightborne to Silvermoon. I am to travel to Suramar and escort Lady Thalyssra to the meeting.', 26124);
INSERT INTO `broadcast_text_locale` VALUES (141370, 'enUS', '', 'I am counting on you both. Do not return until Suramar\'s strength is pledged to the Horde.', 26124);
INSERT INTO `broadcast_text_locale` VALUES (141371, 'enUS', '', 'As you command, Warchief. I will meet you at Lady Thalyssra\'s estate in Suramar, $p.', 26124);
INSERT INTO `broadcast_text_locale` VALUES (141372, 'enUS', 'Lady Liadrin... champion. You are most welcome. As you can see, we have an... unexpected visitor.', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (141373, 'enUS', '', 'Hello again, Liadrin. Champion. Lor\'themar, I am here concerning a matter that might be best addressed in private.', 26124);
INSERT INTO `broadcast_text_locale` VALUES (141374, 'enUS', 'I see no need to keep secrets from allies, Alleria. In fact, some new friends of ours are just arriving.', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (141375, 'enUS', '', 'First Arcanist Thalyssra and honored guests. Welcome to Silvermoon.', 26124);
INSERT INTO `broadcast_text_locale` VALUES (141376, 'enUS', '', 'It is a pleasure to visit your fine city at last. Thank you for extending the invitation, Regent Lord.', 26124);
INSERT INTO `broadcast_text_locale` VALUES (141379, 'enUS', 'Please, call me Lor\'themar. But where are my manners? Allow me to introduce another guest: Lady Alleria Windrunner, a hero of Silvermoon\'s past.', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (141380, 'enUS', '', 'An unexpected honor, Lady Windrunner. Silgryn told me of your courage during the campaign on Argus.', 26124);
INSERT INTO `broadcast_text_locale` VALUES (141381, 'enUS', '', 'The honor is mine, First Arcanist. I do not mean to intrude upon your visit. Perhaps I should return another time.', 26124);
INSERT INTO `broadcast_text_locale` VALUES (141382, 'enUS', 'Nonsense. Whatever you came to say, you may say in front of our guests.', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (141383, 'enUS', '', 'As you wish. I come bearing an offer from High King Anduin Wr--', 26124);
INSERT INTO `broadcast_text_locale` VALUES (141384, 'enUS', 'I had hoped your visit was motivated by a love for Silvermoon. Instead, you come at the behest of the Alliance\'s boy-king. How disappointing.', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (141387, 'enUS', '', 'Cutting words, Lor\'themar. Are they yours, I wonder, or has the dutiful ranger I knew become the mouthpiece of your warchief?', 26124);
INSERT INTO `broadcast_text_locale` VALUES (141388, 'enUS', 'You doubt my words, yet how can we trust your own? Do you deny that the lords of the Void whisper to you? Did you not surrender yourself to the shadows on Argus?', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (141389, 'enUS', '', 'It seems the offer I bring has been anticipated... and spurned. Very well. But before I leave, I have one request.', 26124);
INSERT INTO `broadcast_text_locale` VALUES (141391, 'enUS', '', 'It has been a thousand years since I set eyes upon the Sunwell. May I visit it once again?', 26124);
INSERT INTO `broadcast_text_locale` VALUES (141392, 'enUS', 'I advise against it. We cannot trust that she will not--', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (141393, 'enUS', 'Whatever she has become, Alleria is a daughter of Quel\'Thalas. I will not deny her pilgrimage to our most sacred site. First Arcanist, you and your retinue would be welcome to join us.', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (141394, 'enUS', '', 'I would consider it an honor to see the Sunwell, Lor\'themar. And I prefer that my friends call me Thalyssra.', 26124);
INSERT INTO `broadcast_text_locale` VALUES (141395, 'enUS', 'Rommath, kindly open the way for us.', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (141396, 'enUS', 'Please follow me.', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (141397, 'enUS', '', 'The sense of power is palpable. As potent as the Nightwell, but of a different nature.', 26124);
INSERT INTO `broadcast_text_locale` VALUES (141398, 'enUS', '', 'The Sunwell was corrupted by our enemies, but a naaru\'s sacrifice purified its waters. Now the essence of the Light sustains us.', 26124);
INSERT INTO `broadcast_text_locale` VALUES (141399, 'enUS', '', 'The Sunwell has changed... but its beauty remains. It has been so long.', 26124);
INSERT INTO `broadcast_text_locale` VALUES (141400, 'enUS', 'Stay back!', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (141401, 'enUS', 'What is happening?', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (141402, 'enUS', 'This is why I demanded that Umbric and his radicals be exiled. Anyone who treats with the Void is a danger to the Sunwell!', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (141403, 'enUS', '', 'I did not intend for my presence to...', 26124);
INSERT INTO `broadcast_text_locale` VALUES (141404, 'enUS', 'Enough! We need to cleanse this corruption before the well is lost!', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (141405, 'enUS', '', 'Silgryn! Valtrois! Aid the regent lord!', 26124);
INSERT INTO `broadcast_text_locale` VALUES (141407, 'enUS', '', 'Highmountain stands.', 26124);
INSERT INTO `broadcast_text_locale` VALUES (141408, 'enUS', '', 'These words speak of more than earth and stone. They tell the history of our people, enduring hardship and conflict to unite against common foes.', 26124);
INSERT INTO `broadcast_text_locale` VALUES (141409, 'enUS', '', 'At times we were divided. At times we lost our way. But the spirits of our ancestors reminded us that we are bound together by earth, river, and sky. That we are family, and family is worth fighting for.', 26124);
INSERT INTO `broadcast_text_locale` VALUES (141410, 'enUS', '', 'The time has come for you to venture beyond our sacred peaks.', 26124);
INSERT INTO `broadcast_text_locale` VALUES (141464, 'enUS', '|TInterface\\Icons\\SPELL_FIRE_FELRAINOFFIRE.BLP:20|t|cFFFF0000|Hspell:248333|h[Meteor Storm]|h|r can be avoided, be sure to avoid its impact.', '|TInterface\\Icons\\SPELL_FIRE_FELRAINOFFIRE.BLP:20|t|cFFFF0000|Hspell:248333|h[Meteor Storm]|h|r can be avoided, be sure to avoid its impact.', 26124);
INSERT INTO `broadcast_text_locale` VALUES (141465, 'enUS', 'This creature will turn and attack players, be sure it\'s attacking a tank before you attack it!', 'This creature will turn and attack players, be sure it\'s attacking a tank before you attack it!', 26124);
INSERT INTO `broadcast_text_locale` VALUES (141466, 'enUS', '|TInterface\\Icons\\SPELL_FIRE_FELFLAMESTRIKE.BLP:20|tFel-Infused Destructors damage Eonar with their |cFFFF0000|Hspell:246305|h[Artillery Strike]|h|r, be sure to dispatch them quickly.', '|TInterface\\Icons\\SPELL_FIRE_FELFLAMESTRIKE.BLP:20|tFel-Infused Destructors damage Eonar with their |cFFFF0000|Hspell:246305|h[Artillery Strike]|h|r, be sure to dispatch them quickly.', 26124);
INSERT INTO `broadcast_text_locale` VALUES (141467, 'enUS', '|TInterface\\ICONS\\spell_shadow_shadesofdarkness.blp:20|t Move near allies to avoid |cFFF00000|Hspell:243963|h[Alone in the Darkness]|h|r!', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (141468, 'enUS', '|TInterface\\ICONS\\ABILITY_HUNTER_SNIPERSHOT.BLP:20|t Run away from the boss during |cFFF00000|Hspell:246220|h[Fel Bombardment]|h|r to avoid damage!', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (141469, 'enUS', '|TInterface\\Icons\\SPELL_FIRE_IMMOLATION.BLP:20|tLeave construction bays during  |cFFFF0000|Hspell:248061|h[Purging Protocol]|h|r to avoid being killed!', '|TInterface\\Icons\\SPELL_FIRE_IMMOLATION.BLP:20|tLeave construction bays during  |cFFFF0000|Hspell:248061|h[Purging Protocol]|h|r to avoid being killed!', 26124);
INSERT INTO `broadcast_text_locale` VALUES (141480, 'enUS', 'The only way is forward.', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (141481, 'enUS', 'Pain is the architect of memories.', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (141482, 'enUS', 'There is no kindness here.', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (141483, 'enUS', 'Anguish and hurt... the search for solace.', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (141484, 'enUS', 'Even amidst hopelessness, there is respite.', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (141485, 'enUS', 'Is there no comfort? No relief?', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (141486, 'enUS', 'Retreat deeper... find safety... find comfort...', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (141487, 'enUS', 'Distraction provides escape.', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (141488, 'enUS', 'Unfair! Unjust! Nothing is ever what it seems!', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (141489, 'enUS', 'Enemies lurk within every shadow. Can this darkness be stopped?', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (141490, 'enUS', 'Is solitude the answer? No one can hurt you if you remain alone.', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (141491, 'enUS', 'Safe. Secure. Away from everyone. Everything.', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (141492, 'enUS', 'Fear is relentless. Unyielding. A foe to be defeated.', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (141493, 'enUS', 'Perhaps to overcome fear of the darkness, one must embrace it.', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (141494, 'enUS', 'An offer refuted... and yet the fear remains.', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (141495, 'enUS', 'Within one soul exist many truths. Some noble. Others...', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (141496, 'enUS', 'Does the path lead to greatness? Glory? Or obliteration?', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (141501, 'enUS', '|TInterface\\Icons\\Sha_Ability_Rogue_BloodyEye_nightmare:20|t|cFFFF0000|Hspell:258068|h[Sargeras\' Gaze]|h|r is cast upon the battle...', '|TInterface\\Icons\\Sha_Ability_Rogue_BloodyEye_nightmare:20|t|cFFFF0000|Hspell:258068|h[Sargeras\' Gaze]|h|r is cast upon the battle...', 26124);
INSERT INTO `broadcast_text_locale` VALUES (141518, 'enUS', 'This T\'paartos is pledged to the Light, yet... treats with the darkness? This cannot be T\'paartos\' fate!', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (141554, 'enUS', '', 'I cannot let the Darkness possess my father\'s body!', 26124);
INSERT INTO `broadcast_text_locale` VALUES (141555, 'enUS', 'Mayla! We must stand together!', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (141556, 'enUS', 'I am free from the Old Gods\' grip. Thank you, my friends.', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (141575, 'enUS', 'Serve your true masters, drogbar! Your defiance means death!', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (141576, 'enUS', 'The Skyhorn shall serve my masters! You will become the shadow that darkens the skies!', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (141577, 'enUS', 'The Legion was nothing compared to our power! Surrender!', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (141578, 'enUS', 'You have failed! The Darkness rises... and Highmountain shall fall!', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (141579, 'enUS', 'The wards have weakened! He will be ours!', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (141585, 'enUS', 'Follow me, champion.', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (141586, 'enUS', 'Long ago, the Old Gods sought to lay claim to Highmountain. Their campaign was led by a terrible general... Uul\'gyneth the Darkness.', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (141587, 'enUS', 'Huln gathered heroes from among the tribes to stand together. They fought against Uul\'gyneth\'s servants, the Necrodark... but the forces of shadow were too great to overcome.', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (141588, 'enUS', 'So Huln devised another plan. Wards were placed to lock away the Old Gods\' influence. Though the general survived, Uul\'gyneth\'s essence was trapped.', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (141589, 'enUS', '', 'So the Necrodark have been lurking in the shadows, waiting to call forth their master.', 26124);
INSERT INTO `broadcast_text_locale` VALUES (141590, 'enUS', 'Indeed. And when I left the mountain to visit Mulgore, the wards weakened just enough to let the Darkness take hold.', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (141591, 'enUS', 'The last ward was placed at Highmountain Summit. That is where we must go. Just as Huln stood with his allies, so we must band together.', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (141596, 'enUS', 'Warchief Sylvanas Windrunner, I present Chieftain Mayla Highmountain.', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (141628, 'enUS', 'Was T\'paartos meant to walk this path? Is T\'paartos worthy to become Lightforged?', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (141629, 'enUS', 'No! The darkness will not claim T\'paartos!', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (141630, 'enUS', 'Ahh, Ika. T\'paartos raised this elekk when its mother was killed.', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (141631, 'enUS', 'T\'paartos has faced many such fiends in the Army of the Light.', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (141632, 'enUS', 'T\'paartos can lift mountains!', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (141633, 'enUS', 'This is... slightly embarrassing for T\'paartos.', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (141634, 'enUS', 'Ugh! Can $p make the snakes go away?', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (141635, 'enUS', 'No... this is not real. This cannot be the true T\'paartos!', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (141636, 'enUS', 'No...', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (141637, 'enUS', 'ENOUGH!!!', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (141638, 'enUS', 'The Light has always been with T\'paartos! He will NEVER abandon the Light!', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (141639, 'enUS', 'Such power awaits us, T\'paartos.', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (141640, 'enUS', 'The Light is not the way to true strength.', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (141641, 'enUS', 'Shrug off the chains the Light has used to bind you.', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (141642, 'enUS', 'Yes... give in, T\'paartos. Embrace true power!', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (141677, 'enUS', '', 'Welcome back, T\'paartos.', 26124);
INSERT INTO `broadcast_text_locale` VALUES (141678, 'enUS', '', 'T\'paartos... You confronted your fears... your failings... and have been reborn.', 26124);
INSERT INTO `broadcast_text_locale` VALUES (141679, 'enUS', 'We all have darkness inside us. It is no easy thing to face.', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (141680, 'enUS', 'T\'paartos realizes this now.', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (141681, 'enUS', '', 'This is an official ceremony. Do not interrupt.', 26124);
INSERT INTO `broadcast_text_locale` VALUES (141712, 'enUS', '', 'Greetings, $n. You probably don\'t remember me--we met next week.$b$bWould you care to revisit Ulduar?', 26124);
INSERT INTO `broadcast_text_locale` VALUES (141713, 'enUS', 'Send me into Ulduar. (Timewalking Raid)', 'Send me into Ulduar. (Timewalking Raid)', 26124);
INSERT INTO `broadcast_text_locale` VALUES (141731, 'enUS', 'Can you believe there are cities out there that aren\'t encased in a magic bubble? I mean, how do those people keep the dust out? Savages.', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (141732, 'enUS', '', 'I like bubbles. They make me feel safe!', 26124);
INSERT INTO `broadcast_text_locale` VALUES (141775, 'enUS', '|TInterface\\Icons\\INV_ELEMENTAL_PRIMAL_AIR:20|tGolganneth has chosen you to deliver the |cFFFF0000|Hspell:257313|h[Gift of the Sky]|h|r!', '|TInterface\\Icons\\INV_ELEMENTAL_PRIMAL_AIR:20|tGolganneth has chosen you to deliver the |cFFFF0000|Hspell:257313|h[Gift of the Sky]|h|r!', 26124);
INSERT INTO `broadcast_text_locale` VALUES (141776, 'enUS', '|TInterface\\Icons\\ACHIEVEMENT_ZONE_VASHJIR:20|tGolganneth has chosen you to deliver the |cFFFF0000|Hspell:257306|h[Gift of the Sea]|h|r!', '|TInterface\\Icons\\ACHIEVEMENT_ZONE_VASHJIR:20|tGolganneth has chosen you to deliver the |cFFFF0000|Hspell:257306|h[Gift of the Sea]|h|r!', 26124);
INSERT INTO `broadcast_text_locale` VALUES (141784, 'enUS', 'The wards have weakened! He will be ours!', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (141790, 'enUS', 'Mayla... the pools...', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (141791, 'enUS', '', 'I understand, my friend. Baine, I must get Ebonhorn back to Highmountain.', 26124);
INSERT INTO `broadcast_text_locale` VALUES (141792, 'enUS', 'Very well. We will drive this Old God filth from Thunder Bluff.', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (141795, 'enUS', 'Destroy them! They must not hinder my return!', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (141796, 'enUS', 'Your masters will not take my city, monster!', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (141797, 'enUS', 'I must be certain the Old Gods\' minions are driven from Mulgore.', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (141798, 'enUS', 'Go to Highmountain and aid Mayla, champion. I will join you soon.', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (141799, 'enUS', '', 'The waters have soothed Ebonhorn, but I fear he is slipping away.', 26124);
INSERT INTO `broadcast_text_locale` VALUES (141800, 'enUS', '', 'I will remain here while Graysky aids you. Pray that restoring the wards will mend Ebonhorn\'s mind.', 26124);
INSERT INTO `broadcast_text_locale` VALUES (141802, 'enUS', 'My mind is my own again. Return to Thunder Totem, champion. Let us gather strength for what is to come.', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (141803, 'enUS', 'Champion! Graysky told me of your courage.', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (141804, 'enUS', '', 'But our work is not done yet. Ebonhorn, we must know what this Darkness wants.', 26124);
INSERT INTO `broadcast_text_locale` VALUES (141805, 'enUS', 'Long ago, the Old Gods sought to claim Highmountain. Their campaign was led by a terrible creature of nightmare... Uul\'gyneth the Darkness.', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (141806, 'enUS', 'Huln gathered heroes from among the tribes. They fought against Uul\'gyneth\'s servants, the Necrodark... but the forces of shadow were too great to overcome.', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (141807, 'enUS', 'So Huln devised another plan. Wards were placed to lock away the Old Gods\' influence. Though the general survived, Uul\'gyneth\'s essence was trapped.', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (141808, 'enUS', '', 'All this time, the Necrodark have been lurking in the shadows, waiting to call forth their master.', 26124);
INSERT INTO `broadcast_text_locale` VALUES (141809, 'enUS', 'Indeed. And when I left the mountain to visit Mulgore, the wards weakened just enough to let the Darkness seep through.', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (141810, 'enUS', 'The last ward was placed at Highmountain Summit. That is where we must go. Just as Huln stood with his allies, so we must band together.', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (141811, 'enUS', 'Yes... come! Your strength will become ours, child of darkness!', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (141812, 'enUS', 'Child of... What does he mean?', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (141813, 'enUS', 'I... cannot say. Mayla, you and I must go on ahead. Baine, you and our champion gather the others and meet us at the summit.', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (141829, 'enUS', '', 'Oh, hi! Did you want to take a S.E.L.F.I.E. with me?', 26124);
INSERT INTO `broadcast_text_locale` VALUES (141830, 'enUS', 'What does S.E.L.F.I.E. stand for?', 'What does S.E.L.F.I.E. stand for?', 26124);
INSERT INTO `broadcast_text_locale` VALUES (141831, 'enUS', '', 'Self-Enabling Low Focus Image Extractor.', 26124);
INSERT INTO `broadcast_text_locale` VALUES (141832, 'enUS', 'I lost my camera. Can you make me another one?', 'I lost my camera. Can you make me another one?', 26124);
INSERT INTO `broadcast_text_locale` VALUES (141833, 'enUS', 'Can this camera do anything else?', 'Can this camera do anything else?', 26124);
INSERT INTO `broadcast_text_locale` VALUES (141834, 'enUS', '', 'You know, I\'m not quite sure! It\'s infused with some powerful engineering... there\'s probably a hidden feature or two.$B$BYou might want to try taking it near some sources of great power. That always seems to kick-start things!', 26124);
INSERT INTO `broadcast_text_locale` VALUES (141835, 'enUS', '', 'Niko, more light! Oh, hey gorgeous! Didn\'t see ya there. What can I do for ya?', 26124);
INSERT INTO `broadcast_text_locale` VALUES (141836, 'enUS', '', 'I like ya. Never satisfied, just like me. That\'s the pursuit of perfection in ya.$B$BYa know, I\'m not really sure. This thing\'s got the best in goblin engineering all crammed into a tiny box. That\'s a recipe for untapped potential, right there.$B$BMaybe find yourself a source of great power and... see what happens? No promises.', 26124);
INSERT INTO `broadcast_text_locale` VALUES (141837, 'enUS', 'I am eager for the Lightforged to join the Alliance. Turalyon, bring our champion with you to the Vindicaar so that you may address your troops together.', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (141838, 'enUS', 'It will be done, High King.', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (141839, 'enUS', 'This way, champion.', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (141840, 'enUS', 'Fareeya, I need a beacon to the Vindicaar.', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (141841, 'enUS', '', 'At once, High Exarch.', 26124);
INSERT INTO `broadcast_text_locale` VALUES (141846, 'enUS', 'This way!', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (141847, 'enUS', 'Over here!', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (141848, 'enUS', 'Look out!', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (141849, 'enUS', 'Here, friend!', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (141850, 'enUS', 'T\'paartos does not know fear!', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (141851, 'enUS', 'T\'paartos regrets calling $p puny.', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (141852, 'enUS', 'The fear... it followed T\'paartos everywhere!', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (141870, 'enUS', 'T\'paartos is sorry.', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (141871, 'enUS', 'From this day forth, you are Lightforged.', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (141872, 'enUS', '', 'Pheta thones gamera. Light guide our path!', 26124);
INSERT INTO `broadcast_text_locale` VALUES (141873, 'enUS', 'T\'paartos!', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (141874, 'enUS', 'T\'paartos is a bit... unconventional. But he will serve our cause well.', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (141875, 'enUS', 'Champion, it is time for us to return to Stormwind. Fareeya, spread the word. The Lightforged now fight for the Alliance.', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (141876, 'enUS', '', 'With pleasure, High Exarch.', 26124);
INSERT INTO `broadcast_text_locale` VALUES (141892, 'enUS', 'High King Wrynn. The Army of the Light is pledged to defend the Alliance.', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (141893, 'enUS', 'The strength of the Lightforged is most welcome in our ranks, High Exarch.', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (141894, 'enUS', 'I have fought beside these draenei in the Twisting Nether for a thousand years. You will find no soldiers who are more skilled, or more loyal.', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (141895, 'enUS', 'Both these qualities will be needed in the days to come. And thank you for your part in bringing them to our cause, $p.', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (141897, 'enUS', 'For the Alliance!', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (141898, 'enUS', 'For the Alliance!', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (141899, 'enUS', 'We will drive your shadow from Mulgore!', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (141900, 'enUS', 'Hahahaha! It feels good to swing my mace again!', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (141901, 'enUS', 'Thunder Bluff will be free of you!', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (141902, 'enUS', 'Go back to the void that spawned you!', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (141908, 'enUS', '', 'I did not expect you back so soon, High Exarch. I assume your meeting with the king went well?', 26124);
INSERT INTO `broadcast_text_locale` VALUES (141909, 'enUS', 'Indeed. He is eager to have the Army of the Light fighting on the side of the Alliance. Assemble our forces, captain, and I will make the announcement.', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (141910, 'enUS', '', 'You know how fond I am of your speeches, but can it wait? We were just about to send these initiates to undertake the trials.', 26124);
INSERT INTO `broadcast_text_locale` VALUES (141911, 'enUS', 'Ah, this is excellent timing, champion. You can see firsthand what it means for a soldier to become Lightforged. Proceed, Fareeya.', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (141912, 'enUS', '', 'For thousands of years, the Lightforged fought demons in the Twisting Nether. The Xenedar was the only home we knew.', 26124);
INSERT INTO `broadcast_text_locale` VALUES (141913, 'enUS', '', 'Now, for the first time in ages, we can walk beneath a sky not befouled by the Legion\'s madness... and feel the earth under our hooves again.', 26124);
INSERT INTO `broadcast_text_locale` VALUES (141914, 'enUS', '', 'But we must not grow complacent. One war ends, the next begins. Such is the life of a soldier.', 26124);
INSERT INTO `broadcast_text_locale` VALUES (141915, 'enUS', '', 'Your duty begins in Stormwind. Explore this world of Azeroth. Get to know the people and places we have sworn to defend.', 26124);
INSERT INTO `broadcast_text_locale` VALUES (141916, 'enUS', '', 'And always walk in the Light, $p.', 26124);
INSERT INTO `broadcast_text_locale` VALUES (141918, 'enUS', '', 'For many ages, our people have called the Broken Isles home. We know little about the Azeroth that exists beyond our shores.', 26124);
INSERT INTO `broadcast_text_locale` VALUES (141919, 'enUS', '', 'It is time we changed that.', 26124);
INSERT INTO `broadcast_text_locale` VALUES (141920, 'enUS', '', 'Today you begin a new journey, $p. You will be our voice in the lands beyond the mountain.', 26124);
INSERT INTO `broadcast_text_locale` VALUES (141921, 'enUS', '', 'Go to Orgrimmar. Meet our new allies and learn what it is they care about... what they fight for.', 26124);
INSERT INTO `broadcast_text_locale` VALUES (141922, 'enUS', '', 'Stay true to who you are. And should you ever miss your home, know that Highmountain is here for you. Always.', 26124);
INSERT INTO `broadcast_text_locale` VALUES (141927, 'enUS', '|TInterface\\Icons\\Ability_Argus_WastingPlague:20|tYou are afflicted with |cFFFF0000|Hspell:248396|h[Soulblight]|h|r!', '|TInterface\\Icons\\Ability_Argus_WastingPlague:20|tYou are afflicted with |cFFFF0000|Hspell:248396|h[Soulblight]|h|r!', 26124);
INSERT INTO `broadcast_text_locale` VALUES (141931, 'enUS', 'S.E.L.F.I.E. Camera captures Twilight Filter!', 'S.E.L.F.I.E. Camera captures Twilight Filter!', 26124);
INSERT INTO `broadcast_text_locale` VALUES (141932, 'enUS', 'S.E.L.F.I.E. Camera captures Firelands Filter!', 'S.E.L.F.I.E. Camera captures Firelands Filter!', 26124);
INSERT INTO `broadcast_text_locale` VALUES (141933, 'enUS', 'S.E.L.F.I.E. Camera captures Sha Filter!', 'S.E.L.F.I.E. Camera captures Sha Filter!', 26124);
INSERT INTO `broadcast_text_locale` VALUES (141934, 'enUS', 'S.E.L.F.I.E. Camera captures Frostmourne Filter!', 'S.E.L.F.I.E. Camera captures Frostmourne Filter!', 26124);
INSERT INTO `broadcast_text_locale` VALUES (141935, 'enUS', 'S.E.L.F.I.E. Camera captures Argus Filter!', 'S.E.L.F.I.E. Camera captures Argus Filter!', 26124);
INSERT INTO `broadcast_text_locale` VALUES (141940, 'enUS', '', 'Your sojourn through Azeroth has been long, $p. And through it all, you have brought honor to Highmountain.', 26124);
INSERT INTO `broadcast_text_locale` VALUES (141941, 'enUS', '', 'Now Thunder Totem calls you home. It is time we thank you for all that you have done for us.', 26124);
INSERT INTO `broadcast_text_locale` VALUES (141943, 'enUS', '', 'Through the darkest times, you have been strong, brave, unyielding. Thanks to you, $p, the Horde knows what it means to be Highmountain.', 26124);
INSERT INTO `broadcast_text_locale` VALUES (141944, 'enUS', '', 'It is my honor to present you with the armor of our people. No matter where your journey takes you, it will serve as a reminder of where you came from.', 26124);
INSERT INTO `broadcast_text_locale` VALUES (141947, 'enUS', '', 'Your service to the Alliance has been most impressive, $p. I could not have done better myself. Well, I could... but not by much.', 26124);
INSERT INTO `broadcast_text_locale` VALUES (141948, 'enUS', '', 'Come, meet with me at the Vindicaar. It is time that we reward your diligence.', 26124);
INSERT INTO `broadcast_text_locale` VALUES (141949, 'enUS', '', 'Throughout your journeys, you have been a beacon of Light in the darkness. You have shown the Alliance what it means to be Lightforged.', 26124);
INSERT INTO `broadcast_text_locale` VALUES (141950, 'enUS', '', 'Wear these vestments with pride, $p. The Army of the Light will always be honored to count you in its ranks.', 26124);
INSERT INTO `broadcast_text_locale` VALUES (141951, 'enUS', 'This way!', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (141952, 'enUS', 'Over here!', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (141953, 'enUS', 'Look out!', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (141954, 'enUS', 'The enemy is all around us!', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (142029, 'enUS', 'Highmountain stands.', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (142033, 'enUS', 'Greetings, traveler.', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (142034, 'enUS', 'The river provides.', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (142035, 'enUS', 'What has the wind brought?', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (142054, 'enUS', 'We will not fear the darkness.', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (142055, 'enUS', 'Peace and patience, friend.', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (142056, 'enUS', 'We defend this world together.', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (142057, 'enUS', 'Beware the deep places of the earth.', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (142058, 'enUS', 'Together, we are Highmountain.', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (142059, 'enUS', 'An\'she guide you.', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (142060, 'enUS', 'May your rivers be ever bountiful.', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (142061, 'enUS', 'Ride the winds.', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (142062, 'enUS', 'Sun and moon light your way.', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (142063, 'enUS', 'Remember the Earthmother\'s lessons.', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (142064, 'enUS', 'Annoy me and you\'ll get the rack.', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (142065, 'enUS', 'Those who offend Highmountain are in for a fall. A loooooong fall.', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (142066, 'enUS', 'Keep it up and you\'ll get a swift hoof to the backside.', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (142067, 'enUS', 'Find yourself a deep place of the earth and get lost.', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (142068, 'enUS', 'Have you come to trade?', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (142069, 'enUS', 'I have just the thing for you.', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (142070, 'enUS', 'Feel free to browse.', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (142071, 'enUS', 'I offer Highmountain\'s finest.', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (142072, 'enUS', 'Come back again.', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (142073, 'enUS', 'Pleasure doing business.', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (142074, 'enUS', 'See you soon.', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (142075, 'enUS', 'We replenish stock daily.', '', 26124);
