INSERT INTO `broadcast_text_locale` VALUES (142595, 'enUS', '', 'The Ghostlands. This was once Eversong Forest... a place of unbridled beauty. Windrunner Spire, my family home, stands not far from here.', 26124);
INSERT INTO `broadcast_text_locale` VALUES (142596, 'enUS', '', 'This place looks like it has been ransacked. But perhaps Umbric left behind a clue.', 26124);
INSERT INTO `broadcast_text_locale` VALUES (142597, 'enUS', '', 'This place resonates with power. Tread carefully, $n.', 26124);
INSERT INTO `broadcast_text_locale` VALUES (142598, 'enUS', '', 'Umbric is a dedicated scholar... but his tenacity turned him and his followers into exiles.', 26124);
INSERT INTO `broadcast_text_locale` VALUES (142599, 'enUS', '', 'We are ready to proceed. Stay on your guard, $p. We do not know what we might find inside.', 26124);
INSERT INTO `broadcast_text_locale` VALUES (142600, 'enUS', '', '\"Remember the Sunwell\"? Please. I am so over it.', 26124);
INSERT INTO `broadcast_text_locale` VALUES (142604, 'enUS', '', 'The Andilien Estate... yes, I remember it. Come, $p.', 26124);
INSERT INTO `broadcast_text_locale` VALUES (142605, 'enUS', '', 'Umbric risks much. He follows in the footsteps of treachery. Let us hope this obsession has not led to his downfall.', 26124);
INSERT INTO `broadcast_text_locale` VALUES (142621, 'enUS', '|TInterface\\Icons\\SPELL_HOLY_PROCLAIMCHAMPION:20|tMove to the |cFFFF0000|Hspell:255199|h[Avatar of Aggramar]|h|rto avoid being killed by |TInterface\\Icons\\SPELL_SHADOW_SHADOWFURY:20|t |cFFFF0000|Hspell:|h[Soulbomb Detonation]|h|r!', '|TInterface\\Icons\\SPELL_HOLY_PROCLAIMCHAMPION:20|tMove to the |cFFFF0000|Hspell:255199|h[Avatar of Aggramar]|h|rto avoid being killed by |TInterface\\Icons\\SPELL_SHADOW_SHADOWFURY:20|t |cFFFF0000|Hspell:|h[Soulbomb Detonation]|h|r!', 26124);
INSERT INTO `broadcast_text_locale` VALUES (142628, 'enUS', 'I suppse you are wondering what I am doing here.$b$bSuffice it to say that I have been given a new prime directive. Apparently standing watch over the Conservatory was not an efficient use of my time.$b$b<Sigh> Tenure no longer means what it once did.$b$bDo you require something? As you can see, I am quite busy.', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (142629, 'enUS', 'Hello, Vigilant Quoram. We met before on Argus.', 'Hello, Vigilant Quoram. We met before on Argus.', 26124);
INSERT INTO `broadcast_text_locale` VALUES (142630, 'enUS', 'I passed my trial!', 'I passed my trial!', 26124);
INSERT INTO `broadcast_text_locale` VALUES (142631, 'enUS', 'What do you know about becoming Lightforged?', 'What do you know about becoming Lightforged?', 26124);
INSERT INTO `broadcast_text_locale` VALUES (142632, 'enUS', 'Do you plan on staying with the draenei?', 'Do you plan on staying with the draenei?', 26124);
INSERT INTO `broadcast_text_locale` VALUES (142633, 'enUS', 'How do you like being on the Vindicaar?', 'How do you like being on the Vindicaar?', 26124);
INSERT INTO `broadcast_text_locale` VALUES (142634, 'enUS', 'Can you teleport me back up to the bridge?', 'Can you teleport me back up to the bridge?', 26124);
INSERT INTO `broadcast_text_locale` VALUES (142639, 'enUS', 'The vessel has been found!', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (142640, 'enUS', 'It wants the Sunwell!', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (142659, 'enUS', 'A pity you remain defiant. The patience of the masters is vast... but not infinite.', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (142660, 'enUS', 'A minor setback. What is in motion cannot be undone. Surely you see this.', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (142666, 'enUS', 'The void will transform you... awaken what you were meant to be.', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (142667, 'enUS', 'Do you not see what we offer? The majesty of chaos... the glory of infinite hunger!', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (142668, 'enUS', 'Why do you fight your destiny, Windrunner? Join me and rule by my side!', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (142670, 'enUS', 'So be it. Your death is regrettable... but necessary.', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (142672, 'enUS', 'My people were reshaped by the void. Stripped of the limitations of flesh. We offer you the same gift.', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (142674, 'enUS', 'Even shattered as it is, this place echoes with the whispers of the great ones who were slain... and the hatred of he who broke this world.', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (142686, 'enUS', '', 'Dark forces surge through these ashen stones. No wonder the ethereals were drawn here.', 26124);
INSERT INTO `broadcast_text_locale` VALUES (142688, 'enUS', '', 'That vortex up ahead pulses with power. Let us investigate, $p.', 26124);
INSERT INTO `broadcast_text_locale` VALUES (142689, 'enUS', '', 'There! Durzaan is using those forges to draw in power. We must break his hold on Umbric\'s people.', 26124);
INSERT INTO `broadcast_text_locale` VALUES (142691, 'enUS', 'I offer freedom. I offer strength. Cast off your mortal shackles.', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (142692, 'enUS', '', 'Our destiny is our own, Durzaan! You will not define our future!', 26124);
INSERT INTO `broadcast_text_locale` VALUES (142696, 'enUS', 'The transformation... incomplete... must... be... finished...', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (142697, 'enUS', '', 'The only thing that will be finished here... is you.', 26124);
INSERT INTO `broadcast_text_locale` VALUES (142723, 'enUS', '', 'If a portal leading into endless nothingness were to open under your feet and consume you in my presence, rest assured it would be entirely coincidental. Accidents do happen, after all.', 26124);
INSERT INTO `broadcast_text_locale` VALUES (142725, 'enUS', '', 'Oh sure, I get physically transformed by a cosmic force known to induce madness and suddenly I\'m considered \"suspicious\". Talk about profiling...', 26124);
