INSERT INTO `broadcast_text_locale` VALUES (142867, 'enUS', 'Bal\'a dash, malanore.', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (142872, 'enUS', 'Something seeks to open a rift into the chamber. If it comes through, we may lose the Sunwell.', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (142873, 'enUS', '', 'I can close the rift--but I will need help.', 26124);
INSERT INTO `broadcast_text_locale` VALUES (142874, 'enUS', '', 'Tell us what to do, and we will lend our strength.', 26124);
INSERT INTO `broadcast_text_locale` VALUES (142875, 'enUS', 'The door opens. Yes... this should suit our needs.', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (142876, 'enUS', '', 'Now! Focus your power with mine!', 26124);
INSERT INTO `broadcast_text_locale` VALUES (142877, 'enUS', 'You only delay the inevitable! I will yet have my prize.', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (142878, 'enUS', 'The Sunwell is secure. Your aid was invaluable, Thalyssra. And yours, champion.', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (142879, 'enUS', 'Guards! Seize this saboteur.', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (142880, 'enUS', '', 'I will not be taken prisoner in my own homeland.', 26124);
INSERT INTO `broadcast_text_locale` VALUES (142881, 'enUS', 'Enough! You will leave at once, Alleria. Accident or no, your presence poses a danger to Quel\'Thalas. Go back to Stormwind. Silvermoon is no longer your home.', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (142882, 'enUS', '', 'As you command, Regent Lord. For now.', 26124);
INSERT INTO `broadcast_text_locale` VALUES (142883, 'enUS', 'I regret you had to witness that exchange, Thalyssra. This is not how I planned your visit to unfold.', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (142884, 'enUS', '', 'On the contrary. This conflict has demonstrated your dedication to your people. I can see that the Horde has allowed you to uphold your traditions--something that is very important to us.', 26124);
INSERT INTO `broadcast_text_locale` VALUES (142885, 'enUS', '', 'We gain strength from our allies... but we have not lost who we are.', 26124);
INSERT INTO `broadcast_text_locale` VALUES (142886, 'enUS', '', 'Suramar will always be our home. But some among my people wish to venture out into the world, to claim our place in Azeroth once again. To do that, we need allies.', 26124);
INSERT INTO `broadcast_text_locale` VALUES (142887, 'enUS', 'The Horde offers that to you, First Arcanist. Join us. The gates of Silvermoon stand open to you.', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (142888, 'enUS', '', 'On behalf of the nightborne, I accept your proposal. From this day forth, Suramar fights for the Horde.', 26124);
INSERT INTO `broadcast_text_locale` VALUES (142889, 'enUS', 'Excellent! Lady Liadrin, please return to Orgrimmar and tell the warchief the good news.', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (142890, 'enUS', '', 'It will be my pleasure, Regent Lord. I will meet you in Silvermoon, champion.', 26124);
INSERT INTO `broadcast_text_locale` VALUES (142910, 'enUS', '', 'Alleria tenses defiantly.', 26124);
INSERT INTO `broadcast_text_locale` VALUES (142986, 'enUS', 'Good luck, $p. As for me, I am going to test my skill in Ashenvale. For the Horde!', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (142999, 'enUS', 'Champion... \'tis good ta see a familiar face in these dark times.', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (143000, 'enUS', 'Since returnin\' from Argus, the cries o\' Azeroth have been... overwhelmin\'. Such pain...', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (143001, 'enUS', 'I don\'t know how ta fix this. Not sure anyone does. But we\'ve gotta keep tryin\'.', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (143002, 'enUS', 'The storm\'s gatherin\', $p. If we don\'t find a way ta heal Azeroth... nothin\' else is gonna matter.', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (143003, 'enUS', 'Champions, ye unified yer orders and fought together ta drive the Legion from Azeroth.', '', 26972);
INSERT INTO `broadcast_text_locale` VALUES (143004, 'enUS', 'I know tensions are risin\'... but I\'m callin\' on ye ta stand together once more.', '', 26972);
INSERT INTO `broadcast_text_locale` VALUES (143005, 'enUS', 'Come ta Silithus... while we still have a world left ta fight for!', '', 26972);
INSERT INTO `broadcast_text_locale` VALUES (143006, 'enUS', 'The sword of Sargeras is poisonin\' the very lifeblood of the world.', '', 26972);
INSERT INTO `broadcast_text_locale` VALUES (143007, 'enUS', 'The only vessels capable o\' containin\' that kind o\' power... are the mighty weapons you wield.', '', 26972);
INSERT INTO `broadcast_text_locale` VALUES (143008, 'enUS', 'Raise them up as one.... draw out the corruption from the Dark Titan\'s blade!', '', 26972);
INSERT INTO `broadcast_text_locale` VALUES (143009, 'enUS', 'Together, champions! For Azeroth!', '', 26972);
INSERT INTO `broadcast_text_locale` VALUES (143010, 'enUS', 'Ye did it! Sargeras\' sword has gone dormant. Now, Azeroth\'s not yet healed... but your actions bought us precious time.', '', 26972);
INSERT INTO `broadcast_text_locale` VALUES (143011, 'enUS', 'The energy coursin\' through that weapon o\' yers... I ain\'t seen nothin\' like it! But remember, all power comes with a price.', '', 26972);
INSERT INTO `broadcast_text_locale` VALUES (143012, 'enUS', 'I know there\'s much ta face in the days ahead. But no matter what comes... never forget our duty ta Azeroth!', '', 26972);
INSERT INTO `broadcast_text_locale` VALUES (143013, 'enUS', 'You\'re anxious. You hide it well... but I know you.', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (143014, 'enUS', '', 'Like no other, my love.', 26124);
INSERT INTO `broadcast_text_locale` VALUES (143015, 'enUS', 'You don\'t have to go. You don\'t have to see her.', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (143016, 'enUS', 'Each of you has a path to follow. If the Light wills that those paths intersect, they will. There\'s no need to force the hand of fate.', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (143017, 'enUS', '', 'It is time, Turalyon. I must see my homeland again with my own eyes... and hear from Sylvanas how she could ever wear the mantle of warchief.', 26124);
INSERT INTO `broadcast_text_locale` VALUES (143018, 'enUS', 'It is unsettling to look upon these memorials to our passing.', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (143019, 'enUS', '', 'Indeed. Sometimes I feel that I have already died twice. Once when we were presumed lost on Draenor, and again when gripped by the shadow of the fallen naaru.', 26124);
INSERT INTO `broadcast_text_locale` VALUES (143020, 'enUS', '', 'Perhaps death is the true legacy of the Windrunners.', 26124);
INSERT INTO `broadcast_text_locale` VALUES (143078, 'enUS', 'Come, friend $p.', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (143124, 'enUS', '', 'Warchief Sylvanas Windrunner, this is First Arcanist Thalyssra of Suramar.', 26124);
INSERT INTO `broadcast_text_locale` VALUES (143144, 'enUS', '', 'An honor, Warchief. I have fought alongside both Lady Liadrin and the regent lord. Their courage is a credit to your Horde.', 26124);
INSERT INTO `broadcast_text_locale` VALUES (143145, 'enUS', '', 'Indeed, First Arcanist.', 26124);
INSERT INTO `broadcast_text_locale` VALUES (143146, 'enUS', '', 'The Horde embodies strength. Determination. Individuality. Traits we shal\'dorei value as well.', 26124);
INSERT INTO `broadcast_text_locale` VALUES (143147, 'enUS', '', 'It is time for the nightborne to find allies among the kingdoms of Azeroth. If you will have us, we would be proud to pledge our forces to your cause.', 26124);
INSERT INTO `broadcast_text_locale` VALUES (143148, 'enUS', '', 'For millennia Suramar stood alone. This day, you become part of something greater. I accept your oath of service, Thalyssra.', 26124);
INSERT INTO `broadcast_text_locale` VALUES (143149, 'enUS', '', 'Suramar stands with the Horde!', 26124);
INSERT INTO `broadcast_text_locale` VALUES (143150, 'enUS', '', 'For the Horde!', 26124);
INSERT INTO `broadcast_text_locale` VALUES (143151, 'enUS', '', 'For the Horde!', 26124);
INSERT INTO `broadcast_text_locale` VALUES (143172, 'enUS', '', 'High King Wrynn, $p and I found the sin\'dorei exiles. Like me, they have been changed by the void--but their hearts and minds remain their own.', 26124);
INSERT INTO `broadcast_text_locale` VALUES (143173, 'enUS', '', 'I will be their guide. I will train them to control the whispers of shadow. In return, they will fight for the Alliance against all its foes.', 26124);
INSERT INTO `broadcast_text_locale` VALUES (143175, 'enUS', 'It may take time for these void elves to earn the trust of some in our ranks. But so long as they adhere to your teachings, they are welcome in the Alliance.', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (143176, 'enUS', 'You have done us a great service this day, Lady Windrunner, $p. You have my thanks.', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (143178, 'enUS', '', 'It is an honor to serve once more, High King. For the Alliance!', 26124);
INSERT INTO `broadcast_text_locale` VALUES (143179, 'enUS', 'For the Alliance!', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (143203, 'enUS', '', 'Some will tell you that the Light is the only path. The one weapon that can stop the enemies of Azeroth.', 26124);
INSERT INTO `broadcast_text_locale` VALUES (143204, 'enUS', '', 'But we see alternatives. Many roads--many possibilities--that are open to us.', 26124);
INSERT INTO `broadcast_text_locale` VALUES (143205, 'enUS', 'There will be those who doubt you. Who question your resolve, your ability to harness powers that have caused the downfall of weaker wills.', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (143206, 'enUS', '', 'Use the lessons I have taught you to maintain control. Become a weapon for the Alliance... even as you skirt the edge of darkness.', 26124);
INSERT INTO `broadcast_text_locale` VALUES (143228, 'enUS', '', 'Throughout your journeys across Azeroth, you have achieved mastery over the forces that constantly seek to control you.', 26124);
INSERT INTO `broadcast_text_locale` VALUES (143234, 'enUS', '', 'You have become a formidable weapon of the Alliance, $p. Return to the void rift so that we may honor your accomplishment.', 26124);
INSERT INTO `broadcast_text_locale` VALUES (143236, 'enUS', '', 'Many doubted that the ren\'dorei could harness the power of the void without falling prey to its influence. You have proven them wrong.', 26124);
INSERT INTO `broadcast_text_locale` VALUES (143241, 'enUS', '', 'Let this armor remind you of all you have achieved, $p. Accept it with my thanks.', 26124);
INSERT INTO `broadcast_text_locale` VALUES (143270, 'enUS', '', 'You are among the first shal\'dorei to venture forth and explore the wilds of Azeroth. But now it is time to come home.', 26124);
INSERT INTO `broadcast_text_locale` VALUES (143271, 'enUS', '', 'Return to Suramar so that we may thank you for helping our people reclaim a place in this world.', 26124);
INSERT INTO `broadcast_text_locale` VALUES (143273, 'enUS', '', 'You have shown the Horde--and all the people of Azeroth--that the nightborne possess the will and the courage to defend our world.', 26124);
INSERT INTO `broadcast_text_locale` VALUES (143275, 'enUS', '', 'I present you with the traditional garb of Suramar. Wear it as a reminder of our ancient past... and the new future we will forge alongside our allies.', 26124);
INSERT INTO `broadcast_text_locale` VALUES (143276, 'enUS', '', 'When our city faced its darkest hour, the heroes of Azeroth fought with us to drive out the Legion. Some did so reluctantly.', 26124);
INSERT INTO `broadcast_text_locale` VALUES (143277, 'enUS', '', 'But the sin\'dorei--the blood elves--showed us respect and understanding. Their kinship proved there were others in Azeroth who share our values.', 26124);
INSERT INTO `broadcast_text_locale` VALUES (143284, 'enUS', '', 'Stars guide you, $p. I have heard intriguing talk of the Hillsbrad Foothills. I will likely journey there.', 26124);
INSERT INTO `broadcast_text_locale` VALUES (143287, 'enUS', 'We share much with the Highmountain tauren. It is my belief that they would make ideal allies in the time to come.', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (143288, 'enUS', '', 'Now it is our turn to demonstrate the strength and honor we bring to the Horde.', 26124);
INSERT INTO `broadcast_text_locale` VALUES (143289, 'enUS', 'What do we know about the Highmountain tauren?', 'What do we know about the Highmountain tauren?', 26124);
INSERT INTO `broadcast_text_locale` VALUES (143290, 'enUS', '', '$n, I am glad you are here. We must convince the warchief to pursue an allegiance with the nightborne.', 26124);
INSERT INTO `broadcast_text_locale` VALUES (143291, 'enUS', 'What do we know about the nightborne?', 'What do we know about the nightborne?', 26124);
INSERT INTO `broadcast_text_locale` VALUES (143292, 'enUS', '', 'As you travel the roads of Azeroth, tell those you meet of the nightborne\'s proud history... and show them that we live in seclusion no longer.', 26124);
INSERT INTO `broadcast_text_locale` VALUES (143293, 'enUS', '', 'Go to Orgrimmar. Join with our allies and forge a new future together.', 26124);
INSERT INTO `broadcast_text_locale` VALUES (143327, 'enUS', 'Light be with you, $n. I plan to  seek the Legion upon Azeroth to continue our eternal battle.', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (143328, 'enUS', '', 'I have only heard stories of Stormwind before now. I will explore its streets and the wonders it holds. May the shadows guide you, $n.', 26124);
INSERT INTO `broadcast_text_locale` VALUES (143468, 'enUS', '', 'Greetings, Lady Liadrin, $p. Welcome back to Suramar. I am pleased to receive you under more pleasant circumstances.', 26124);
INSERT INTO `broadcast_text_locale` VALUES (143469, 'enUS', '', 'It is good to see your city free, First Arcanist.', 26124);
INSERT INTO `broadcast_text_locale` VALUES (143470, 'enUS', '', 'For that, we owe you both a great debt. You proved instrumental to our cause.', 26124);
INSERT INTO `broadcast_text_locale` VALUES (143471, 'enUS', '', 'The Horde was proud to fight by your side against the Burning Legion, my lady.', 26124);
INSERT INTO `broadcast_text_locale` VALUES (143472, 'enUS', '', 'I must admit, when I first learned of the Horde, I was skeptical that we would share common ground.', 26124);
INSERT INTO `broadcast_text_locale` VALUES (143473, 'enUS', '', 'I thought our kin from Kalimdor would make obvious allies. But their arrogance and mistrust soon proved otherwise.', 26124);
INSERT INTO `broadcast_text_locale` VALUES (143474, 'enUS', '', 'Arcanist Thalyssra. I remember where your order stood in the War of the Ancients. How do we know you won\'t betray us and become the next Elisande... the next Azshara?', 26124);
INSERT INTO `broadcast_text_locale` VALUES (143475, 'enUS', '', 'We do not intend to be slaves to the Nightwell. We seek to drive the Legion from Suramar and put an end to Elisande\'s oppression.', 26124);
INSERT INTO `broadcast_text_locale` VALUES (143476, 'enUS', '', 'The kaldorei will fight to see the Legion defeated and the Nightwell destroyed. Beyond that... we shall see where Elune\'s wisdom guides us.', 26124);
INSERT INTO `broadcast_text_locale` VALUES (143477, 'enUS', '', 'It would seem \"Elune\'s wisdom\" guided her away from the bond we once shared. So be it.', 26124);
INSERT INTO `broadcast_text_locale` VALUES (143478, 'enUS', '', 'The sin\'dorei are also scorned by Tyrande and her prideful lot. Yet for many ages her people slept in dens or hid in trees while my people fought to save this world.', 26124);
INSERT INTO `broadcast_text_locale` VALUES (143479, 'enUS', '', 'The Alliance feels too walled off... too cloistered. My people will never endure such stagnation again.', 26124);
INSERT INTO `broadcast_text_locale` VALUES (143480, 'enUS', '', 'That is why I am grateful for your invitation to Silvermoon. I would like to inquire whether there could be a place for the nightborne in your Horde.', 26124);
INSERT INTO `broadcast_text_locale` VALUES (143481, 'enUS', '', 'I am sure the regent lord will be pleased to learn of your interest. Are you ready to depart?', 26124);
INSERT INTO `broadcast_text_locale` VALUES (143482, 'enUS', '', 'It would be an honor, Lady Liadrin. Oculeth has the coordinates to your capital. I will gather Silgryn and Valtrois, and meet you in Silvermoon.', 26124);
INSERT INTO `broadcast_text_locale` VALUES (143483, 'enUS', 'Champions, azerite deposits have been located on an island off the coast of Feralas. We must secure them before the Horde does.', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (143484, 'enUS', 'We\'ve brought our ship around to the center of the island. Collect as much azerite as you can. It is the key to victory!', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (143485, 'enUS', 'Horde vessel incoming! No doubt that scum followed us here. Battle stations!', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (143486, 'enUS', 'There\'s a rich azerite deposit below us, heroes. Get down there and collect all you can. And if those Horde marauders gets in your way... put them down!', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (143487, 'enUS', 'We have spotted more azerite eruptions around the island! The locations are marked on your map.', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (143488, 'enUS', 'Heroes! We\'re dropping supplies down to you. Don\'t let the Horde get their hands on them!', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (143489, 'enUS', 'You\'re doing well so far, heroes. But we need more azerite!', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (143490, 'enUS', 'You kept that azerite out of the Horde\'s hands. Well done!', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (143491, 'enUS', 'You\'re doing good work. Just a bit more azerite and the day is ours!', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (143492, 'enUS', 'More azerite eruptions! Locate them on your map and secure those sites!', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (143493, 'enUS', 'Supplies incoming! Grab them, champions!', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (143494, 'enUS', 'Nicely done, champions! King Wrynn will be pleased to learn of your victory. For the Alliance!', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (143495, 'enUS', 'Damn! The Horde got the upper hand this time. But I swear upon Lion\'s Rest that we will yet claim victory!', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (143496, 'enUS', 'You all look like a sturdy lot. Hmm... could use another rogue or two, I\'d say... but you\'ll do!', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (143497, 'enUS', 'Fire! Take out those healers!', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (143498, 'enUS', 'These Horde think they\'re clever. Teach them a lesson!', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (143499, 'enUS', 'Fight for the king! Fight for the Alliance!', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (143500, 'enUS', 'Drive them out! This island is ours!', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (143501, 'enUS', 'Champions of the Horde! We have found Azerite deposits on some wretched island off the Feralas coast. It is your duty to secure it in the name of the Dark Lady!', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (143502, 'enUS', 'Your mission here is simple. Collect every bit of azerite and leave nothing for the Alliance to find. I trust that isn\'t too hard to grasp.', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (143503, 'enUS', 'Alliance vessel incoming! Those curs are lapping at our heels. Well, get to battle stations!', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (143504, 'enUS', 'Let me have a look at you. Ugh... pathetic! Why aren\'t there any dark rangers in your ranks? Well, you\'ll have to do.', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (143505, 'enUS', 'Down there... azerite! Take it for our warchief. And should those Alliance get in your way, litter the beach with their corpses. Move!', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (143506, 'enUS', 'Supplies are on the way. I better not see the Alliance getting them before you do!', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (143507, 'enUS', 'Grab these supplies, if you need them. But don\'t lose sight of the Banshee Queen\'s prize!', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (143508, 'enUS', 'An acceptable first effort, but we need more azerite!', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (143509, 'enUS', 'Ha! Snatched it out of the Alliance\'s hands! Well struck!', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (143510, 'enUS', 'Almost there. Do not relent. More azerite!', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (143511, 'enUS', 'There are more azerite eruptions around this blasted island! Check your map to find them.', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (143512, 'enUS', 'Zounds! There\'s even more azerite to be had. Follow your map and lock down those sites!', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (143513, 'enUS', 'Fire! Don\'t leave one of those bastards breathing!', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (143514, 'enUS', 'The Alliance calls those soldiers? Miserable! That one can barely swing a sword!', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (143515, 'enUS', 'Take them down! You do NOT want to disappoint your warchief!', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (143516, 'enUS', 'Is that... worgen I smell? It\'s hard to be sure over the overwhelming stench of Alliance self-righteousness.', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (143517, 'enUS', 'That was far from what I\'d call an elegant victory, but at least you put those Alliance dogs in their place. For the Horde!', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (143518, 'enUS', 'You... lost? To them? Pathetic! Report to the Undercity for remedial training. Apparently I have to start at square one with you...', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (143583, 'enUS', 'Welcome, friend $p. I am King Anduin Wrynn. As a new member of the Alliance, I wished to greet you personally.', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (143584, 'enUS', 'The Lightforged may be a recent addition to our ranks, but I know the draenei well. I am confident you will embody the dedication and courage of the Army of the Light.', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (143585, 'enUS', 'These are troubled times for Azeroth. In the days to come, you will face many trials... fight many foes. Know that you are never alone against the darkness, for the Alliance stands with you.', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (143586, 'enUS', 'I look forward to hearing of your progress. Something tells me we will speak again soon.', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (143587, 'enUS', 'Safe travels, $p. Though you walk among the shadows, you are a beacon of hope to us all.', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (143589, 'enUS', 'The void elves may be a recent addition to our ranks, but Alleria Windrunner is one of our greatest heroes. Under her tutelage, the powers you wield will aid our cause.', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (143590, 'enUS', 'Safe travels, $p. May the Light be with you always.', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (143591, 'enUS', '', 'Ah, the young hero $p comes before me. I am told you show great promise. Let us hope these reports prove true.', 26124);
INSERT INTO `broadcast_text_locale` VALUES (143592, 'enUS', '', 'The Highmountain tauren possess strength and courage. We will have need of such qualities in the days to come.', 26124);
INSERT INTO `broadcast_text_locale` VALUES (143593, 'enUS', '', 'The Horde has many rivals in this world. Some call us enemies... others call us outcasts. But we find strength in unity... and in defiance of those who would challenge our freedom.', 26124);
INSERT INTO `broadcast_text_locale` VALUES (143594, 'enUS', '', 'Rest assured, I will be taking note of your progress. As warchief, I expect much of you... and I reward those who serve me well.', 26124);
INSERT INTO `broadcast_text_locale` VALUES (143595, 'enUS', '', 'Enough of these pleasantries. You have much to prove, hero. Wherever your path takes you, know that you fight... for the Horde!', 26124);
INSERT INTO `broadcast_text_locale` VALUES (143596, 'enUS', '', 'The nightborne are a wise and powerful people. The ancient knowledge you possess will prove a great boon to our cause.', 26124);
INSERT INTO `broadcast_text_locale` VALUES (143598, 'enUS', '$p, High King Wrynn requests that you rendezvous with me at Stormwind.', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (143599, 'enUS', 'We\'ve uncovered certain... sensitive information that he insists you be made aware of.', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (143600, 'enUS', 'Find me at Lion\'s Rest. And needless to say, keep the details of this meeting between us.', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (143601, 'enUS', '$p! The Dark Lady instructs you to meet me in Orgrimmar.', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (143602, 'enUS', 'Information has come to light crucial to the interests of the Horde. It is imperative we remain a step ahead of our rivals.', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (143603, 'enUS', 'Meet me outside Grommash Hold. Keep this quiet... or the consequences will be swift and severe.', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (143604, 'enUS', 'You have seen the devastation in Silithus with your own eyes, $p. You know what is at stake.', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (143605, 'enUS', 'The Horde will stop at nothing to claim the lifeblood of Azeroth. I fear that after the war against the Legion, our ranks are too depleted to stave off their aggression.', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (143606, 'enUS', 'It is time for the Alliance to bring in new members to join our cause. We have established an embassy in Stormwind to spearhead these efforts. Meet me there.', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (143607, 'enUS', '', 'You have observed our operations in Silithus, $p. Clearly the Alliance is doing everything in its power to undermine our efforts.', 26124);
INSERT INTO `broadcast_text_locale` VALUES (143608, 'enUS', '', 'The Horde\'s selfless leadership in the war against the Legion has left our ranks depleted. Our enemies slaver at the thought of stealing what is ours. We will not let them.', 26124);
INSERT INTO `broadcast_text_locale` VALUES (143609, 'enUS', '', 'I\'ve authorized the building of an embassy in Orgrimmar. From it, we will win others to our cause. Meet me there at once.', 26124);
INSERT INTO `broadcast_text_locale` VALUES (143610, 'enUS', 'My arrogance was nearly our undoing. I dabbled with powers far beyond my control. If you will train us, Alleria, we will follow where you lead.', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (143611, 'enUS', '', 'I sense the powers at your command. They are... considerable. You would make valuable allies of the Alliance.', 26124);
INSERT INTO `broadcast_text_locale` VALUES (143612, 'enUS', 'Silvermoon turned its back on us long ago. Today we are reborn... and it is fitting that we walk a new path. From this day forth, the Alliance has our loyalty.', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (143613, 'enUS', '', 'And in turn, I pledge to aid you on your journey. $p and I will inform High King Wrynn of this news. Then I will return, so that we can begin your training.', 26124);
INSERT INTO `broadcast_text_locale` VALUES (143614, 'enUS', 'It will take some time for us to adjust to our new forms. We look forward to your return, Lady Windrunner. And $p... you have our deepest thanks.', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (143615, 'enUS', 'Together, we will prove them wrong.', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (143616, 'enUS', '', 'These woods once brought such joy to me and my sisters. To see them like this... fills my heart with sorrow.', 26124);
INSERT INTO `broadcast_text_locale` VALUES (143617, 'enUS', '', '<Landing from jump: Total 3>', 26124);
INSERT INTO `broadcast_text_locale` VALUES (143620, 'enUS', '<Landing from jump: Total 3>', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (143621, 'enUS', '<Distressed cry: Total 3>', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (143622, 'enUS', '', '<Landing from jump: Total 3>', 26124);
INSERT INTO `broadcast_text_locale` VALUES (143623, 'enUS', '<Landing from jump: Total 3>', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (143624, 'enUS', 'Our void experiments are proceeding well. I am certain we are on the cusp of a breakthrough... despite Rommath\'s smallminded protests.', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (143625, 'enUS', 'The grand magister must understand that this power is crucial to the defense of Silvermoon. Never again shall the sin\'dorei fall prey to our enemies!', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (143626, 'enUS', 'Unfortunately, it seems our research has reached an impasse. I believe there is knowledge at the Andilien Estate that will springboard us forward.', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (143627, 'enUS', '', '<Landing from jump: Total 3>', 26124);
INSERT INTO `broadcast_text_locale` VALUES (143628, 'enUS', '', 'It seems we have found some notes.', 26124);
INSERT INTO `broadcast_text_locale` VALUES (143629, 'enUS', '<Landing from jump: Total 3>', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (143630, 'enUS', 'It seems we are not the first of our people seeking to harness the void. I have found notebooks belonging to one whose very name is a curse... Dar\'Khan Drathir.', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (143631, 'enUS', 'It was Drathir\'s betrayal that allowed Arthas to corrupt the Sunwell... and left our kingdom in ruins. For the first time, I see why Rommath opposes our course of study.', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (143632, 'enUS', 'Nevertheless, I believe this knowledge can be used for good. The bulk of Drathir\'s research was conducted at Dawnstar Spire. That is where we must go.', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (143633, 'enUS', '', 'Come. We must make our way to Dawnstar Spire.', 26124);
INSERT INTO `broadcast_text_locale` VALUES (143634, 'enUS', '<Landing from jump: Total 3>', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (143635, 'enUS', 'Drathir\'s quest for power led him to seek the fragments of an ancient world, one teetering on the brink of the Void itself.', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (143636, 'enUS', 'His notes said it existed within a rift in the very fabric of reality. He never found this place... but I have succeeded where he failed. The way will soon be open to us!', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (143637, 'enUS', 'Drathir believed this rift held an ancient object of unspeakable might. Perhaps this will be the key that allows us to gain control over the shadows.', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (143638, 'enUS', '', '<Landing from jump: Total 3>', 26124);
INSERT INTO `broadcast_text_locale` VALUES (143639, 'enUS', '', 'Based on these notes, I believe I can reopen the passage to this world he spoke of. Let me see...', 26124);
INSERT INTO `broadcast_text_locale` VALUES (143640, 'enUS', '', 'There, up ahead. That must be Umbric.', 26124);
INSERT INTO `broadcast_text_locale` VALUES (143641, 'enUS', '', 'Magister Umbric! I am Alleria Windrunner.', 26124);
INSERT INTO `broadcast_text_locale` VALUES (143642, 'enUS', 'Alleria Windrunner!? How did... My, what an unexpected honor!', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (143643, 'enUS', 'My people and I heard tales of what transpired on Argus. As you might imagine, we have a keen interest in your interaction with the darkened naaru.', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (143644, 'enUS', '', 'Another time, perhaps. This champion and I have been searching for you. We know of your exile from Silvermoon and felt we shared common ground.', 26124);
INSERT INTO `broadcast_text_locale` VALUES (143645, 'enUS', 'Indeed! Like you, we believe the void can be used to defend life rather than consume it. We have made great progress, Lady Windrunner, but many mysteries remain.', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (143646, 'enUS', 'Take this cube, for instance. It is an ancient device, perhaps even predating life on Azeroth. It seems to have been locked, and we cannot yet open it.', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (143647, 'enUS', '', 'Careful, Umbric. Answers to such mysteries often come at a price.', 26124);
INSERT INTO `broadcast_text_locale` VALUES (143662, 'enUS', 'I greet you on behalf of Silvermoon.', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (143663, 'enUS', 'Bal\'a dash, malanore.', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (143664, 'enUS', 'I proudly serve as regent lord.', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (143665, 'enUS', 'We have made many sacrifices.', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (143666, 'enUS', 'The rebuilding continues.', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (143667, 'enUS', 'The eternal sun still guides us.', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (143668, 'enUS', 'The beauty of Eversong endures.', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (143669, 'enUS', 'Silvermoon will know prosperity again.', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (143670, 'enUS', 'The Light of the Sunwell be with you.', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (143671, 'enUS', 'What I do, I do for Quel\'Thalas.', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (143672, 'enUS', 'We find strength in the Horde.', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (143673, 'enUS', 'Al diel shala.', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (143674, 'enUS', 'We are a nation on the rise.', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (143675, 'enUS', 'Never again shall a king reign in Silvermoon.', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (143676, 'enUS', 'Hair like this does not just happen on its own. It requires constant attention.', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (143677, 'enUS', 'Queen\'s champion or no, I can out-shoot Nathanos any day of the week.', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (143678, 'enUS', 'Working for Sylvanas has its... challenges. Being dead has made her even bossier. But, uh... do not tell her I said that.', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (143679, 'enUS', 'My eye patch has never switched sides! I mean... who would mix up something like that?', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (143680, 'enUS', 'Greetings, traveler.', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (143681, 'enUS', 'Bal\'a dash, malanore.', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (143682, 'enUS', 'The shadows serve us.', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (143683, 'enUS', 'We embrace power. We do not fear it.', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (143684, 'enUS', 'All paths are possible.', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (143685, 'enUS', 'Come with an open mind.', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (143686, 'enUS', 'I have much to teach you.', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (143687, 'enUS', 'The ren\'dorei shall prove our worth.', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (143688, 'enUS', 'The Light is not the only path.', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (143689, 'enUS', 'We serve the Alliance.', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (143690, 'enUS', 'Shadows watch over you.', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (143691, 'enUS', 'Be open to possibilities.', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (143692, 'enUS', 'Do not bend to the whispers.', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (143693, 'enUS', 'Maintain focus and control.', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (143694, 'enUS', 'High elf? Please. Why would you want to be a high elf when you can look all tragic and brooding?', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (143695, 'enUS', 'I admit, purple was never my favorite color. But lately it\'s growing on me. Literally.', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (143696, 'enUS', 'I suppose I can forgive you for not being a fan of elves. After all, half of us dislike the other half rather intensely.', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (143697, 'enUS', 'Alleria and Turalyon? No chance. I mean... not that I am rooting against them or anything, but... Uh, do we have to keep talking about this?', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (143699, 'enUS', 'We established a makeshift base in Silithus. Check in with our operatives there--and keep your eyes open for Horde aggression.', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (143700, 'enUS', 'Gallywix has operations underway in Silithus. Get there at once. And if you see any Alliance skulking about, make quick work of them.', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (143712, 'enUS', '', 'At long last, the ceaseless posturing between the Horde and the Alliance is coming to an end.$b$bThe time for war is at hand.', 26124);
INSERT INTO `broadcast_text_locale` VALUES (143713, 'enUS', 'I am ready to pursue our next ally.', 'I am ready to pursue our next ally.', 26124);
INSERT INTO `broadcast_text_locale` VALUES (143726, 'enUS', '', 'State your business to your Warchief.', 26124);
INSERT INTO `broadcast_text_locale` VALUES (143727, 'enUS', '', 'I trust you will not waste my time.', 26124);
INSERT INTO `broadcast_text_locale` VALUES (143728, 'enUS', '', 'Come forward.', 26124);
INSERT INTO `broadcast_text_locale` VALUES (143729, 'enUS', '', 'Greetings, champion.', 26124);
INSERT INTO `broadcast_text_locale` VALUES (143730, 'enUS', '', 'Our true work is just beginning.', 26124);
INSERT INTO `broadcast_text_locale` VALUES (143731, 'enUS', '', 'There will be a new future for the Horde.', 26124);
INSERT INTO `broadcast_text_locale` VALUES (143732, 'enUS', '', 'Serve me well, and you will be rewarded.', 26124);
INSERT INTO `broadcast_text_locale` VALUES (143733, 'enUS', '', 'Go. I have much to do.', 26124);
INSERT INTO `broadcast_text_locale` VALUES (143735, 'enUS', '', 'Serve the Horde. Serve me.', 26124);
INSERT INTO `broadcast_text_locale` VALUES (143736, 'enUS', '', 'We will bring the Alliance to its knees.', 26124);
INSERT INTO `broadcast_text_locale` VALUES (143737, 'enUS', '', 'I will grow the ranks of the Forsaken. One way... or another.', 26124);
INSERT INTO `broadcast_text_locale` VALUES (143738, 'enUS', '', 'All will serve the Horde in time.', 26124);
INSERT INTO `broadcast_text_locale` VALUES (143739, 'enUS', '', 'We will claim what is ours.', 26124);
INSERT INTO `broadcast_text_locale` VALUES (143741, 'enUS', '', 'The lifeblood of Azeroth belongs to the Horde.', 26124);
INSERT INTO `broadcast_text_locale` VALUES (143742, 'enUS', '', 'No doubt I am your favorite Windrunner sister... right? Right?', 26124);
INSERT INTO `broadcast_text_locale` VALUES (143743, 'enUS', '', 'I have taken note of your progress. It seems I may have to send you to Nathanos for remedial training.', 26124);
INSERT INTO `broadcast_text_locale` VALUES (143744, 'enUS', '', 'Did you think I would not notice the way you leer at my dark rangers? I suggest you keep your eyes--and thoughts--to yourself.', 26124);
INSERT INTO `broadcast_text_locale` VALUES (143745, 'enUS', '', 'Plans? Little old me? What sort of plans could I possibly have?', 26124);
INSERT INTO `broadcast_text_locale` VALUES (143747, 'enUS', 'The Sunwell must be protected.', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (143748, 'enUS', 'What is it?', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (143749, 'enUS', 'Do not squander resources.', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (143750, 'enUS', 'I am rather busy.', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (143751, 'enUS', 'I serve Silvermoon.', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (143752, 'enUS', 'What would you ask of me?', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (143753, 'enUS', 'The eternal sun still guides us.', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (143754, 'enUS', 'Respect our customs.', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (143755, 'enUS', 'Do not let outsiders interfere.', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (143756, 'enUS', 'Be about your work.', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (143757, 'enUS', 'We build our future upon the backbone of tradition.', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (143758, 'enUS', 'We have overcome much.', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (143759, 'enUS', 'For Quel\'Thalas.', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (143760, 'enUS', 'It would be unwise to oppose us.', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (143761, 'enUS', 'If you would all just do what I say instead of attempting to think for yourselves, Azeroth would be much better off.', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (143762, 'enUS', 'Kirin Tor? More like Kirin Snore. Am I right?', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (143763, 'enUS', 'Khadgar? More like Badghar. Am I right?', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (143764, 'enUS', 'Jaina? More like Paina. Modera? More like... uh... look, you cannot expect me to hit gold every time, okay?', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (143767, 'enUS', 'T\'paartos!', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (143768, 'enUS', 'T\'paartos?', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (143769, 'enUS', 'T\'paartos greets puny one.', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (143770, 'enUS', 'Puny one needs something of T\'paartos?', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (143771, 'enUS', 'Danger? T\'paartos scoffs at danger!', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (143772, 'enUS', 'Light be with you, friend.', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (143773, 'enUS', 'T\'paartos is ready!', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (143775, 'enUS', 'T\'paartos.', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (143776, 'enUS', 'T\'paartos will see you soon.', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (143777, 'enUS', 'T\'paartos has much to do.', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (143778, 'enUS', 'T\'paartos must get back to work now.', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (143779, 'enUS', 'Come back to T\'paartos anytime.', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (143780, 'enUS', 'T\'paartos is proud to be Lightforged!', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (143781, 'enUS', 'T\'paartos is still slightly afraid of snakes.', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (143782, 'enUS', 'Puny one is not trying to take advantage of T\'paartos\' good nature... are you?', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (143783, 'enUS', 'Sure, T\'paartos has read books. Books with few words and many pictures... but they still count.', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (143784, 'enUS', 'List of things T\'paartos does not like: snakes, mean children, snakes, dark caves, snakes... and puny ones who pester T\'paartos.', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (143785, 'enUS', 'They appear to have all fallen for my act! I find it extraordinary that they believe I could be so simple-minded as to... Wait, you mean they can hear me? I, uh... T\'paartos!', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (143786, 'enUS', 'Two pairs of toes. Two pairs o\' toes. T\'pairs o\'toes. T\'pair o\'toes. T\'paar o\'toes. T\'paartoes. T\'paartos. T\'paartos!', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (143881, 'enUS', 'You. Over here.', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (143882, 'enUS', 'Over here!', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (143883, 'enUS', 'Look out!', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (143884, 'enUS', 'This way.', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (143885, 'enUS', 'This way.', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (143886, 'enUS', 'Look out!', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (143887, 'enUS', 'Over here!', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (143888, 'enUS', 'Champion. Over here.', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (144262, 'enUS', '', '<Alleria\'s eyes drift from the statue\'s cold stone visage down to the plaque engraved with her epitaph.>', 26124);
INSERT INTO `broadcast_text_locale` VALUES (144263, 'enUS', '<Stay awhile and listen.>', '<Stay awhile and listen.>', 26124);
INSERT INTO `broadcast_text_locale` VALUES (144264, 'enUS', '', 'Alleria sighs, her brow furrowed.', 26124);
INSERT INTO `broadcast_text_locale` VALUES (144269, 'enUS', 'Good. Good! Once more!', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (144301, 'enUS', 'Now, focus your chi. Push the energy away from you.', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (144305, 'enUS', 'I still cannot believe my brothers and sisters succumbed to the fel.', 'I still cannot believe my brothers and sisters succumbed to the fel.', 26124);
INSERT INTO `broadcast_text_locale` VALUES (144308, 'enUS', 'ZZZzzz...', 'ZZZzzz...', 26124);
INSERT INTO `broadcast_text_locale` VALUES (144309, 'enUS', '<The sleeping Tauren snores loudly and rolls over.>', '<The sleeping Tauren snores loudly and rolls over.>', 26124);
INSERT INTO `broadcast_text_locale` VALUES (144310, 'enUS', 'Thank you for dealing with Torok. He refused to see the dangers behind the power he sought.', 'Thank you for dealing with Torok. He refused to see the dangers behind the power he sought.', 26124);
INSERT INTO `broadcast_text_locale` VALUES (144321, 'enUS', 'Our corrupted brothers and sisters still wander in the wilds.', 'Our corrupted brothers and sisters still wander in the wilds.', 26124);
INSERT INTO `broadcast_text_locale` VALUES (144322, 'enUS', 'I\'m glad I did not have to give EVERYTHING.', 'I\'m glad I did not have to give EVERYTHING.', 26124);
INSERT INTO `broadcast_text_locale` VALUES (144323, 'enUS', 'When healing, you must gather your inner strength and pass it along to another.', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (144324, 'enUS', 'Focused chi is extremely potent. Master Tau Li will guide you once you are ready.', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (144325, 'enUS', 'Expending too much energy at once is dangerous. Pace yourselves, students.', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (144326, 'enUS', 'Excellent! Again, from the beginning.', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (144365, 'enUS', '', 'What\'s that? A light in the darkness! It\'s so bright...', 26124);
INSERT INTO `broadcast_text_locale` VALUES (144366, 'enUS', '', 'It\'s gotten a little brighter! I can see... sorta.', 26124);
INSERT INTO `broadcast_text_locale` VALUES (144367, 'enUS', '', 'Nuu-Nuu! I was scared I\'d never see you again! How did you get here?', 26124);
INSERT INTO `broadcast_text_locale` VALUES (144368, 'enUS', '', 'A crown! So pretty!', 26124);
INSERT INTO `broadcast_text_locale` VALUES (144369, 'enUS', '', 'I used to have a wand like that! Lost it a long time ago.', 26124);
INSERT INTO `broadcast_text_locale` VALUES (144370, 'enUS', '', 'It\'s dark again! Where did you go? Don\'t leave me!', 26124);
INSERT INTO `broadcast_text_locale` VALUES (144371, 'enUS', '', 'No! Let me go! Help, friend! HELP!', 26124);
INSERT INTO `broadcast_text_locale` VALUES (144383, 'enUS', 'These portals are incredibly tedious to sustain and, more importantly, they take attention away from valuable research!$B$BI am certain that telemancy will allow us to achieve a more stable solution.', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (144384, 'enUS', 'I hear Dalaran has an entire floor dedicated to magical transportation. $B$BImagine the possibilities!', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (144386, 'enUS', 'You can use the Orgrimmar portal to meet our Horde allies in their capital city on Kalimdor.', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (144394, 'enUS', 'Some of our vintners have given up tending their vines and have taken up other forms of botany.', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (144395, 'enUS', 'I brought samples to dispel the unfounded rumors that our wine tastes too footy... I mean too fruity!', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (144396, 'enUS', '', 'The nightborne are truly free. We no longer need the Nightwell, nor its power.$B$BWe can forge our own destiny.', 26124);
INSERT INTO `broadcast_text_locale` VALUES (144397, 'enUS', '', 'The business with Elisande is over, but there is still much to be done for the city.', 26124);
INSERT INTO `broadcast_text_locale` VALUES (144399, 'enUS', '', 'It\'s so dark! I can\'t see a thing!', 26124);
INSERT INTO `broadcast_text_locale` VALUES (144400, 'enUS', '', 'Who are you? Can you help me?', 26124);
INSERT INTO `broadcast_text_locale` VALUES (144401, 'enUS', '', 'Help! HELP!', 26124);
INSERT INTO `broadcast_text_locale` VALUES (144402, 'enUS', '', 'At least we\'re together now. We just... don\'t know where we are.', 26124);
INSERT INTO `broadcast_text_locale` VALUES (144403, 'enUS', '', 'But you\'re my friend, and I know it\'s gonna be okay.', 26124);
INSERT INTO `broadcast_text_locale` VALUES (144404, 'enUS', '', 'I wish I could see better. It\'s always so dark here!', 26124);
INSERT INTO `broadcast_text_locale` VALUES (144442, 'enUS', '', 'It\'s too bright! Too bright! Owww!', 26124);
INSERT INTO `broadcast_text_locale` VALUES (144444, 'enUS', '', 'Oh, hi! Who are you? I\'m Uuna. Wanna be friends? Maybe together we can get outta this place.', 26124);
INSERT INTO `broadcast_text_locale` VALUES (144445, 'enUS', '', 'I wish Nuu were here. He\'d know what to do.', 26124);
INSERT INTO `broadcast_text_locale` VALUES (144563, 'enUS', '', 'Directing chi energy at a target can be difficult at first.\n\nYou, at the front! Try to hit that training dummy over there.', 26124);
INSERT INTO `broadcast_text_locale` VALUES (144564, 'enUS', '', 'Very good! I\'m quite impressed!', 26124);
INSERT INTO `broadcast_text_locale` VALUES (144565, 'enUS', 'I will keep watch over him. He seems happy enough to wander around the gardens.', 'I will keep watch over him. He seems happy enough to wander around the gardens.', 26124);
INSERT INTO `broadcast_text_locale` VALUES (144566, 'enUS', 'There is persisting structural damage and unstable energy in the aqueducts. The gate will remain closed for the moment.', 'There is persisting structural damage and unstable energy in the aqueducts. The gate will remain closed for the moment.', 26124);
INSERT INTO `broadcast_text_locale` VALUES (144567, 'enUS', '', 'Nuu is here to help us, friend. I knew you\'d find us, Nuu!', 26124);
INSERT INTO `broadcast_text_locale` VALUES (144568, 'enUS', 'Argus the Unmaker is deploying Reorigination Modules!', 'Argus the Unmaker is deploying Reorigination Modules!', 26124);
INSERT INTO `broadcast_text_locale` VALUES (144575, 'enUS', '', 'I\'ll hold onto him so he doesn\'t get lost again.', 26124);
INSERT INTO `broadcast_text_locale` VALUES (144621, 'enUS', '', 'Greetings, $p! New lands and allies await us across Azeroth.$B$BOculeth has portals prepared downstairs when you are ready.', 26124);
INSERT INTO `broadcast_text_locale` VALUES (144672, 'enUS', 'I am glad to see that Arluelle continues her training. She appears stronger already.$B$BPerhaps I should measure her improvement.', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (144674, 'enUS', 'The Duskwatch will do well having Victoire in its ranks once more.', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (144676, 'enUS', 'It is a pity the Lightforged could not be convinced to join our side. Their martial prowess is formidable.', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (144677, 'enUS', '', 'I have a feeling our city will be called upon soon. I plan to be ready when the time comes.', 26124);
INSERT INTO `broadcast_text_locale` VALUES (144678, 'enUS', '', '<Arluelle has a faraway look in her eyes.>$B$BIf only my brother could see the city now...', 26124);
INSERT INTO `broadcast_text_locale` VALUES (144712, 'enUS', '', 'It shoots stars! Bad guys really hate that.', 26124);
INSERT INTO `broadcast_text_locale` VALUES (144713, 'enUS', '', 'You can\'t fight the dark without a crown, friend. It\'s the rules.', 26124);
INSERT INTO `broadcast_text_locale` VALUES (144714, 'enUS', 'T\'PAARTOS!', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (144715, 'enUS', '', 'I feel a lot better now.', 26124);
INSERT INTO `broadcast_text_locale` VALUES (144716, 'enUS', 'T\'paartos is here!', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (144721, 'enUS', 'The Darkness comes...', 'The Darkness comes...', 26124);
INSERT INTO `broadcast_text_locale` VALUES (144722, 'enUS', 'MAKE IT STOP!', 'MAKE IT STOP!', 26124);
INSERT INTO `broadcast_text_locale` VALUES (144723, 'enUS', 'Your death is necessary.', 'Your death is necessary.', 26124);
INSERT INTO `broadcast_text_locale` VALUES (144725, 'enUS', 'The shadows will consume you.', 'The shadows will consume you.', 26124);
INSERT INTO `broadcast_text_locale` VALUES (144726, 'enUS', 'Listen to the whispers. They are beautiful.', 'Listen to the whispers. They are beautiful.', 26124);
INSERT INTO `broadcast_text_locale` VALUES (144745, 'enUS', '', 'Again, T\'paartos? How many times have you...', 26124);
INSERT INTO `broadcast_text_locale` VALUES (144749, 'enUS', 'Not enough times to stop T\'paartos!', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (144750, 'enUS', 'T\'paartos offers gratitude to Lysara. T\'paartos feels ready to fight again!', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (144751, 'enUS', '', 'Even the finest weapon will dull with too much use. Take some time to fully heal, T\'paartos.', 26124);
INSERT INTO `broadcast_text_locale` VALUES (144752, 'enUS', 'Thank you, champion.', 'Thank you, champion.', 26124);
INSERT INTO `broadcast_text_locale` VALUES (144753, 'enUS', 'The whispers... they were driving me mad!', 'The whispers... they were driving me mad!', 26124);
INSERT INTO `broadcast_text_locale` VALUES (144754, 'enUS', 'I must... My mind... Must get away from this place!', 'I must... My mind... Must get away from this place!', 26124);
INSERT INTO `broadcast_text_locale` VALUES (144755, 'enUS', 'It was horrible, $r.', 'It was horrible, $r.', 26124);
INSERT INTO `broadcast_text_locale` VALUES (144756, 'enUS', 'Earthmother bless you!', 'Earthmother bless you!', 26124);
INSERT INTO `broadcast_text_locale` VALUES (144757, 'enUS', 'I believed my mind was forfeit.', 'I believed my mind was forfeit.', 26124);
INSERT INTO `broadcast_text_locale` VALUES (144758, 'enUS', 'The Lightforged Vindicator groans.', 'The Lightforged Vindicator groans.', 26124);
INSERT INTO `broadcast_text_locale` VALUES (144759, 'enUS', 'Light preserve me... he\'s back.', 'Light preserve me... he\'s back.', 26124);
INSERT INTO `broadcast_text_locale` VALUES (144760, 'enUS', 'Shh! Don\'t move! His vision is based on movement.', 'Shh! Don\'t move! His vision is based on movement.', 26124);
INSERT INTO `broadcast_text_locale` VALUES (144770, 'enUS', 'I am fresh out of materials for the moment. My apologies.', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (144772, 'enUS', 'It is good to rest once in a while.$B$BEspecially after a profitable venture!', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (144799, 'enUS', 'My agents have secured this area, but we should still keep our voices down lest our conversation is overheard...', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (144800, 'enUS', 'Tell me what happened at Lion\'s Rest.', 'Tell me what happened at Lion\'s Rest.', 26124);
INSERT INTO `broadcast_text_locale` VALUES (144804, 'enUS', 'He is in high spirits today, no?', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (144806, 'enUS', '', 'Oh yes, just like yesterday, the day before... and the day before that!', 26124);
INSERT INTO `broadcast_text_locale` VALUES (144807, 'enUS', '', 'An admirable quality, I quite like that about him.', 26124);
INSERT INTO `broadcast_text_locale` VALUES (144825, 'enUS', 'Our agents have already infiltrated the goblin mining operation below. We\'ll know what they\'re up to soon enough...', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (144826, 'enUS', '', 'Friend? Is that you?', 26124);
INSERT INTO `broadcast_text_locale` VALUES (144827, 'enUS', '', 'I won\'t give up, friend! I promise!', 26124);
INSERT INTO `broadcast_text_locale` VALUES (144828, 'enUS', '', 'I\'m just so cold, and it\'s very dark here. I don\'t know what to do!', 26124);
INSERT INTO `broadcast_text_locale` VALUES (144833, 'enUS', 'Haha! T\'paartos is glad to see you are well! T\'paartos also brought a present. This little one was in Val\'sharah.', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (144834, 'enUS', '', 'There you are! That\'s much better.', 26124);
INSERT INTO `broadcast_text_locale` VALUES (144835, 'enUS', '', 'They\'re gonna be here, soon, friend.', 26124);
INSERT INTO `broadcast_text_locale` VALUES (144836, 'enUS', '', 'I keep running and running... but they always find me.', 26124);
INSERT INTO `broadcast_text_locale` VALUES (144837, 'enUS', '', 'But now you\'re here. Together we can fight them! I think...', 26124);
INSERT INTO `broadcast_text_locale` VALUES (144838, 'enUS', '', 'Promise you won\'t leave me, friend. Even when it gets dark...', 26124);
INSERT INTO `broadcast_text_locale` VALUES (144839, 'enUS', '', 'T\'paartos!', 26124);
INSERT INTO `broadcast_text_locale` VALUES (144840, 'enUS', 'The Dark Lady has an important job for you, $c. I hope that you are ready...', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (144841, 'enUS', 'Tell me what happened at the feast.', 'Tell me what happened at the feast.', 26124);
INSERT INTO `broadcast_text_locale` VALUES (144842, 'enUS', '', 'Aww!', 26124);
INSERT INTO `broadcast_text_locale` VALUES (144845, 'enUS', 'T\'paartos must return this little one now. Say farewell, children.', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (144846, 'enUS', 'Do not worry! T\'paartos will return with more stories... and perhaps another friend.', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (144847, 'enUS', '', 'It\'s T\'paartos!', 26124);
INSERT INTO `broadcast_text_locale` VALUES (144848, 'enUS', '', 'He\'s back!', 26124);
INSERT INTO `broadcast_text_locale` VALUES (144849, 'enUS', '', 'No! Stay and tell us adventure stories, T\'paartos!', 26124);
INSERT INTO `broadcast_text_locale` VALUES (144850, 'enUS', '', 'Can I keep it?', 26124);
INSERT INTO `broadcast_text_locale` VALUES (144851, 'enUS', '', 'The tail is so fluffy!', 26124);
INSERT INTO `broadcast_text_locale` VALUES (144853, 'enUS', 'Our bravest warriors are often in the vanguard. It is the least I can do to watch over their families until they return.', 'Our bravest warriors are often in the vanguard. It is the least I can do to watch over their families until they return.', 26124);
INSERT INTO `broadcast_text_locale` VALUES (144862, 'enUS', '', 'T\'paartos showed us how to play boulder, parchment, blade... but I forgot the rules.', 26124);
INSERT INTO `broadcast_text_locale` VALUES (144863, 'enUS', 'I\'m looking for a little girl named Uuna, have you seen her?', 'I\'m looking for a little girl named Uuna, have you seen her?', 26124);
INSERT INTO `broadcast_text_locale` VALUES (144864, 'enUS', 'Light be with you.', 'Light be with you.', 26124);
INSERT INTO `broadcast_text_locale` VALUES (144866, 'enUS', '', 'I have heard the cries of the child you speak of.\n\nI shall mark you, that you may pass into this realm and seek her out.\n\nShe resides in a place where the barrier between the realms of life and death are thin, and spill over into your world.\n\nBe warned, you have no power in this place, its denizens cannot be harmed by mortals.\n\nTry as you might, you may not be able to aid your friend.', 26124);
INSERT INTO `broadcast_text_locale` VALUES (144873, 'enUS', '<A green dragon\'s tear, cast in shadow by unknown forces.>', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (144875, 'enUS', '<Touch the tear.>', '<Touch the tear.>', 26124);
INSERT INTO `broadcast_text_locale` VALUES (144895, 'enUS', '', 'They\'re here...', 26124);
INSERT INTO `broadcast_text_locale` VALUES (144896, 'enUS', '', 'You have missed your payment one too many times, Mr. Stonebrow. I am repossessing the goods, per our contract.', 26124);
INSERT INTO `broadcast_text_locale` VALUES (144897, 'enUS', 'I mailed ye the check this morning, I swear! Ye can\'t leave me high and dry!', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (144898, 'enUS', '', 'Mister Chu, please see this dwarf out. Ms. Xiulan, re-list the armor.', 26124);
INSERT INTO `broadcast_text_locale` VALUES (144899, 'enUS', '%s nods.', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (144900, 'enUS', '', 'Go away! We\'re not afraid of you!', 26124);
INSERT INTO `broadcast_text_locale` VALUES (144901, 'enUS', '', 'Yes, madam.', 26124);
INSERT INTO `broadcast_text_locale` VALUES (144902, 'enUS', 'Keep yer paws off me, fuzzball!', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (144903, 'enUS', '', 'It seems you are in luck today, Mr. Stonebrow. You may take back the goods.', 26124);
INSERT INTO `broadcast_text_locale` VALUES (144904, 'enUS', 'Yer damn right I will! I bought this armor fair and square, even if I ain\'t done payin\' for it.', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (144905, 'enUS', 'Ahh, that\'s better. Armor befitting a mighty hero! One whose legendary deeds shake the very foundations of Azeroth!', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (144906, 'enUS', 'Welp, I\'m off to the tavern.', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (144907, 'enUS', 'Thanks for yer help, $Glad:lass;! I owe ye one!', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (144908, 'enUS', 'The Vindicaar awaits its next voyage.\n\nAs do I.', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (144921, 'enUS', '', 'Light take this table! I may never be able to use this workshop again.$B$BThe taint of those beast hides from Argus lingers, no matter how many times I scrub the surface.', 26124);
INSERT INTO `broadcast_text_locale` VALUES (144923, 'enUS', 'If it is Maela you\'re looking for, she is assisting on the front lines.$B$BStormwind is home to various competent tailors that can teach you a thing or two.', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (144924, 'enUS', '', '<Fareeya greets you with a warm smile.>$B$BYou have done well in passing the trials, $c. But I feel your tale is just beginning.', 26124);
INSERT INTO `broadcast_text_locale` VALUES (144925, 'enUS', '', 'Always carry with you what it means to be pledged to the Light.', 26124);
INSERT INTO `broadcast_text_locale` VALUES (144926, 'enUS', '', 'Greetings, $c.', 26124);
INSERT INTO `broadcast_text_locale` VALUES (144994, 'enUS', '', 'Yes, of course I still love him. Must you be so nosey?', 26124);
INSERT INTO `broadcast_text_locale` VALUES (145018, 'enUS', '', 'Sisters are complicated. Especially the undead ones.', 26124);
INSERT INTO `broadcast_text_locale` VALUES (145022, 'enUS', '', 'My void will consume you... if you ask nicely.', 26124);
INSERT INTO `broadcast_text_locale` VALUES (145026, 'enUS', '', 'I go missing for all those years and this is how you treat me?', 26124);
INSERT INTO `broadcast_text_locale` VALUES (145027, 'enUS', '', 'It is a good day for a hunt.', 26124);
INSERT INTO `broadcast_text_locale` VALUES (145028, 'enUS', '', 'Use every weapon at your disposal.', 26124);
INSERT INTO `broadcast_text_locale` VALUES (145031, 'enUS', '', 'What news?', 26124);
INSERT INTO `broadcast_text_locale` VALUES (145036, 'enUS', '', 'We each walk a line. Choose yours.', 26124);
INSERT INTO `broadcast_text_locale` VALUES (145038, 'enUS', '', 'Greetings.', 26124);
INSERT INTO `broadcast_text_locale` VALUES (145039, 'enUS', '', 'The shadows can be an ally... if controlled.', 26124);
INSERT INTO `broadcast_text_locale` VALUES (145040, 'enUS', '', 'Farewell.', 26124);
INSERT INTO `broadcast_text_locale` VALUES (145041, 'enUS', '', 'Aim true.', 26124);
INSERT INTO `broadcast_text_locale` VALUES (145042, 'enUS', '', 'We do what we must for those we love.', 26124);
INSERT INTO `broadcast_text_locale` VALUES (145043, 'enUS', '', 'Keep your gaze fixed on your target.', 26124);
INSERT INTO `broadcast_text_locale` VALUES (145102, 'enUS', 'Curious.', 'Curious.', 26124);
INSERT INTO `broadcast_text_locale` VALUES (145140, 'enUS', '', 'Friend? Are you still there? I\'m scared!', 26124);
INSERT INTO `broadcast_text_locale` VALUES (145141, 'enUS', '', 'I--I can\'t do it! I just wanna go home!', 26124);
INSERT INTO `broadcast_text_locale` VALUES (145142, 'enUS', '', 'Uuna wraps her arms around herself and begins to cry.', 26124);
INSERT INTO `broadcast_text_locale` VALUES (145154, 'enUS', '', 'F-friend, you\'re here! You didn\'t leave me!', 26124);
INSERT INTO `broadcast_text_locale` VALUES (145155, 'enUS', '', 'Mama told me the Light would always find me. That\'s you, friend. You\'re my light!', 26124);
INSERT INTO `broadcast_text_locale` VALUES (145156, 'enUS', '', 'And as long as my light is with me, there\'s no way the darkness can win!', 26124);
INSERT INTO `broadcast_text_locale` VALUES (145158, 'enUS', '', 'My light is super strong!', 26124);
INSERT INTO `broadcast_text_locale` VALUES (145159, 'enUS', '', 'I\'M NOT GONNA BE AFRAID ANYMORE!', 26124);
INSERT INTO `broadcast_text_locale` VALUES (145171, 'enUS', 'I can hear the cries of the world beneath my feet. Azeroth trembles in pain! I must find a way to ease the suffering...', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (145172, 'enUS', 'I am ready. Let us begin the ritual.', 'I am ready. Let us begin the ritual.', 26124);
INSERT INTO `broadcast_text_locale` VALUES (145185, 'enUS', '', 'The darkness is gone! I can see!', 26124);
INSERT INTO `broadcast_text_locale` VALUES (145186, 'enUS', '', 'Oh, friend! We did it! We beat them!', 26124);
INSERT INTO `broadcast_text_locale` VALUES (145187, 'enUS', '', 'What... what\'s happening?', 26124);
INSERT INTO `broadcast_text_locale` VALUES (145188, 'enUS', '', 'The light... it\'s telling me to follow it...', 26124);
INSERT INTO `broadcast_text_locale` VALUES (145189, 'enUS', '', 'Mama! Papa! They\'re waiting for me!', 26124);
INSERT INTO `broadcast_text_locale` VALUES (145190, 'enUS', '', 'Wait a sec...', 26124);
INSERT INTO `broadcast_text_locale` VALUES (145191, 'enUS', '', 'There\'s so much I never got to do. So many places I never got to see...', 26124);
INSERT INTO `broadcast_text_locale` VALUES (145192, 'enUS', '', 'Is it okay if I stay with my friend? For just a little while longer?', 26124);
INSERT INTO `broadcast_text_locale` VALUES (145193, 'enUS', '', 'Friend! The Light says I can stay! Woo-hoo!', 26124);
INSERT INTO `broadcast_text_locale` VALUES (145194, 'enUS', '', 'Tell Mama and Papa I miss them, and... and I\'ll see them soon!', 26124);
INSERT INTO `broadcast_text_locale` VALUES (145195, 'enUS', '', 'Okay, friend, let\'s get outta here! We have so many places to go!', 26124);
INSERT INTO `broadcast_text_locale` VALUES (145197, 'enUS', '', 'Uuna hugs you.', 26124);
INSERT INTO `broadcast_text_locale` VALUES (145199, 'enUS', '', 'Wow! That\'s the biggest wall I\'ve ever seen!', 26124);
INSERT INTO `broadcast_text_locale` VALUES (145200, 'enUS', '', 'What do you suppose they wanted to keep out?', 26124);
INSERT INTO `broadcast_text_locale` VALUES (145201, 'enUS', '', 'Is it bugs? I bet it\'s bugs. Yuck! I hate bugs!', 26124);
INSERT INTO `broadcast_text_locale` VALUES (145202, 'enUS', '', 'Ewwwww!!', 26124);
INSERT INTO `broadcast_text_locale` VALUES (145203, 'enUS', '', 'Wow! That\'s gotta be the prettiest house ever!', 26124);
INSERT INTO `broadcast_text_locale` VALUES (145204, 'enUS', '', 'Do you know who lives here? I bet it\'s a princess.', 26124);
INSERT INTO `broadcast_text_locale` VALUES (145205, 'enUS', '', 'Do you wanna play princesses with me?', 26124);
INSERT INTO `broadcast_text_locale` VALUES (145206, 'enUS', '', 'Whoa... a flying city! Are you serious?!', 26124);
INSERT INTO `broadcast_text_locale` VALUES (145207, 'enUS', '', 'How does it do that?', 26124);
INSERT INTO `broadcast_text_locale` VALUES (145208, 'enUS', '', 'Do you live here?', 26124);
INSERT INTO `broadcast_text_locale` VALUES (145209, 'enUS', '', 'Come to think of it... do you live ANYwhere?', 26124);
INSERT INTO `broadcast_text_locale` VALUES (145210, 'enUS', '', 'Hey, what are those flying things? They\'re so pretty!', 26124);
INSERT INTO `broadcast_text_locale` VALUES (145211, 'enUS', '', 'That\'s a big tower. It\'s like a... giant birdhouse!', 26124);
INSERT INTO `broadcast_text_locale` VALUES (145212, 'enUS', '', 'But for lizard birds.', 26124);
INSERT INTO `broadcast_text_locale` VALUES (145213, 'enUS', '', 'Can I have one for a pet?', 26124);
INSERT INTO `broadcast_text_locale` VALUES (145218, 'enUS', '', 'Friend, look! We\'re under a giant tree!', 26124);
INSERT INTO `broadcast_text_locale` VALUES (145221, 'enUS', '', 'I wonder how many birds live in that tree. Must be so many!', 26124);
INSERT INTO `broadcast_text_locale` VALUES (145225, 'enUS', '', 'Like... TEN birds!', 26124);
INSERT INTO `broadcast_text_locale` VALUES (145237, 'enUS', '', 'Caw caw caw caw caw!', 26124);
INSERT INTO `broadcast_text_locale` VALUES (145240, 'enUS', '', 'I can see everything from here!', 26124);
INSERT INTO `broadcast_text_locale` VALUES (145241, 'enUS', '', 'I didn\'t know mountains could go this high!', 26124);
INSERT INTO `broadcast_text_locale` VALUES (145243, 'enUS', '', 'Don\'t fall off, friend! I\'ll be okay if I fall, but you\'d go SPLAT!', 26124);
INSERT INTO `broadcast_text_locale` VALUES (145245, 'enUS', '', 'So be careful, okay?', 26124);
INSERT INTO `broadcast_text_locale` VALUES (145246, 'enUS', '', 'Where are we? Why is it so smoky?', 26124);
INSERT INTO `broadcast_text_locale` VALUES (145247, 'enUS', '', 'Look down there. It\'s all glowing!', 26124);
INSERT INTO `broadcast_text_locale` VALUES (145253, 'enUS', '', 'But it\'s moving like water... it\'s a glowing lake?', 26124);
INSERT INTO `broadcast_text_locale` VALUES (145254, 'enUS', '', 'That\'s really silly, friend.', 26124);
INSERT INTO `broadcast_text_locale` VALUES (145255, 'enUS', '', 'It\'s... so beautiful...', 26124);
INSERT INTO `broadcast_text_locale` VALUES (145256, 'enUS', '', 'My people are here! They survived!', 26124);
INSERT INTO `broadcast_text_locale` VALUES (145257, 'enUS', '', 'They didn\'t all die on Argus?', 26124);
INSERT INTO `broadcast_text_locale` VALUES (145258, 'enUS', '', 'Thank you SO MUCH for showing me this, friend!', 26124);
INSERT INTO `broadcast_text_locale` VALUES (145263, 'enUS', '', 'You\'ve shown me so many neat things. You really are the best friend ever!', 26124);
INSERT INTO `broadcast_text_locale` VALUES (145265, 'enUS', '', 'I know someday I\'ll have to go back to Mama and Papa.', 26124);
INSERT INTO `broadcast_text_locale` VALUES (145266, 'enUS', '', 'But... not yet.', 26124);
INSERT INTO `broadcast_text_locale` VALUES (145275, 'enUS', '', 'Gaaahhh! No! Help!', 26124);
INSERT INTO `broadcast_text_locale` VALUES (145276, 'enUS', 'Uuna is swallowed by darkness.', 'Uuna is swallowed by darkness.', 26124);
INSERT INTO `broadcast_text_locale` VALUES (145721, 'enUS', '', 'The evolutionary biology of the silithid species is extraordinarily fascinating!', 26124);
INSERT INTO `broadcast_text_locale` VALUES (145890, 'enUS', 'We\'re a bit busy right now, as you can see.', 'We\'re a bit busy right now, as you can see.', 26124);
INSERT INTO `broadcast_text_locale` VALUES (145891, 'enUS', 'Open fire!', 'Open fire!', 26124);
INSERT INTO `broadcast_text_locale` VALUES (145892, 'enUS', '<The elf\'s concentration wavers momentarily and he gives you a withering look.>', '<The elf\'s concentration wavers momentarily and she gives you a withering look.>', 26124);
INSERT INTO `broadcast_text_locale` VALUES (145893, 'enUS', 'With Alleria\'s teaching, we can avoid the fate suffered by those on Mac\'Aree.', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (145895, 'enUS', '', 'The voices never stop. They push, they bully, they plead. They will not relent, not even for a moment.\n\nBut you are stronger than the voices. You can glean their secrets and draw upon their strength.', 26124);
INSERT INTO `broadcast_text_locale` VALUES (145896, 'enUS', 'Fascinating.\n\nI sensed that change was destined to find Alleria Windrunner, but I did not anticipate that her kin would undergo a similar transformation.\n\nThe implications are many. These events have given me much to ponder.', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (145897, 'enUS', 'We need no longer fear exile for the pursuit of knowledge.', 'We need no longer fear exile for the pursuit of knowledge.', 26124);
INSERT INTO `broadcast_text_locale` VALUES (145898, 'enUS', 'A path long denied to us is open at last.', 'A path long denied to us is open at last.', 26124);
INSERT INTO `broadcast_text_locale` VALUES (145977, 'enUS', 'Find us a wee bit o\' cloth and I\'ll be good to go!', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (146006, 'enUS', 'Be wary of unstable void rifts and their spawn. This place is not entirely safe.', 'Be wary of unstable void rifts and their spawn. This place is not entirely safe.', 26124);
INSERT INTO `broadcast_text_locale` VALUES (146007, 'enUS', 'Oh, you made it.', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (146008, 'enUS', 'Wonderful.', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (146009, 'enUS', 'Why have you returned?', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (146010, 'enUS', 'Congratulations.', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (146011, 'enUS', 'It is designed to kill you.', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (146012, 'enUS', 'I imagine it is quite painful.', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (146013, 'enUS', 'I am told power comes from unlikely places.', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (146014, 'enUS', 'For now.', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (146015, 'enUS', 'Perhaps.', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (146016, 'enUS', 'Fine.', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (146017, 'enUS', 'I am afraid I cannot allow that.', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (146018, 'enUS', 'When mixed with natural gas, liquid Azerite can harden quickly making it easy for us to obtain. Keep your eyes peeled down below for unstable activity on the surface. With these tremors happening recently... its bound to spout out of cracks or fissures you find.', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (146019, 'enUS', 'We\'ve observed strong geothermal energy readings around this uncharted island. \n\nAzerite, for sure!', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (146020, 'enUS', 'What can you tell me about the Lightforged draenei?', 'What can you tell me about the Lightforged draenei?', 26124);
INSERT INTO `broadcast_text_locale` VALUES (146021, 'enUS', 'What do we know about the void elves?', 'What do we know about the void elves?', 26124);
INSERT INTO `broadcast_text_locale` VALUES (146022, 'enUS', 'War is coming to Azeroth, $n. It is time for us to bring in new allies to join our cause.', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (146023, 'enUS', 'Ahh... this silk feels better than rain on a summer morning...', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (146024, 'enUS', 'I am ready to pursue our next ally.', 'I am ready to pursue our next ally.', 26124);
INSERT INTO `broadcast_text_locale` VALUES (146025, 'enUS', 'Now, I\'ll just light a wee match to take care of the fumes...', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (146026, 'enUS', 'FIRE!!', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (146027, 'enUS', 'AAAAHHHHHHHHHHHH!!', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (146029, 'enUS', 'That was a close one! I\'d better take inventory. Eyebrows... check. Beard... check. Pants...', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (146030, 'enUS', 'No time for pants, then! I need to see if there\'s a burn clinic nearby...', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (146031, 'enUS', 'Oohhh...', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (146032, 'enUS', 'Ouch!', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (146033, 'enUS', 'Eeek...', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (146044, 'enUS', '', 'Salutations! How can I help you?', 26124);
INSERT INTO `broadcast_text_locale` VALUES (146045, 'enUS', 'I\'d like to check my mail.', 'I\'d like to check my mail.', 26124);
INSERT INTO `broadcast_text_locale` VALUES (146049, 'enUS', 'Incoming!', 'Incoming!', 26124);
INSERT INTO `broadcast_text_locale` VALUES (146050, 'enUS', 'Void outbreak! Take them down!', 'Void outbreak! Take them down!', 26124);
INSERT INTO `broadcast_text_locale` VALUES (146064, 'enUS', '', 'Looks like the Postmaster needs me right away. Toodles!', 26124);
INSERT INTO `broadcast_text_locale` VALUES (146067, 'enUS', '', 'The mail must go through! \'Til next time!', 26124);
INSERT INTO `broadcast_text_locale` VALUES (146068, 'enUS', '', 'Oh my, I\'m late! Those letters won\'t sort themselves!', 26124);
INSERT INTO `broadcast_text_locale` VALUES (146069, 'enUS', '', 'I\'m afraid my time is up. See you later!', 26124);
INSERT INTO `broadcast_text_locale` VALUES (146070, 'enUS', '', 'You rang?', 26124);
INSERT INTO `broadcast_text_locale` VALUES (146071, 'enUS', '', 'Katy Stampwhistle, reporting for duty!', 26124);
INSERT INTO `broadcast_text_locale` VALUES (146072, 'enUS', '', 'When there\'s mail to declare, you bet I\'ll be there!', 26124);
INSERT INTO `broadcast_text_locale` VALUES (146073, 'enUS', '', 'The mail must flow!', 26124);
INSERT INTO `broadcast_text_locale` VALUES (146080, 'enUS', 'Thanks again, $n. I\'ll be seein\' ye! I\'m off to find some pants...', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (146083, 'enUS', 'Och! I forgot mah pants!', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (146090, 'enUS', 'Pristine void energy is soaked into this space... Magnificent.', 'Pristine void energy is soaked into this space... Magnificent.', 26124);
INSERT INTO `broadcast_text_locale` VALUES (146098, 'enUS', 'The Voidstorm is growing. It might even consume the big island entirely.', 'The Voidstorm is growing. It might even consume the big island entirely.', 26124);
INSERT INTO `broadcast_text_locale` VALUES (146099, 'enUS', 'Unchecked void energies ravage the other islands. It remains too dangerous to navigate.', 'Unchecked void energies ravage the other islands. It remains too dangerous to navigate.', 26124);
INSERT INTO `broadcast_text_locale` VALUES (146105, 'enUS', '', 'Voila!', 26124);
INSERT INTO `broadcast_text_locale` VALUES (146117, 'enUS', 'My, my, what do we have here?', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (146118, 'enUS', 'How did you know we were here, I wonder?', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (146119, 'enUS', 'You mortals are all the same. Fighting, but not knowing what for.', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (146120, 'enUS', 'Pity. You would have made an excellent servant.', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (146122, 'enUS', 'Meddling where we shouldn\'t, I see. Understandable.', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (146148, 'enUS', 'Maintain your focus.', 'Maintain your focus.', 26124);
INSERT INTO `broadcast_text_locale` VALUES (146149, 'enUS', 'Yeah? Whaddya want?', 'Yeah? Whaddya want?', 26124);
INSERT INTO `broadcast_text_locale` VALUES (146150, 'enUS', 'Hey! Mind yah business!', 'Hey! Mind yah business!', 26124);
INSERT INTO `broadcast_text_locale` VALUES (146151, 'enUS', 'I ain\'t got time for this. Spit it out already!', 'I ain\'t got time for this. Spit it out already!', 26124);
INSERT INTO `broadcast_text_locale` VALUES (146152, 'enUS', 'Time is money!', 'Time is money!', 26124);
INSERT INTO `broadcast_text_locale` VALUES (146153, 'enUS', 'Hand over all of the azerite you\'ve pocketed!', 'Hand over all of the azerite you\'ve pocketed!', 26124);
INSERT INTO `broadcast_text_locale` VALUES (146154, 'enUS', '', 'One portal, coming up!', 26124);
INSERT INTO `broadcast_text_locale` VALUES (146159, 'enUS', 'You have learned basic control. Mastery, however, can only be attained through practical application.', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (146165, 'enUS', 'Thankfully, this place is well suited for--', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (146178, 'enUS', 'I ain\'t gonna let you take my azerite!', 'I ain\'t gonna let you take my azerite!', 26124);
INSERT INTO `broadcast_text_locale` VALUES (146179, 'enUS', 'I stole it fair and square! It\'s mine!', 'I stole it fair and square! It\'s mine!', 26124);
INSERT INTO `broadcast_text_locale` VALUES (146180, 'enUS', 'Oohh... Now you\'re gonna pay!', 'Oohh... Now you\'re gonna pay!', 26124);
INSERT INTO `broadcast_text_locale` VALUES (146181, 'enUS', 'You\'re messin wit\' the wrong goblin, bub!', 'You\'re messin wit\' the wrong goblin, bub!', 26124);
INSERT INTO `broadcast_text_locale` VALUES (146182, 'enUS', 'It\'s mine! MINE!', 'It\'s mine! MINE!', 26124);
INSERT INTO `broadcast_text_locale` VALUES (146183, 'enUS', 'Ow! Enough! You can keep it!', 'Ow! Enough! You can keep it!', 26124);
INSERT INTO `broadcast_text_locale` VALUES (146184, 'enUS', 'I give up! Here, take it!', 'I give up! Here, take it!', 26124);
INSERT INTO `broadcast_text_locale` VALUES (146185, 'enUS', 'I give, I give!!', 'I give, I give!!', 26124);
INSERT INTO `broadcast_text_locale` VALUES (146186, 'enUS', 'Mercy! Here take it, I didn\'t want it anyway!', 'Mercy! Here take it, I didn\'t want it anyway!', 26124);
INSERT INTO `broadcast_text_locale` VALUES (146187, 'enUS', 'Do hurry, $nistine or whatever you said it was, or I shall find another plebeian upon whom to bestow this great honor!', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (146188, 'enUS', 'Uncle! Take all of it! I don\'t want it anymore!', 'Uncle! Take all of it! I don\'t want it anymore!', 26124);
INSERT INTO `broadcast_text_locale` VALUES (146189, 'enUS', 'Behind you!', 'Behind you!', 26124);
INSERT INTO `broadcast_text_locale` VALUES (146191, 'enUS', 'How convenient! I could not have timed this better myself.', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (146192, 'enUS', 'What are you waiting for? Concentrate and banish this creature!', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (146194, 'enUS', 'R-right!', 'R-right!', 26124);
INSERT INTO `broadcast_text_locale` VALUES (146195, 'enUS', 'Pathetic.', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (146200, 'enUS', 'I don\'t feel so good...', 'I don\'t feel so good...', 26124);
INSERT INTO `broadcast_text_locale` VALUES (146201, 'enUS', 'Calm yourself and it will pass.', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (146202, 'enUS', 'Your emotions expose weakness. The Void will exploit that if you let it.', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (146212, 'enUS', 'For the Alliance!', 'For the Alliance!', 26124);
INSERT INTO `broadcast_text_locale` VALUES (146213, 'enUS', '', 'Don\'t worry about the airship, I\'ll keep an eye out for any... unwanted guests.', 26124);
INSERT INTO `broadcast_text_locale` VALUES (146214, 'enUS', 'Any alliance get aboard this ship, they\'ll be incinerated.', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (146231, 'enUS', 'Although broken and scattered, this rift holds many secrets. It will teach us much about the nature of the shadows.', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (146233, 'enUS', 'Open fire!', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (146237, 'enUS', 'The mail must go through!', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (146238, 'enUS', 'I want to sort letters!', 'I want to sort letters!', 26124);
INSERT INTO `broadcast_text_locale` VALUES (146239, 'enUS', 'I need help sorting these letters!', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (146350, 'enUS', '', 'We\'ve barely finished fighting the Burning Legion and the Horde is already up to no good!', 26124);
INSERT INTO `broadcast_text_locale` VALUES (146351, 'enUS', 'Alright! Alright! I\'ll get back to work!', 'Alright! Alright! I\'ll get back to work!', 26124);
INSERT INTO `broadcast_text_locale` VALUES (146352, 'enUS', 'I was just taking a break!', 'I was just taking a break!', 26124);
INSERT INTO `broadcast_text_locale` VALUES (146353, 'enUS', 'Back to work! I get it!', 'Back to work! I get it!', 26124);
INSERT INTO `broadcast_text_locale` VALUES (146354, 'enUS', 'You don\'t have to get physical! I\'ll get back to work!', 'You don\'t have to get physical! I\'ll get back to work!', 26124);
INSERT INTO `broadcast_text_locale` VALUES (146355, 'enUS', 'I was just resting my eyes!', 'I was just resting my eyes!', 26124);
INSERT INTO `broadcast_text_locale` VALUES (146356, 'enUS', 'They sent in the muscle! Run for it!', 'They sent in the muscle! Run for it!', 26124);
INSERT INTO `broadcast_text_locale` VALUES (146357, 'enUS', 'It isn\'t often one gets the opportunity to study a new mineral!$b$bWho knows what mysteries the azerite holds!', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (146358, 'enUS', 'I won\'t be staying long, so we must speak quickly.', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (146359, 'enUS', 'We will take this land for the glory of the Horde!', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (146360, 'enUS', '', 'Dissecting giant bugs ain\'t an easy way to make a living, but it sure does pay well!', 26124);
INSERT INTO `broadcast_text_locale` VALUES (146361, 'enUS', 'ODYN\'S BEARD! I\'M BURNIN\' UP!', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (146362, 'enUS', 'Remain in control of your thoughts. The void cannot sway that which is immutable.', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (146367, 'enUS', 'Now you\'re gonna get it!', 'Now you\'re gonna get it!', 26124);
INSERT INTO `broadcast_text_locale` VALUES (146368, 'enUS', 'I\'m gonna teach you a lesson!', 'I\'m gonna teach you a lesson!', 26124);
INSERT INTO `broadcast_text_locale` VALUES (146369, 'enUS', 'Don\'t mess with the cartel!', 'Don\'t mess with the cartel!', 26124);
INSERT INTO `broadcast_text_locale` VALUES (146370, 'enUS', 'You\'re gonna regret pickin\' a fight with me!', 'You\'re gonna regret pickin\' a fight with me!', 26124);
INSERT INTO `broadcast_text_locale` VALUES (146371, 'enUS', 'No trespassing!', 'No trespassing!', 26124);
INSERT INTO `broadcast_text_locale` VALUES (146372, 'enUS', 'I hope you like bloody noses!', 'I hope you like bloody noses!', 26124);
INSERT INTO `broadcast_text_locale` VALUES (146373, 'enUS', 'The reckoning has come early for you!', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (146374, 'enUS', 'Ogmot gonna eat your soul! HAHAHA!', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (146375, 'enUS', 'Filthy $r, I\'ll make you bleed!', 'Filthy $r, I\'ll make you bleed!', 26124);
INSERT INTO `broadcast_text_locale` VALUES (146376, 'enUS', 'You\'re going to pay for your crimes against the Alliance!', 'You\'re going to pay for your crimes against the Alliance!', 26124);
INSERT INTO `broadcast_text_locale` VALUES (146377, 'enUS', 'Death is upon you!', 'Death is upon you!', 26124);
INSERT INTO `broadcast_text_locale` VALUES (146378, 'enUS', 'Don\'t die too quickly! I want to enjoy this!', 'Don\'t die too quickly! I want to enjoy this!', 26124);
INSERT INTO `broadcast_text_locale` VALUES (146379, 'enUS', 'Now you see me, but soon you won\'t!', 'Now you see me, but soon you won\'t!', 26124);
INSERT INTO `broadcast_text_locale` VALUES (146380, 'enUS', 'Horde scum! Die!', 'Horde scum! Die!', 26124);
INSERT INTO `broadcast_text_locale` VALUES (146422, 'enUS', '', 'Welcome! Now where are the chairs?$B$BOh. Feel free to pull up that... block of wood and sit...down?', 26124);
INSERT INTO `broadcast_text_locale` VALUES (146423, 'enUS', '', 'Honestly, if the local cuisine wasn\'t absolutely mouthwatering I wouldn\'t know what to do with myself.', 26124);
INSERT INTO `broadcast_text_locale` VALUES (146431, 'enUS', 'Incredible! The surrounding area alone houses at least forty species of plants I am unfamiliar with.', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (146432, 'enUS', 'Give me a challenge! I want to sort the letters with partial addresses.', 'Give me a challenge! I want to sort the letters with partial addresses.', 26124);
INSERT INTO `broadcast_text_locale` VALUES (146433, 'enUS', 'Still plenty of letters to sort, if you\'re up to it!$B$BOr how about something more challenging? We also receive letters without a full address on them.$B$BThink you can handle it?', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (146434, 'enUS', 'Excellent work, $n! You might be ready for something more challenging... Speak with me if you\'re interested!', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (146448, 'enUS', '', 'This workshop is a bit \"rustic\" for my tastes.', 26124);
INSERT INTO `broadcast_text_locale` VALUES (146449, 'enUS', '', 'Non-magical devices are for mana-starved whelps, they said. Non-magical devices serve no purpose, they said. $B$BOrgrimmar practically runs on such creations!$B$BTime for me to show those palanquin-addled wretches back home the perfection of machinery!', 26124);
INSERT INTO `broadcast_text_locale` VALUES (146461, 'enUS', '', 'Walk the path that Huln took so very long ago, and bring honor to the name... Highmountain.', 26124);
INSERT INTO `broadcast_text_locale` VALUES (146462, 'enUS', '', 'And in turn, we have been reborn as instruments of its power.', 26124);
INSERT INTO `broadcast_text_locale` VALUES (146463, 'enUS', '', 'But to those who would threaten this world... or attack our allies... you will embody the Light\'s wrath.', 26124);
INSERT INTO `broadcast_text_locale` VALUES (146471, 'enUS', '', 'Have you gathered the information I require?', 26124);
INSERT INTO `broadcast_text_locale` VALUES (146472, 'enUS', '', 'Yes, here are the results.', 26124);
INSERT INTO `broadcast_text_locale` VALUES (146473, 'enUS', '', '...you have done well. My master shall be pleased to see this.', 26124);
INSERT INTO `broadcast_text_locale` VALUES (146475, 'enUS', '', 'Venture forth alongside new allies and show the world that the legacy of the nightborne is one of nobility... and strength.', 26124);
INSERT INTO `broadcast_text_locale` VALUES (146476, 'enUS', '', 'Its whispers have broken the will of dragons... and lured even the titans\' own children into madness.', 26124);
INSERT INTO `broadcast_text_locale` VALUES (146477, 'enUS', '', 'That the Void is a power to be harnessed... to be bent by a will strong enough to command it.', 26124);
INSERT INTO `broadcast_text_locale` VALUES (146482, 'enUS', '', 'Wield the shadows as a weapon to save our world... and defend the Alliance!', 26124);
INSERT INTO `broadcast_text_locale` VALUES (146516, 'enUS', 'The void energy released when the ethereals attacked left the other islands unstable. No one is allowed beyond this point.', 'The void energy released when the ethereals attacked left the other islands unstable. No one is allowed beyond this point.', 26124);
INSERT INTO `broadcast_text_locale` VALUES (146517, 'enUS', 'The last people who ventured beyond this space were consumed by the shadows.', 'The last people who ventured beyond this space were consumed by the shadows.', 26124);
INSERT INTO `broadcast_text_locale` VALUES (146522, 'enUS', 'Come to have your equipment repaired?$B$BOr would you like some quality tools of your own?', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (146543, 'enUS', '', 'Looking for a lift? Going someplace special I hope!', 26124);
INSERT INTO `broadcast_text_locale` VALUES (146544, 'enUS', 'I need a flight to Staghelm Point.', 'I need a flight to Staghelm Point.', 26124);
INSERT INTO `broadcast_text_locale` VALUES (146552, 'enUS', 'Your connection to the spirits begins to fade...', 'Your connection to the spirits begins to fade...', 26124);
INSERT INTO `broadcast_text_locale` VALUES (146561, 'enUS', 'Time heals all wounds... especially when you can travel back in time, to before the wound occurred!', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (146562, 'enUS', 'Show me Silithus before it was pierced.', 'Show me Silithus before it was pierced.', 26124);
INSERT INTO `broadcast_text_locale` VALUES (146563, 'enUS', 'Take me back to the present.', 'Take me back to the present.', 26124);
INSERT INTO `broadcast_text_locale` VALUES (146605, 'enUS', '', 'All our attention is focused on foiling the Horde\'s efforts. We can\'t spare resources to make this flight network fully functional.\n\nIf you need to fly away from this wretched desert, you\'ll have to manage it yourself.\n\nShould you be facing a dire emergency, I suppose I could cobble together resources for a single flight...', 26124);
INSERT INTO `broadcast_text_locale` VALUES (146606, 'enUS', 'I need to meet with Magni Bronzebeard at once.', 'I need to meet with Magni Bronzebeard at once.', 26124);
INSERT INTO `broadcast_text_locale` VALUES (146636, 'enUS', 'Our orders are to obtain this mysterious ore by any means necessary.', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (146637, 'enUS', '', 'I can\'t wait to see the looks on their greedy faces when all of their shredders are blown to bits!', 26124);
INSERT INTO `broadcast_text_locale` VALUES (146638, 'enUS', '', 'We must find out how the silithid survived the blade of Sargeras!', 26124);
INSERT INTO `broadcast_text_locale` VALUES (146641, 'enUS', 'We cannot afford a resurgence of the Twilight\'s Hammer. Voidstrider must die!', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (146736, 'enUS', 'Turn back! You\'re entering uncharted territory', 'Turn back! You\'re entering uncharted territory', 26124);
INSERT INTO `broadcast_text_locale` VALUES (146737, 'enUS', 'Your ancestry is rich with stories. Fascinating! I look forward to learning more, $r. Perhaps I should fetch some stronger incense!', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (146745, 'enUS', 'These goblins are so busy with their extraction equipment that they haven\'t set up a proper flight station.\n\n<Urok grumbles and kicks the dirt.>\n\nIf you\'re lookin\' for a flight outta this place, you\'re on your own.\n\nI guess if the world\'s ending I might be able to figure somethin\' out...', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (146755, 'enUS', '', 'Fools squabble over lands below, while those with vision rule the skies above!', 26124);
INSERT INTO `broadcast_text_locale` VALUES (146757, 'enUS', 'I need a flight to Southwind Village.', 'I need a flight to Southwind Village.', 26124);
INSERT INTO `broadcast_text_locale` VALUES (146851, 'enUS', '', 'Don\'t be afraid to get your hands dirty crackin\' those silithid skulls!', 26124);
INSERT INTO `broadcast_text_locale` VALUES (146854, 'enUS', '', 'This research is gonna help us understand the power of that giant blade!', 26124);
INSERT INTO `broadcast_text_locale` VALUES (146857, 'enUS', 'You gotta take out those dirty SI:7 spies before they ruin the whole operation!', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (146861, 'enUS', 'Get out there and put those lazy prospectors in their place!', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (146863, 'enUS', 'We cannot let this fanatic rally the remaining survivors to action! Bring me his head!', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (146918, 'enUS', '', 'Another perfect batch! It smells so tasty!', 26124);
INSERT INTO `broadcast_text_locale` VALUES (146920, 'enUS', 'This is a very old place. Broken by rage, yet sculpted by the threads of fate. \n\nThere is much to be learned here. I believe I might linger a while.\n\nBe seeing you.', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (146922, 'enUS', 'What do you know of Telogrus?', 'What do you know of Telogrus?', 26124);
INSERT INTO `broadcast_text_locale` VALUES (146958, 'enUS', 'We have a forsaken ambassador, which makes sense given our Warchief, of course.\n\nBut I can\'t help asking myself, \"what has it cost us?\"\n\nIf you have a moment, can you please tell me of your experience with Ambassador Blackguard?', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (146959, 'enUS', 'Thank you for taking my survey, $n.\n\nI shall present the petition after I have enough signatures.\n\nGood day to you, $r.', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (146960, 'enUS', 'He was rude and blatantly offensive.', 'He was rude and blatantly offensive.', 26124);
INSERT INTO `broadcast_text_locale` VALUES (146961, 'enUS', 'His appearance was off-putting.', 'His appearance was off-putting.', 26124);
INSERT INTO `broadcast_text_locale` VALUES (146962, 'enUS', 'He should be replaced immediately!', 'He should be replaced immediately!', 26124);
INSERT INTO `broadcast_text_locale` VALUES (147039, 'enUS', '', 'The Legion nearly took everything from us... while I blindly trusted Elisande.\n\nI am relieved that Suramar is back in our hands.', 26124);
INSERT INTO `broadcast_text_locale` VALUES (147040, 'enUS', '', 'I suppose I should thank you.$B$B<Anarys dips her head slightly at you.>', 26124);
INSERT INTO `broadcast_text_locale` VALUES (147041, 'enUS', '', 'I stood by and watched as Elisande led us astray.\n\nI was wrong... about everything.', 26124);
INSERT INTO `broadcast_text_locale` VALUES (147042, 'enUS', 'I suppose I should thank you.$B$B<Anarys dips his head slightly at you.>', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (147043, 'enUS', 'I stood by and watched as Elisande led us astray.\n\nI was wrong... about everything.', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (147044, 'enUS', 'Come to gloat, have you?', 'Come to gloat, have you?', 26124);
INSERT INTO `broadcast_text_locale` VALUES (147047, 'enUS', 'Oh, goodness me! Did you slip?', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (147048, 'enUS', 'Best be careful close to the edge, $n.', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (147049, 'enUS', 'Did you fall, or was that a graceful jump designed to look like a clumsy fall?', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (147050, 'enUS', 'Watch your step! I can\'t do this all day! Actually, I suppose I can.', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (147051, 'enUS', 'Are you conducting some kind of dangerous experiment? I like it!', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (147052, 'enUS', 'If you\'re going to fall to your death, do it somewhere else.', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (147053, 'enUS', 'Mind the gap.', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (147084, 'enUS', 'Oh! Hello there... fellow member of the Alliance.\n\nI mean no disrespect, but... I\'m just not entirely sure the cathedral is the most... appropriate place for... for...\n\nFor someone who indulges such... unique proclivities.', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (147098, 'enUS', 'The Light does not treat with the Void, elf. You should leave this place.', 'The Light does not treat with the Void, elf. You should leave this place.', 26124);
INSERT INTO `broadcast_text_locale` VALUES (147100, 'enUS', 'This place is not meant for you.', 'This place is not meant for you.', 26124);
INSERT INTO `broadcast_text_locale` VALUES (147104, 'enUS', 'I can sense the shadow in you. Though it is diminished in the presence of the Light.', 'I can sense the shadow in you. Though it is diminished in the presence of the Light.', 26124);
INSERT INTO `broadcast_text_locale` VALUES (147109, 'enUS', 'Thank you, but I do not require your aid.', 'Thank you, but I do not require your aid.', 26124);
INSERT INTO `broadcast_text_locale` VALUES (147130, 'enUS', 'Have you come to supplicate yourself before the Light? $b$bIf you are here to speak with Archbishop Benedictus, I am sorry to inform you that he has left on a mission.', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (147153, 'enUS', 'I will help in whatever way I can, but I suggest you do not linger too long here.', 'I will help in whatever way I can, but I suggest you do not linger too long here.', 26124);
INSERT INTO `broadcast_text_locale` VALUES (147159, 'enUS', 'I commend your dedication. However, I fear you walk a dangerous path.$B$BYou would best serve the Alliance away from the cathedral.', 'I commend your dedication. However, I fear you walk a dangerous path.$B$BYou would best serve the Alliance away from the cathedral.', 26124);
INSERT INTO `broadcast_text_locale` VALUES (147169, 'enUS', 'Tread carefully, $c. Lady Alleria\'s name will only carry you so far.', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (147173, 'enUS', 'Perhaps is it as Alleria Windrunner says, and the whispers of shadow can be controlled.\n\nBe on your guard, friend, and may the Ligh--\n\nHrm. Well... May fortune favor you.', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (147183, 'enUS', 'I\'ve spent enough time with clumsy fingers here that I\'ve picked up a thing or two about treating injuries. Perhaps I can offer you some training?', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (147187, 'enUS', 'I will admit, it took some time to grow accustomed to our transformation. At first, my usual dexterity felt... impeded.$B$BHowever, I can guarantee the techniques themselves have in no way been affected.', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (147188, 'enUS', 'These machines are fantastic! How could they operate with no anomalies or chance of failure?$B$BOh, excuse me. Did you need something?', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (147191, 'enUS', 'We have learned much from our fight against the Legion. In truth, these warframes are the culmination of many years of research.$B$BIf you wish, I can train you to craft similar devices.', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (147192, 'enUS', 'Hmm. Nice try, but you are missing a touch of darkness in that outfit.', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (147193, 'enUS', 'This is an invitation-only gathering. Did you bring an invitation? No?$B$BI thought not.', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (147196, 'enUS', '', 'What can I do for you?', 26124);
INSERT INTO `broadcast_text_locale` VALUES (147197, 'enUS', 'Aye, I have a moment. What do ye want?', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (147200, 'enUS', '', 'Do you need something magically enhanced, or have you come to learn?', 26124);
INSERT INTO `broadcast_text_locale` VALUES (147205, 'enUS', 'I used to be a famous pirate!\n\nThey dig me up, hand me this tophat, then tell me I have to greet all of you newcomers with a smile on my face...', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (147206, 'enUS', 'Do you have any idea how much it hurts to try to crack a smile?\n\nThis is ridiculous!', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (147207, 'enUS', 'What do I have to do to get myself out of this job?\n\nI try to leave, some orc picks me up and plops me right back down here.', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (147208, 'enUS', 'Psst... Yeah, you, $r.\n\nHey, can you put in a bad word for me with the Warchief? I need to get fired. Being a jerk to everyone isn\'t working!', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (147209, 'enUS', 'I really hated this tophat at first. What does a guy have to do for a good tricorne?\n\nBut I must say... this fits real nicely on my skull.', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (147210, 'enUS', 'Greetings, Lightforged! Know that you are always welcome here in the Cathedral of Light.', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (147211, 'enUS', 'To have given yourself wholly to the Light... you are an example to us all.', 'To have given yourself wholly to the Light... you are an example to us all.', 26124);
INSERT INTO `broadcast_text_locale` VALUES (147212, 'enUS', 'You will always have steadfast allies here.', 'You will always have steadfast allies here.', 26124);
INSERT INTO `broadcast_text_locale` VALUES (147213, 'enUS', 'Should you ever need my assistance, you know where to find me.', 'Should you ever need my assistance, you know where to find me.', 26124);
INSERT INTO `broadcast_text_locale` VALUES (147214, 'enUS', 'May the Light ever guide you, $n.', 'May the Light ever guide you, $n.', 26124);
INSERT INTO `broadcast_text_locale` VALUES (147217, 'enUS', 'I got the axe.$B$BSee? I brought it with me.', 'I got the axe.$B$BSee? I brought it with me.', 26124);
INSERT INTO `broadcast_text_locale` VALUES (147218, 'enUS', 'Downsized? I\'m already about as downsized as you can get!', 'Downsized? I\'m already about as downsized as you can get!', 26124);
INSERT INTO `broadcast_text_locale` VALUES (147219, 'enUS', 'Boss Mida says I\'m bein\' discharged. The only things that oughta be discharged are guns and explosives!', 'Boss Mida says I\'m bein\' discharged. The only things that oughta be discharged are guns and explosives!', 26124);
INSERT INTO `broadcast_text_locale` VALUES (147220, 'enUS', 'I\'ve been downwardly promoted.', 'I\'ve been downwardly promoted.', 26124);
INSERT INTO `broadcast_text_locale` VALUES (147221, 'enUS', 'We\'re here as part of a \"workforce adjustment.\"', 'We\'re here as part of a \"workforce adjustment.\"', 26124);
INSERT INTO `broadcast_text_locale` VALUES (147222, 'enUS', '', 'The Alliance needs strength. Unity. The king\'s plan to bring in fresh blood is a good one.\n\nBut I can\'t help thinking of my own Dark Iron clan. Of the fractures that divide us.', 26124);
INSERT INTO `broadcast_text_locale` VALUES (147223, 'enUS', '', 'One day Silvermoon will stand again on the side of the Alliance. I know it.', 26124);
INSERT INTO `broadcast_text_locale` VALUES (147224, 'enUS', 'Much about Azeroth has changed in the years I was absent. But the Alliance remains an ideal worth fighting for.\n\nI will do everything in my power to make it stronger.', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (147225, 'enUS', 'I used to have a cushy office job in Orgrimmar.', 'I used to have a cushy office job in Orgrimmar.', 26124);
INSERT INTO `broadcast_text_locale` VALUES (147226, 'enUS', 'The campaign on Argus was costly, but necessary. Now we must focus on defending our own lands.\n\nWe cannot sit idle while those Horde monsters build their forces.', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (147227, 'enUS', 'My position has been eliminated... feels like early retirement.', 'My position has been eliminated... feels like early retirement.', 26124);
INSERT INTO `broadcast_text_locale` VALUES (147228, 'enUS', 'The young king reminds me so much of his father. More than he realizes, I think.\n\nHe\'s the right person to lead this effort and bring new faces into the Alliance.', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (147229, 'enUS', '', 'It seems like only yesterday that those of us who follow the way of the Tushui pledged to fight for the Alliance. \n\nThough I have great respect for King Anduin, I must confess that I found his father a more capable sparring partner.\n\nPlease do not tell him this.\n\n<Aysa bows.>', 26124);
INSERT INTO `broadcast_text_locale` VALUES (147231, 'enUS', '', '<Tyrande says nothing. Her brow is furrowed, as if deep in thought.>', 26124);
INSERT INTO `broadcast_text_locale` VALUES (147233, 'enUS', 'I have spent too long depending on visions to guide me.\n\nIt is time we forge our own fate. Part of that is finding new allies to stand beside us.', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (147234, 'enUS', '<Ji Firepaw meditates in silence.>', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (147235, 'enUS', 'The spirit of Ol\' Vol\'jin still be strong in dis city, mon. Da work ya be doin\' honors his memory.', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (147236, 'enUS', 'Well, well... the illustrious $ct. Still basking in the glory of your victory over the Legion, no doubt.$B$B<Nathanos rolls his eyes.>$B$BThe Dark Lady has entrusted you with securing new allies for the Horde. For your sake, let us hope her faith has not been misplaced.', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (147237, 'enUS', 'The local cuisine has some... interesting spice to it.', 'The local cuisine has some... interesting spice to it.', 26124);
INSERT INTO `broadcast_text_locale` VALUES (147238, 'enUS', 'Yeah, sure. Allies. I get it.\n\nBut I got a business to run, see. And a rather delicate operation in the works.\n\nSo how about you handle your end and I\'ll handle mine.', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (147239, 'enUS', 'Diplomacy has never been my strong suit.\n\nThis work is best left in your hands.', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (147240, 'enUS', 'The Horde needs allies. This is true.\n\nBut to be worthy of a place here, those we recruit must have honor in their hearts. If they lack it, their presence only diminishes us.', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (147241, 'enUS', 'This drink is green! Why is it green?', 'This drink is green! Why is it green?', 26124);
INSERT INTO `broadcast_text_locale` VALUES (147250, 'enUS', 'There are no heroes in oblivion!', 'There are no heroes in oblivion!', 26124);
INSERT INTO `broadcast_text_locale` VALUES (147251, 'enUS', 'None shall oppose the Twilight\'s Hammer!', 'None shall oppose the Twilight\'s Hammer!', 26124);
INSERT INTO `broadcast_text_locale` VALUES (147252, 'enUS', 'We are the harbingers of destruction!', 'We are the harbingers of destruction!', 26124);
INSERT INTO `broadcast_text_locale` VALUES (147253, 'enUS', 'Cry for help... none shall answer you!', 'Cry for help... none shall answer you!', 26124);
INSERT INTO `broadcast_text_locale` VALUES (147254, 'enUS', 'The twilight is upon you!', 'The twilight is upon you!', 26124);
INSERT INTO `broadcast_text_locale` VALUES (147255, 'enUS', 'None shall withstand the power of our master!', 'None shall withstand the power of our master!', 26124);
INSERT INTO `broadcast_text_locale` VALUES (147256, 'enUS', 'I am your destruction!', 'I am your destruction!', 26124);
INSERT INTO `broadcast_text_locale` VALUES (147257, 'enUS', 'You will kneel before our master!', 'You will kneel before our master!', 26124);
INSERT INTO `broadcast_text_locale` VALUES (147263, 'enUS', '', 'They may come from Highmountain, but they sure can get low. It\'s the Highmountain tauren!', 26124);
INSERT INTO `broadcast_text_locale` VALUES (147264, 'enUS', '', 'The moose is loose! Highmountain tauren, GO!', 26124);
INSERT INTO `broadcast_text_locale` VALUES (147265, 'enUS', '', 'Adventurers by day, dancers by night... borne. It\'s time to cheer for the nightborne!', 26124);
INSERT INTO `broadcast_text_locale` VALUES (147266, 'enUS', '', 'An illusion!? Nope... it\'s just the dancing nightborne!', 26124);
INSERT INTO `broadcast_text_locale` VALUES (147267, 'enUS', '', 'Just because you\'re an avatar of darkness doesn\'t mean you can\'t get funky. Hit it, void elves!', 26124);
INSERT INTO `broadcast_text_locale` VALUES (147268, 'enUS', '', 'Get down with your bad self, void elf!', 26124);
INSERT INTO `broadcast_text_locale` VALUES (147269, 'enUS', '', 'Turn off the disco ball and these lightforged draenei will still light up the stage!', 26124);
INSERT INTO `broadcast_text_locale` VALUES (147270, 'enUS', '', 'The lightforged draenei came here to dance and kill demons. And we\'re all out of demons!', 26124);
INSERT INTO `broadcast_text_locale` VALUES (147271, 'enUS', '', 'Remember, control demands sacrifice. Power never comes without a price. You risk losing those closest to you in order to save them.\n\nThis is the bargain we have made.\n\n<Alleria looks away.>', 26124);
INSERT INTO `broadcast_text_locale` VALUES (147272, 'enUS', '', 'Studying this rift has value, but we cannot neglect our duty.\n\nAzeroth must be defended. Our place is out there, fighting for our world.\n\nThe power that flows through us is a weapon. And weapons must be wielded.', 26124);
INSERT INTO `broadcast_text_locale` VALUES (147276, 'enUS', 'Locus-Walker is an intriguing fellow.\n\nAlleria seems to trust him... to a point.\n\nI think we can learn much from him, so long as we remain wary of his true intentions.', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (147298, 'enUS', ':', ':', 26124);
INSERT INTO `broadcast_text_locale` VALUES (147299, 'enUS', 'Khadgar asked me to deliver this letter.', 'Khadgar asked me to deliver this letter.', 26124);
INSERT INTO `broadcast_text_locale` VALUES (147304, 'enUS', 'The situation in Silithus is now under our control. I will see to the rest of the operation. Go with honor, $n.', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (147308, 'enUS', '', 'Thanks to you, we are now one step closer to understanding the effect that the blade is having on Silithus!', 26124);
INSERT INTO `broadcast_text_locale` VALUES (147309, 'enUS', 'I\'ve never seen anythin\' like this in all my years! What can it be?', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (147310, 'enUS', 'I think we\'ve got the situation in Silithus under control. SI:7 can take the operation from here. Thanks again, $n.', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (147341, 'enUS', 'The Horde has gathered over 1200 Azerite and is near victory!', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (147342, 'enUS', 'The Alliance has gathered over 1200 Azerite and is near victory!', '', 26124);
INSERT INTO `broadcast_text_locale` VALUES (147378, 'enUS', 'I\'ve been staring up at that sword all day. Still can\'t believe it\'s real.', 'I\'ve been staring up at that sword all day. Still can\'t believe it\'s real.', 26124);
INSERT INTO `broadcast_text_locale` VALUES (147379, 'enUS', 'The world\'s bleeding out. Can you stop it, hero?', 'The world\'s bleeding out. Can you stop it, hero?', 26124);
INSERT INTO `broadcast_text_locale` VALUES (147380, 'enUS', 'No way we\'re survivin\' this.', 'No way we\'re survivin\' this.', 26124);
INSERT INTO `broadcast_text_locale` VALUES (147381, 'enUS', 'Maybe this is the end of days.', 'Maybe this is the end of days.', 26124);
INSERT INTO `broadcast_text_locale` VALUES (147382, 'enUS', 'The doomsayers were right. Azeroth is dying.', 'The doomsayers were right. Azeroth is dying.', 26124);
INSERT INTO `broadcast_text_locale` VALUES (147384, 'enUS', 'I should be at home with my family...', 'I should be at home with my family...', 26124);
INSERT INTO `broadcast_text_locale` VALUES (147385, 'enUS', 'Sure hope you can do something to save us, hero.', 'Sure hope you can do something to save us, hero.', 26124);
INSERT INTO `broadcast_text_locale` VALUES (147387, 'enUS', 'Where are all the other heroes who are supposed to protect us?', 'Where are all the other heroes who are supposed to protect us?', 26124);
INSERT INTO `broadcast_text_locale` VALUES (147388, 'enUS', 'Been staring up at that sword all day. Still can\'t believe it\'s real.', 'Been staring up at that sword all day. Still can\'t believe it\'s real.', 26124);
INSERT INTO `broadcast_text_locale` VALUES (147389, 'enUS', 'The world\'s bleedin\' out. Hope you can stop it, hero.', 'The world\'s bleedin\' out. Hope you can stop it, hero.', 26124);
INSERT INTO `broadcast_text_locale` VALUES (147390, 'enUS', 'Even the Dark Lady can\'t save us now...', 'Even the Dark Lady can\'t save us now...', 26124);
INSERT INTO `broadcast_text_locale` VALUES (147391, 'enUS', 'Sure hope the boss knows what he\'s doin\'.', 'Sure hope the boss knows what he\'s doin\'.', 26124);
INSERT INTO `broadcast_text_locale` VALUES (147392, 'enUS', 'Ain\'t easy ta meet my quota with that giant sword loomin\' overhead!', 'Ain\'t easy ta meet my quota with that giant sword loomin\' overhead!', 26124);
INSERT INTO `broadcast_text_locale` VALUES (147393, 'enUS', 'You\'re in the world savin\' business, ain\'t ya? Maybe you should get ta work!', 'You\'re in the world savin\' business, ain\'t ya? Maybe you should get ta work!', 26124);
INSERT INTO `broadcast_text_locale` VALUES (147394, 'enUS', 'Should be earnin\' hazard pay for this!', 'Should be earnin\' hazard pay for this!', 26124);
